														"GoogleFu \u0e08\u0e30\u0e44\u0e21\u0e48\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e17\u0e35\u0e48\u0e08\u0e30\u0e15\u0e34\u0e14\u0e15\u0e48\u0e2d\u0e01\u0e31\u0e1a\u0e40\u0e0b\u0e34\u0e23\u0e4c\u0e1f\u0e40\u0e27\u0e2d\u0e23\u0e4c\u0e02\u0e2d\u0e07 Google \u0e43\u0e19\u0e02\u0e13\u0e30\u0e17\u0e35\u0e48\u0e04\u0e38\u0e13\u0e2d\u0e22\u0e39\u0e48\u0e43\u0e19\u0e40\u0e1b\u0e49\u0e32\u0e2b\u0e21\u0e32\u0e22\u0e41\u0e1e\u0e25\u0e15\u0e1f\u0e2d\u0e23\u0e4c\u0e21\u0e19\u0e35\u0e49 GoogleFu \u0e08\u0e30\u0e16\u0e39\u0e01\u0e1b\u0e34\u0e14\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19\u0e08\u0e19\u0e01\u0e27\u0e48\u0e32\u0e04\u0e38\u0e13\u0e08\u0e30\u0e40\u0e1b\u0e25\u0e35\u0e48\u0e22\u0e19\u0e01\u0e25\u0e31\u0e1a\u0e44\u0e1b\u0e2a\u0e19\u0e31\u0e1a\u0e2a\u0e19\u0e38\u0e19\u0e40\u0e1b\u0e49\u0e32\u0e2b\u0e21\u0e32\u0e22",
														"GoogleFu hindi na magagawang makipag-ugnay sa Server ng Google habang ikaw ay nasa ito Platform Target. GoogleFu ay hindi pagaganahin hanggang sa bumalik ka sa isang suportadong Target.",
														"GoogleFu Bu Platform Target ise Google Sunucular\u0131 irtibata m\u00fcmk\u00fcn olmayacakt\u0131r. Desteklenen bir hedef geri d\u00f6nmek kadar GoogleFu devre d\u0131\u015f\u0131 b\u0131rak\u0131l\u0131r.",
														"GoogleFu \u043d\u0435 \u0437\u043c\u043e\u0436\u0435 \u0437\u0432'\u044f\u0437\u0430\u0442\u0438\u0441\u044f \u0437 Google \u0421\u0435\u0440\u0432\u0435\u0440\u0438 \u0432 \u0442\u043e\u0439 \u0447\u0430\u0441 \u044f\u043a \u0432\u0438 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0435\u0441\u044c \u0432 \u0446\u0456\u0454\u0457 \u043f\u043b\u0430\u0442\u0444\u043e\u0440\u043c\u0438 Target. GoogleFu \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0456 \u0434\u043e \u0442\u0438\u0445 \u043f\u0456\u0440, \u043f\u043e\u043a\u0438 \u0437\u043d\u043e\u0432\u0443 \u043d\u0435 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u043d\u043e\u043c\u0443 Target.",
														"\u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05e0\u05d9\u05d8 \u05e7\u05e2\u05e0\u05e2\u05df \u05e6\u05d5 \u05e7\u05d0\u05b8\u05e0\u05d8\u05d0\u05b7\u05e7\u05d8 \u05d2\u05d5\u05d2\u05dc \u05e1\u05e2\u05e8\u05d5\u05d5\u05e2\u05e8\u05e1 \u05d1\u05e9\u05e2\u05ea \u05d0\u05d9\u05e8 \u05d6\u05e2\u05e0\u05e2\u05df \u05d0\u05d9\u05df \u05d3\u05e2\u05dd \u05e4\u05bc\u05dc\u05d0\u05b7\u05d8\u05e4\u05d0\u05b8\u05e8\u05de\u05e2 \u05e6\u05d9\u05dc. \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05df \u05e4\u05d0\u05b7\u05e8\u05e7\u05e8\u05d9\u05e4\u05bc\u05dc\u05d8 \u05d1\u05d9\u05d6 \u05d0\u05d9\u05e8 \u05d1\u05d0\u05b7\u05e9\u05d8\u05d9\u05de\u05e2\u05df \u05e6\u05d5\u05e8\u05d9\u05e7 \u05e6\u05d5 \u05d0\u05b7 \u05d2\u05e2\u05e9\u05d8\u05d9\u05e6\u05d8 \u05e6\u05d9\u05dc.",
														"GoogleFu\u5c07\u7121\u6cd5\u8207\u8c37\u6b4c\u7684\u670d\u52d9\u5668\uff0c\u800c\u4f60\u5728\u9019\u500b\u5e73\u53f0\u7684\u76ee\u6a19\u3002 GoogleFu\u5c07\u88ab\u7981\u7528\uff0c\u76f4\u5230\u4f60\u5207\u63db\u56de\u652f\u6301\u7684\u76ee\u6a19\u3002"));
			Rows.Add( new LocalizationRow("Creating a database on your Google Drive.  It will be named \"Untitled\" until you change it from within Google directly. ",
														"Cr\u00e9ation d'une base de donn\u00e9es sur votre Google Drive. Il sera appel\u00e9 \"Untitled\" jusqu'\u00e0 ce que vous changiez de l'int\u00e9rieur directement Google.",
														"Creazione di un database sul tuo Google Drive. Si chiamer\u00e0 \"Untitled\" finch\u00e9 non viene modificata dall'interno direttamente Google.",
														"Erstellen einer Datenbank auf Ihrem Google Drive. Es wird \"Untitled\" benannt werden, bis Sie sie in Google direkt \u00e4ndern.",
														"Creaci\u00f3n de una base de datos en Google Drive. Se llamar\u00e1 \"Sin t\u00edtulo\" hasta que se cambie desde Google directamente.",
														"\u0625\u0646\u0634\u0627\u0621 \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0639\u0644\u0649 \u0645\u062d\u0631\u0643 \u062c\u0648\u062c\u0644 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643. \u0633\u064a\u062a\u0645 \u0623\u0637\u0644\u0642 \u0639\u0644\u064a\u0647\u0627 \u0627\u0633\u0645 \"\u0628\u062f\u0648\u0646 \u0639\u0646\u0648\u0627\u0646\" \u062d\u062a\u0649 \u062a\u0642\u0648\u0645 \u0628\u062a\u063a\u064a\u064a\u0631\u0647 \u0645\u0646 \u062f\u0627\u062e\u0644 \u062c\u0648\u062c\u0644 \u0645\u0628\u0627\u0634\u0631\u0629.",
														"\uadc0\ud558\uc758 Google \ub4dc\ub77c\uc774\ube0c\uc5d0 \ub370\uc774\ud130\ubca0\uc774\uc2a4\ub97c \uc791\uc131. \uc9c1\uc811 \uad6c\uae00 \ub0b4\uc5d0\uc11c \ubcc0\uacbd\ud560 \ub54c\uae4c\uc9c0\uc774 \"\uc81c\ubaa9 \uc5c6\uc74c\"\uc774\ub77c\ub294 \uac83\uc785\ub2c8\ub2e4.",
														"\u60a8\u7684\u8c37\u6b4c\u9a71\u52a8\u5668\u521b\u5efa\u4e00\u4e2a\u6570\u636e\u5e93\u3002\u76f4\u5230\u4f60\u4ece\u5b83\u76f4\u63a5\u5728\u8c37\u6b4c\u6539\u53d8\u5b83\u4f1a\u88ab\u547d\u540d\u4e3a\u201cUntitled\u201d\u3002",
														"Google\u30c9\u30e9\u30a4\u30d6\u4e0a\u306b\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u3092\u4f5c\u6210\u3059\u308b\u3002\u3042\u306a\u305f\u306f\u76f4\u63a5\u30b0\u30fc\u30b0\u30eb\u306e\u4e2d\u304b\u3089\u305d\u308c\u3092\u5909\u66f4\u3059\u308b\u307e\u3067\u3001\u305d\u308c\u306f\u300c\u7121\u984c\u300d\u3068\u3044\u3046\u540d\u524d\u306b\u306a\u308a\u307e\u3059\u3002",
														"\u0421\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0431\u0430\u0437\u044b \u0434\u0430\u043d\u043d\u044b\u0445 \u043d\u0430 \u0432\u0430\u0448\u0435\u043c Google Drive. \u042d\u0442\u043e \u0431\u0443\u0434\u0435\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c\u0441\u044f \"\u0411\u0435\u0437 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u044f\", \u043f\u043e\u043a\u0430 \u0432\u044b \u043d\u0435 \u0438\u0437\u043c\u0435\u043d\u0438\u0442\u0435 \u0435\u0433\u043e \u0438\u0437\u043d\u0443\u0442\u0440\u0438 Google \u043d\u0430\u043f\u0440\u044f\u043c\u0443\u044e.",
														"T\u1ea1o ra m\u1ed9t c\u01a1 s\u1edf d\u1eef li\u1ec7u tr\u00ean Google Drive c\u1ee7a b\u1ea1n. N\u00f3 s\u1ebd \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean l\u00e0 \"Untitled\" cho \u0111\u1ebfn khi b\u1ea1n thay \u0111\u1ed5i n\u00f3 t\u1eeb b\u00ean trong Google tr\u1ef1c ti\u1ebfp.",
														"Een databank cre\u00ebren op uw Google Drive. Het zal de naam \"Untitled\" totdat u deze wijzigt vanuit Google direct.",
														"Skep van 'n databasis op jou Google Drive. Dit sal \"Untitled\" genoem word totdat jy dit verander van binne Google direk.",
														"\u0421\u044a\u0437\u0434\u0430\u0432\u0430\u043d\u0435 \u043d\u0430 \u0431\u0430\u0437\u0430 \u0434\u0430\u043d\u043d\u0438 \u043d\u0430 \u0432\u0430\u0448\u0438\u044f Google Drive. \u0422\u044f \u0449\u0435 \u0431\u044a\u0434\u0435 \u043d\u0430\u0440\u0435\u0447\u0435\u043d\u0430 \"Untitled\", \u0434\u043e\u043a\u0430\u0442\u043e \u043d\u0435 \u044f \u043f\u0440\u043e\u043c\u0435\u043d\u0438\u0442\u0435 \u043e\u0442 \u0432\u044a\u0442\u0440\u0435 \u0434\u0438\u0440\u0435\u043a\u0442\u043d\u043e Google.",
														"\u0421\u0442\u0432\u0430\u0440\u044d\u043d\u043d\u0435 \u0431\u0430\u0437\u044b \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445 \u043d\u0430 \u0432\u0430\u0448\u044b\u043c Google Drive. \u0413\u044d\u0442\u0430 \u0431\u0443\u0434\u0437\u0435 \u043d\u0430\u0437\u044b\u0432\u0430\u0446\u0446\u0430 \"\u0411\u0435\u0437 \u043d\u0430\u0437\u0432\u044b\", \u043f\u0430\u043a\u0443\u043b\u044c \u0432\u044b \u043d\u0435 \u0437\u043c\u0435\u043d\u0456\u0446\u0435 \u044f\u0433\u043e \u0437\u043d\u0443\u0442\u0440\u044b Google \u043d\u0430\u043f\u0440\u0430\u043c\u0443\u044e.",
														"Creaci\u00f3 d'una base de dades a Google Drive. Es dir\u00e0 \"Sense t\u00edtol\" fins que es canvi\u00ef des de Google directament.",
														"Vytvo\u0159en\u00ed datab\u00e1ze na Google Drive. Bude s n\u00e1zvem \"Untitled\", dokud jej nezm\u011bn\u00edte v Google p\u0159\u00edmo.",
														"Creu cronfa ddata ar eich Google Drive. Bydd yn cael ei enw \"Untitled\" nes i chi ei newid o'r tu mewn Google yn uniongyrchol.",
														"Andmebaasi loomine teie Google Drive. Seda nimetatakse \"Untitled\", kuni te seda muuta seestpoolt Google otse.",
														"\u0627\u06cc\u062c\u0627\u062f \u06cc\u06a9 \u067e\u0627\u06cc\u06af\u0627\u0647 \u062f\u0627\u062f\u0647 \u062f\u0631 Google Drive \u0634\u0645\u0627. \u0627\u06cc\u0646 \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0628\u0647 \u0646\u0627\u0645 \"\u0628\u062f\u0648\u0646 \u0639\u0646\u0648\u0627\u0646\" \u062a\u0627 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0634\u0645\u0627 \u0622\u0646 \u0631\u0627 \u0627\u0632 \u062f\u0631\u0648\u0646 \u06af\u0648\u06af\u0644 \u0628\u0647 \u0637\u0648\u0631 \u0645\u0633\u062a\u0642\u06cc\u0645 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0647\u06cc\u062f.",
														"Luominen tietokanta Google Drive. Se nimet\u00e4\u00e4n \"Nimet\u00f6n\", kunnes muutat sit\u00e4 sis\u00e4lt\u00e4p\u00e4in Google suoraan.",
														"Ag cruth\u00fa bunachar sonra\u00ed ar do Google Drive. Beidh s\u00e9 a bheith ainmnithe \"Untitled\" go dt\u00ed go leat \u00e9 a athr\u00fa \u00f3 laistigh Google d\u00edreach.",
														"Creaci\u00f3n dunha base de datos no seu Google Drive. El ser\u00e1 chamado \"Untitled\" ata que sexa modificado desde Google directamente.",
														"\u0905\u092a\u0928\u0947 \u0917\u0942\u0917\u0932 \u0921\u094d\u0930\u093e\u0907\u0935 \u092a\u0930 \u090f\u0915 \u0921\u0947\u091f\u093e\u092c\u0947\u0938 \u092c\u0928\u093e\u0928\u093e. \u0906\u092a \u0938\u0940\u0927\u0947 \u0917\u0942\u0917\u0932 \u0915\u0947 \u092d\u0940\u0924\u0930 \u0938\u0947 \u0907\u0938\u0947 \u092c\u0926\u0932 \u091c\u092c \u0924\u0915 \u092f\u0939 \"\u0936\u0940\u0930\u094d\u0937\u0915\u0939\u0940\u0928\" \u0928\u093e\u092e \u0926\u093f\u092f\u093e \u091c\u093e\u090f\u0917\u093e.",
														"Stvaranje baze podataka o va\u0161em Google Drive. To \u0107e se pod nazivom \"Bez naslova\" dok ga promijeniti iz Googlea izravno.",
														"Kreye yon baz done sou Google Drive ou. Li pral rele \"Untitled\" jiskaske ou chanje li soti nan Google dir\u00e8kteman.",
														"Membuat database di Google Drive. Ini akan diberi nama \"Untitled\" sampai Anda mengubahnya dari dalam Google secara langsung.",
														"B\u00faa til gagnagrunn \u00e1 Google Drive. \u00dea\u00f0 mun heita \"Untitled\" \u00fear til \u00fe\u00fa breytir \u00fea\u00f0 innan fr\u00e1 Google beint.",
														"\u05d9\u05e6\u05d9\u05e8\u05ea \u05de\u05e1\u05d3 \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05d1-Google Drive \u05e9\u05dc\u05da. \u05d6\u05d4 \u05d9\u05d4\u05d9\u05d4 \u05d1\u05e9\u05dd \"\u05dc\u05dc\u05d0 \u05db\u05d5\u05ea\u05e8\u05ea\" \u05e2\u05d3 \u05e9\u05ea\u05e9\u05e0\u05d4 \u05d0\u05d5\u05ea\u05d4 \u05de\u05d1\u05e4\u05e0\u05d9\u05dd \u05d2\u05d5\u05d2\u05dc \u05d9\u05e9\u05d9\u05e8\u05d5\u05ea.",
														"Sukurti duomen\u0173 baz\u0119 savo \"Google\" disk\u0105. Jis bus pavadintas \"Be pavadinimo\", kol j\u016bs j\u012f pakeisti i\u0161 per Google tiesiogiai.",
														"Izveidot datu b\u0101zi par j\u016bsu Google Drive. Tas tiks nosaukts \"Bez nosaukuma\", l\u012bdz j\u016bs main\u012bt no iek\u0161ienes Google tie\u0161i.",
														"\u041a\u0440\u0435\u0438\u0440\u0430\u045a\u0435 \u043d\u0430 \u0431\u0430\u0437\u0430 \u043d\u0430 \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438 \u043d\u0430 \u0432\u0430\u0448\u0438\u043e\u0442 Google Drive. \u0422\u043e\u0430 \u045c\u0435 \u0431\u0438\u0434\u0435 \u043d\u0430\u0440\u0435\u0447\u0435\u043d\u0430 \"\u0411\u0435\u0437 \u043d\u0430\u0441\u043b\u043e\u0432\", \u0434\u043e\u0434\u0435\u043a\u0430 \u043d\u0435 \u0433\u043e \u043c\u0435\u043d\u0443\u0432\u0430\u0430\u0442 \u043e\u0434 \u0440\u0430\u043c\u043a\u0438\u0442\u0435 \u043d\u0430 Google \u0434\u0438\u0440\u0435\u043a\u0442\u043d\u043e.",
														"Mewujudkan pangkalan data mengenai Google Drive anda. Ia akan dinamakan \"Untitled\" sehingga anda mengubahnya dari dalam Google secara langsung.",
														"\u0126olqien ta 'database fuq Google Drive tieg\u0127ek. Dan se jkun jisimha \"Untitled\" sakemm inti jibdlu minn \u0121ewwa Google direttament.",
														"Opprette en database p\u00e5 din Google Drive. Det skal hete \"Uten tittel\" inntil du endrer det fra Google direkte.",
														"Tworzenie bazy danych na Dysku Google. B\u0119dzie si\u0119 nazywa\u0107 \"Bez tytu\u0142u\", a\u017c go zmieni\u0107 z poziomu Google bezpo\u015brednio.",
														"Cria\u00e7\u00e3o de um banco de dados em seu Google Drive. Ele ser\u00e1 chamado \"Untitled\" at\u00e9 que seja alterado a partir do Google diretamente.",
														"Crearea unei baze de date de pe unitatea de Google. Acesta va fi numit \"Untitled\", p\u00e2n\u0103 c\u00e2nd o schimba\u021bi din interior direct Google.",
														"Vytvorenie datab\u00e1zy na Google Drive. Bude s n\u00e1zvom \"Untitled\", k\u00fdm ho nezmen\u00edte v Google priamo.",
														"Ustvarjanje baze podatkov o va\u0161em Google Drive. To se bo imenovala \"Untitled\", dokler ga ne spremenite od znotraj neposredno Googla.",
														"Krijimi i baz\u00ebs s\u00eb t\u00eb dh\u00ebnave n\u00eb Google Drive tuaj. Ajo do t\u00eb quhet \"Untitled\" deri sa t\u00eb ndryshoj\u00eb at\u00eb nga brenda Google direkt.",
														"\u041a\u0440\u0435\u0438\u0440\u0430\u045a\u0435 \u0431\u0430\u0437\u0435 \u043f\u043e\u0434\u0430\u0442\u0430\u043a\u0430 \u043d\u0430 \u0413\u043e\u043e\u0433\u043b\u0435 \u0414\u0440\u0438\u0432\u0435. \u0422\u043e \u045b\u0435 \u0431\u0438\u0442\u0438 \u043d\u0430\u0437\u0432\u0430\u043d\u0430 \"\u0423\u043d\u0442\u0438\u0442\u043b\u0435\u0434\" \u0441\u0432\u0435 \u0434\u043e\u043a \u0433\u0430 \u043d\u0435 \u043f\u0440\u043e\u043c\u0435\u043d\u0438\u0442\u0435 \u0438\u0437\u043d\u0443\u0442\u0440\u0430 \u0413\u043e\u043e\u0433\u043b\u0435 \u0434\u0438\u0440\u0435\u043a\u0442\u043d\u043e.",
														"Skapa en databas p\u00e5 din Google Drive. Det kommer att f\u00e5 namnet \"Untitled\" tills du \u00e4ndrar den inifr\u00e5n Google direkt.",
														"Kujenga database juu ya Google Drive yako. Itakuwa jina lake \"Untitled\" mpaka mabadiliko hayo kutoka ndani ya Google moja kwa moja.",
														"\u0e01\u0e32\u0e23\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25\u0e1a\u0e19\u0e44\u0e14\u0e23\u0e1f\u0e4c\u0e02\u0e2d\u0e07 Google \u0e02\u0e2d\u0e07\u0e04\u0e38\u0e13 \u0e21\u0e31\u0e19\u0e08\u0e30\u0e44\u0e14\u0e49\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e15\u0e31\u0e49\u0e07\u0e0a\u0e37\u0e48\u0e2d\u0e27\u0e48\u0e32 \"Untitled\" \u0e08\u0e19\u0e01\u0e27\u0e48\u0e32\u0e04\u0e38\u0e13\u0e08\u0e30\u0e40\u0e1b\u0e25\u0e35\u0e48\u0e22\u0e19\u0e08\u0e32\u0e01\u0e20\u0e32\u0e22\u0e43\u0e19 Google \u0e42\u0e14\u0e22\u0e15\u0e23\u0e07",
														"Paglikha ng isang database sa iyong Google Drive. Ito ay pinangalanang \"Walang pamagat na\" hanggang mabago mo ito mula nang direkta sa loob ng Google.",
														"Google Drive \u00fczerinde bir veritaban\u0131 olu\u015fturma. Do\u011frudan Google'dan gelen de\u011fi\u015ftirene kadar \"\u0130simsiz\" adl\u0131 olacakt\u0131r.",
														"\u0421\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445 \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 Google Drive. \u0426\u0435 \u0431\u0443\u0434\u0435 \u043d\u0430\u0437\u0438\u0432\u0430\u0442\u0438\u0441\u044f \"\u0411\u0435\u0437 \u043d\u0430\u0437\u0432\u0438\", \u043f\u043e\u043a\u0438 \u0432\u0438 \u043d\u0435 \u0437\u043c\u0456\u043d\u0438\u0442\u0435 \u0439\u043e\u0433\u043e \u0437\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0438 Google \u0431\u0435\u0437\u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e.",
														"\u05e9\u05d0\u05e4\u05df \u05d0\u05b7 \u05d3\u05d0\u05b7\u05d8\u05d0\u05b7\u05d1\u05d0\u05b7\u05e1\u05e2 \u05d0\u05d5\u05d9\u05e3 \u05d3\u05d9\u05d9\u05df \u05d2\u05d5\u05d2\u05dc \u05d3\u05e8\u05d9\u05d9\u05d5\u05d5. \u05e2\u05e1 \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05df \u05d2\u05e2\u05d4\u05d9\u05d9\u05e1\u05df \"\u05e7\u05d9\u05d9\u05df \u05d8\u05d9\u05d8\u05dc\" \u05d1\u05d9\u05d6 \u05d0\u05d9\u05e8 \u05d8\u05d5\u05d9\u05e9\u05df \u05e2\u05e1 \u05e4\u05d5\u05df \u05d9\u05df \u05d2\u05d5\u05d2\u05dc \u05d2\u05dc\u05d9\u05d9\u05b7\u05da.",
														"\u60a8\u7684\u8c37\u6b4c\u9a45\u52d5\u5668\u5275\u5efa\u4e00\u500b\u6578\u64da\u5eab\u3002\u76f4\u5230\u4f60\u5f9e\u5b83\u76f4\u63a5\u5728\u8c37\u6b4c\u6539\u8b8a\u5b83\u6703\u88ab\u547d\u540d\u70ba\u201cUntitled\u201d\u3002"));
			Rows.Add( new LocalizationRow("Unable to find the xlsx file at GoogleFu/Assets/Samples/Data, or another program has it locked.  Either way, we couldn't access it. ",
														"Impossible de trouver le fichier xlsx \u00e0 GoogleFu / Actif / samples / donn\u00e9es, ou un autre programme l'a verrouill\u00e9e. De toute fa\u00e7on, nous n'avons pas pu y acc\u00e9der.",
														"Impossibile trovare il file xlsx a GoogleFu / Attivit\u00e0 / Samples / dati, o un altro programma l'ha bloccato. Ad ogni modo, non abbiamo potuto accedervi.",
