														"No se puede encontrar el archivo xlsx en googleFU / Activos / Samples / data, u otro programa la est\u00e1 usando. De cualquier manera, no podr\u00eda acceder a \u00e9l.",
														"\u0642\u0627\u062f\u0631 \u0639\u0644\u0649 \u0627\u0644\u0639\u062b\u0648\u0631 \u0639\u0644\u0649 \u0645\u0644\u0641 XLSX \u0641\u064a GoogleFu / \u0627\u0644\u0623\u0635\u0648\u0644 / \u0639\u064a\u0646\u0627\u062a / \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a\u060c \u0623\u0648 \u0628\u0631\u0646\u0627\u0645\u062c \u0622\u062e\u0631 \u0642\u062f \u0643\u0627\u0646 \u0645\u0624\u0645\u0646. \u0641\u064a \u0643\u0644\u062a\u0627 \u0627\u0644\u062d\u0627\u0644\u062a\u064a\u0646\u060c \u0644\u0645 \u0646\u062a\u0645\u0643\u0646 \u0645\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u064a\u0647.",
