														"GoogleFu /\u8cc7\u7523/\u30b5\u30f3\u30d7\u30eb/\u30c7\u30fc\u30bf\u3001\u307e\u305f\u306f\u5225\u306e\u30d7\u30ed\u30b0\u30e9\u30e0\u3067XLSX\u30d5\u30a1\u30a4\u30eb\u304c\u898b\u3064\u304b\u308a\u307e\u305b\u3093\u3001\u305d\u308c\u306f\u30ed\u30c3\u30af\u3055\u308c\u3066\u3044\u307e\u3059\u3002\u3044\u305a\u308c\u306b\u305b\u3088\u3001\u6211\u3005\u306f\u305d\u308c\u306b\u30a2\u30af\u30bb\u30b9\u3067\u304d\u307e\u305b\u3093\u3067\u3057\u305f\u3002",
														"\u041d\u0435 \u0443\u0434\u0430\u0435\u0442\u0441\u044f \u043d\u0430\u0439\u0442\u0438 \u0444\u0430\u0439\u043b XLSX \u0432 GoogleFu / \u0430\u043a\u0442\u0438\u0432\u044b / \u041e\u0431\u0440\u0430\u0437\u0446\u044b / \u0434\u0430\u043d\u043d\u044b\u0435, \u0438\u043b\u0438 \u0434\u0440\u0443\u0433\u043e\u0439 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u044b \u0443\u0436\u0435 \u0437\u0430\u043f\u0435\u0440\u0442\u044b\u043c. \u0412 \u043b\u044e\u0431\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435, \u043c\u044b \u043d\u0435 \u043c\u043e\u0433\u043b\u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u044c \u043a \u043d\u0435\u043c\u0443 \u0434\u043e\u0441\u0442\u0443\u043f.",
														"Kh\u00f4ng th\u1ec3 t\u00ecm th\u1ea5y file xlsx t\u1ea1i GoogleFu / t\u00e0i s\u1ea3n / m\u1eabu / d\u1eef li\u1ec7u, ho\u1eb7c m\u1ed9t ch\u01b0\u01a1ng tr\u00ecnh kh\u00e1c \u0111\u00e3 b\u1ecb kh\u00f3a n\u00f3. D\u00f9 b\u1eb1ng c\u00e1ch n\u00e0o, ch\u00fang t\u00f4i kh\u00f4ng th\u1ec3 truy c\u1eadp n\u00f3.",
														"Kan het xlsx bestand te vinden op googleFU / Assets / Samples / Gegevens, of een ander programma is vergrendeld. Hoe dan ook, we konden geen toegang toe.",
														"Kan die xlsx l\u00eaer te vind by GoogleFu / bates / monsters / Data, of 'n ander program het dit gesluit. \u00d3f manier, kan ons nie toegang tot dit.",
														"\u041d\u0435 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0441\u0435 \u043d\u0430\u043c\u0435\u0440\u0438 \u0444\u0430\u0439\u043b\u0430 XLSX \u0432 GoogleFu / \u0430\u043a\u0442\u0438\u0432\u0438 / \u043f\u0440\u043e\u0431\u0438 / Data, \u0438\u043b\u0438 \u0434\u0440\u0443\u0433\u0430 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0430 \u0433\u043e \u0435 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0430. \u0422\u0430\u043a\u0430 \u0438\u043b\u0438 \u0438\u043d\u0430\u0447\u0435, \u043d\u0438\u0435 \u043d\u0435 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0433\u043e \u043e\u0442\u0432\u043e\u0440\u0438\u0442\u0435.",
														"\u041d\u0435 \u0430\u0442\u0440\u044b\u043c\u043e\u045e\u0432\u0430\u0435\u0446\u0446\u0430 \u0437\u043d\u0430\u0439\u0441\u0446\u0456 \u0444\u0430\u0439\u043b XLSX \u045e GoogleFu / \u0430\u043a\u0442\u044b\u0432\u044b / \u0423\u0437\u043e\u0440\u044b / \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u044f, \u0446\u0456 \u0456\u043d\u0448\u0430\u0439 \u043f\u0440\u0430\u0433\u0440\u0430\u043c\u044b \u045e\u0436\u043e \u0437\u0430\u0447\u044b\u043d\u0435\u043d\u044b\u043c. \u0423 \u043b\u044e\u0431\u044b\u043c \u0432\u044b\u043f\u0430\u0434\u043a\u0443, \u043c\u044b \u043d\u0435 \u043c\u0430\u0433\u043b\u0456 \u0430\u0442\u0440\u044b\u043c\u0430\u0446\u044c \u0434\u0430 \u044f\u0433\u043e \u0434\u043e\u0441\u0442\u0443\u043f.",
														"No es pot trobar l'arxiu xlsx en googleFU / Actius / Samples / data, o altre programa l'est\u00e0 utilitzant. De qualsevol manera, no podria accedir-hi.",
														"Nelze naj\u00edt soubor XLSX na GoogleFu / aktiva / Samples / data, nebo jin\u00e9ho programu, kter\u00fd je uzam\u010den. A\u0165 tak \u010di onak, my jsme nemohli p\u0159istupovat.",
														"Methu dod o hyd i'r ffeil xlsx yn GoogleFu / Asedau / Samplau / Data, neu raglen arall a yw wedi cloi. Naill ffordd neu'r llall, ni allem gael gafael arno.",
														"Ei leia xlsx faili GoogleFu / Assets / proovid / andmetele, v\u00f5i m\u00f5ni teine \u200b\u200bprogramm on see lukus. Nii v\u00f5i teisiti, me ei saa seda kasutada.",
														"\u0642\u0627\u062f\u0631 \u0628\u0647 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0646 \u0641\u0627\u06cc\u0644 XLSX \u062f\u0631 GoogleFu / \u062f\u0627\u0631\u0627\u06cc\u06cc / \u0646\u0645\u0648\u0646\u0647 / \u062f\u0627\u062f\u0647\u060c \u0648 \u06cc\u0627 \u0628\u0631\u0646\u0627\u0645\u0647 \u062f\u06cc\u06af\u0631 \u062a\u0627 \u0628\u0647 \u0622\u0646 \u0642\u0641\u0644 \u0634\u062f\u0647 \u0627\u0633\u062a. \u062f\u0631 \u0647\u0631 \u0635\u0648\u0631\u062a\u060c \u0645\u0627 \u0645\u06cc \u062a\u0648\u0627\u0646\u062f \u0627\u0632 \u0622\u0646 \u062f\u0633\u062a\u0631\u0633\u06cc \u067e\u06cc\u062f\u0627 \u06a9\u0646\u06cc\u062f.",
