														"N\u00ed f\u00e9idir teacht ar an gcomhad XLSX ag GoogleFu / S\u00f3cmhainn\u00ed / Sampla\u00ed / Sonra\u00ed, n\u00f3 cl\u00e1r eile tar \u00e9is faoi ghlas. Sl\u00ed amh\u00e1in n\u00f3 sl\u00ed, n\u00ed raibh muid \u00e1balta rochtain a fh\u00e1il air.",
														"Non se puido atopar o arquivo xlsx en GoogleFu / actividade / Mostras / Datos, ou outro programa que ten bloqueado. De calquera xeito, non poderiamos acceder a ela.",
