														"Nepavyko rasti xlsx fail\u0105 GoogleFu / Turtas / Pavyzd\u017eiai / duomen\u0173 ar kitos programos jau u\u017erakint\u0105. Bet kokiu atveju, mes negal\u0117jome pasiekti.",
