														"\u00c5 finne den xlsx fil p\u00e5 GoogleFu / Eiendeler / Samples / data, eller et annet program ikke klarer det har l\u00e5st. Uansett, vi kunne ikke f\u00e5 tilgang til den.",
														"Nie mo\u017cna odnale\u017a\u0107 pliku xlsx w GoogleFu / assets / pr\u00f3bek / danych lub innego programu zosta\u0142 on zablokowany. Tak czy inaczej, nie mogli\u015bmy przej\u015b\u0107.",
