			Rows.Add( new LocalizationRow("To acess private Google Spreadsheets tied to your Google Drive, you must provide your Google User name and Password.\n \nSecurity Warning: Credentials are saved in the EditorPrefs, which are plain text. This is so the plugin can automatically log in when the window is closed, or between sessions. If you Log Out manually after every session, the variables are cleared.  \n\nLogging in with a Google account is not necessary, however you will only be allowed to access published spreadsheets.",
														"Pour acess Tableur Google priv\u00e9es li\u00e9es \u00e0 votre Google Drive, vous devez fournir votre nom d'utilisateur et mot de passe Google.\n\u00a0\nAvertissement de s\u00e9curit\u00e9: Les pouvoirs sont enregistr\u00e9s dans les EditorPrefs, qui sont texte brut. Ceci afin que le plugin peut se connecter automatiquement lorsque la fen\u00eatre est ferm\u00e9e, ou entre les sessions. Si vous vous d\u00e9connectez manuellement apr\u00e8s chaque session, les variables sont effac\u00e9es.\n\nConnexion avec un compte Google n'est pas n\u00e9cessaire, mais vous ne serez autoris\u00e9 \u00e0 acc\u00e9der \u00e0 des feuilles de calcul publi\u00e9es.",
														"Per acess fogli di calcolo di Google private legate al tuo Google Drive, \u00e8 necessario fornire il proprio nome utente e password di Google.\n\u00a0\nAvviso di protezione: Le credenziali vengono salvati nella EditorPrefs, che sono in testo normale. Questo \u00e8 quindi il plugin pu\u00f2 accedere automaticamente quando la finestra \u00e8 chiusa, o tra le sessioni. Se ci si disconnette manualmente dopo ogni sessione, le variabili vengono cancellati.\n\nL'accesso con un account Google non \u00e8 necessario, tuttavia vi sar\u00e0 consentito solo per accedere fogli di calcolo pubblicati.",
														"Um private Google Spreadsheets zu Google Drive gebunden Acess, m\u00fcssen Sie Ihre Google-Benutzernamen und das Passwort angeben.\n\u00a0\nSicherheitswarnung: Die Anmeldeinformationen werden in den EditorPrefs, die Klartext gespeichert sind. Das ist so, das Plugin automatisch anmelden, wenn das Fenster geschlossen ist, oder zwischen den Sessions. Wenn Sie sich abmelden manuell nach jeder Sitzung werden die Variablen gel\u00f6scht.\n\nAnmeldung mit einem Google-Konto ist nicht n\u00f6tig, aber Sie werden nur erlaubt, ver\u00f6ffentlichten Tabellen zuzugreifen.",
														"Para acess Hojas de c\u00e1lculo de Google privadas vinculadas a Google Drive, usted debe proporcionar su nombre de usuario y contrase\u00f1a de Google.\n\u00a0\nAdvertencia de seguridad: Las credenciales se guardan en los EditorPrefs, que son de texto plano. Esto es lo que el plugin puede iniciar autom\u00e1ticamente cuando se cierra la ventana, o entre las sesiones. Si se desconecta manualmente despu\u00e9s de cada sesi\u00f3n, se borran las variables.\n\nInicio de una sesi\u00f3n con una cuenta de Google, no es necesario, sin embargo, s\u00f3lo se le permitir\u00e1 acceder a las hojas de c\u00e1lculo publicadas.",
														"\u0625\u0644\u0649 \u0627\u0644\u0633\u0646\u0629 \u0627\u0644\u062d\u0627\u0644\u064a\u0629 \u062c\u062f\u0627\u0648\u0644 \u062c\u0648\u062c\u0644 \u062e\u0627\u0635\u0629 \u0645\u0631\u062a\u0628\u0637\u0629 \u0645\u062d\u0631\u0643 \u062c\u0648\u062c\u0644 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643\u060c \u064a\u062c\u0628 \u0623\u0646 \u062a\u0648\u0641\u0631 \u062c\u0648\u062c\u0644 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643.\n\u00a0\n\u062a\u062d\u0630\u064a\u0631 \u0627\u0644\u0623\u0645\u0646: \u064a\u062a\u0645 \u062d\u0641\u0638 \u0648\u062b\u0627\u0626\u0642 \u0627\u0644\u062a\u0641\u0648\u064a\u0636 \u0641\u064a EditorPrefs\u060c \u0648\u0627\u0644\u062a\u064a \u0647\u064a \u0646\u0635 \u0639\u0627\u062f\u064a. \u0647\u0630\u0627 \u0647\u0648 \u0630\u0644\u0643 \u0627\u0644\u0628\u0631\u0646\u0627\u0645\u062c \u0627\u0644\u0645\u0633\u0627\u0639\u062f \u064a\u0645\u0643\u0646 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0641\u064a \u0639\u0646\u062f \u0625\u063a\u0644\u0627\u0642 \u0646\u0627\u0641\u0630\u0629\u060c \u0623\u0648 \u0628\u064a\u0646 \u0627\u0644\u062f\u0648\u0631\u0627\u062a. \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062e\u0631\u0648\u062c \u064a\u062f\u0648\u064a\u0627 \u0628\u0639\u062f \u0643\u0644 \u062f\u0648\u0631\u0629\u060c \u064a\u062a\u0645 \u0645\u0633\u062d \u0627\u0644\u0645\u062a\u063a\u064a\u0631\u0627\u062a.\n\n\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u062d\u0633\u0627\u0628 Google \u0644\u064a\u0633\u062a \u0636\u0631\u0648\u0631\u064a\u0629\u060c \u0648\u0644\u0643\u0646 \u0644\u0646 \u064a\u0633\u0645\u062d \u0644\u0643 \u0641\u0642\u0637 \u0644\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u062c\u062f\u0627\u0648\u0644 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0645\u0646\u0634\u0648\u0631\u0629.",
														"\uadc0\ud558\uc758 Google \ub4dc\ub77c\uc774\ube0c\uc5d0 \ubb36\uc5ec \uac1c\uc778 \uad6c\uae00 \uc2a4\ud504\ub808\ub4dc \uc2dc\ud2b8\ub97c \ub3d9\uc791\uc744 \uc9c4\ud589\ud558\uae30 \uc704\ud574, \ub2f9\uc2e0\uc740 \uad6c\uae00\uc758 \uc0ac\uc6a9\uc790 \uc774\ub984\uacfc \uc554\ud638\ub97c \uc81c\uacf5\ud574\uc57c\ud569\ub2c8\ub2e4.\n\u00a0\n\ubcf4\uc548 \uacbd\uace0 : \uc790\uaca9 \uc99d\uba85\uc774 \uc77c\ubc18 \ud14d\uc2a4\ud2b8\uc785\ub2c8\ub2e4 EditorPrefs\uc5d0 \uc800\uc7a5\ub429\ub2c8\ub2e4. \uc774 \ub54c\ubb38\uc5d0 \ud50c\ub7ec\uadf8\uc778\uc740 \uc790\ub3d9\uc73c\ub85c \ucc3d\uc744 \ub2eb\uc73c\uba74 \ub85c\uadf8\uc778 \ub610\ub294 \uc138\uc158 \uc0ac\uc774\uc5d0 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub9cc\uc57d \uc138\uc158\uc774 \ub05d\ub0a0 \ub54c\ub9c8\ub2e4 \uc218\ub3d9\uc73c\ub85c \ub85c\uadf8 \uc544\uc6c3\ud558\ub294 \uacbd\uc6b0, \ubcc0\uc218\ub294 \uc0ad\uc81c\ub429\ub2c8\ub2e4.\n\n\uad6c\uae00 \uacc4\uc815\uc73c\ub85c \ub85c\uadf8\uc778\ud558\uba74 \uadf8\ub7ec\ub098 \ub2f9\uc2e0\uc740 \ub2e8\uc9c0 \ucd9c\ud310 \uc2a4\ud504\ub808\ub4dc \uc2dc\ud2b8\uc5d0 \uc561\uc138\uc2a4 \ud560 \uc218\ub429\ub2c8\ub2e4 \ud544\uc694\uac00 \uc5c6\uc2b5\ub2c8\ub2e4.",
														"\u63a5\u53d6\u79c1\u4eba\u8c37\u6b4c\u7535\u5b50\u8868\u683c\u4e0e\u60a8\u7684\u8c37\u6b4c\u9a71\u52a8\u5668\uff0c\u60a8\u5fc5\u987b\u63d0\u4f9b\u60a8\u7684\u8c37\u6b4c\u7528\u6237\u540d\u548c\u5bc6\u7801\u3002\n\u00a0\n\u5b89\u5168\u8b66\u544a\uff1a\u8bc1\u4e66\u4fdd\u5b58\u5728EditorPrefs\uff0c\u8fd9\u662f\u7eaf\u6587\u672c\u3002\u4e4b\u6240\u4ee5\u5982\u6b64\uff0c\u662f\u5f53\u7a97\u53e3\u88ab\u5173\u95ed\u7684\u63d2\u4ef6\u53ef\u4ee5\u81ea\u52a8\u767b\u5f55\uff0c\u6216\u4f1a\u8bdd\u4e4b\u95f4\u3002\u5982\u679c\u4f60\u6bcf\u6b21\u4f1a\u8bae\u540e\u624b\u52a8\u6ce8\u9500\uff0c\u8be5\u53d8\u91cf\u88ab\u6e05\u9664\u3002\n\n\u6709\u4e00\u4e2a\u8c37\u6b4c\u5e10\u6237\u767b\u5f55\u662f\u6ca1\u6709\u5fc5\u8981\u7684\uff0c\u4f46\u662f\u4f60\u53ea\u88ab\u5141\u8bb8\u8bbf\u95ee\u53d1\u5e03\u7684\u7535\u5b50\u8868\u683c\u3002",
														"Google\u30c9\u30e9\u30a4\u30d6\u306b\u63a5\u7d9a\u3055\u308c\u305f\u6c11\u9593\u306eGoogle\u30b9\u30d7\u30ec\u30c3\u30c9\u30b7\u30fc\u30c8\u3092\u30a2\u30bb\u30b9\u3059\u308b\u306b\u306f\u3001\u304a\u4f7f\u3044\u306eGoogle\u306e\u30e6\u30fc\u30b6\u30fc\u540d\u3068\u30d1\u30b9\u30ef\u30fc\u30c9\u3092\u5165\u529b\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002\n\u00a0\n\u30bb\u30ad\u30e5\u30ea\u30c6\u30a3\u8b66\u544a\uff1a\u8cc7\u683c\u60c5\u5831\u306f\u30d7\u30ec\u30fc\u30f3\u30c6\u30ad\u30b9\u30c8\u3067\u3042\u308bEditorPrefs\u3001\u306b\u4fdd\u5b58\u3055\u308c\u307e\u3059\u3002\u3053\u308c\u306f\u30d7\u30e9\u30b0\u30a4\u30f3\u304c\u81ea\u52d5\u7684\u306b\u30a6\u30a3\u30f3\u30c9\u30a6\u304c\u9589\u3058\u3089\u308c\u305f\u3068\u304d\u306b\u30ed\u30b0\u30a4\u30f3\u3059\u308b\u304b\u3001\u30bb\u30c3\u30b7\u30e7\u30f3\u9593\u3067\u3067\u304d\u3066\u3044\u308b\u3002\u3042\u306a\u305f\u306f\u3059\u3079\u3066\u306e\u30bb\u30c3\u30b7\u30e7\u30f3\u306e\u5f8c\u306b\u624b\u52d5\u3067\u30ed\u30b0\u30a2\u30a6\u30c8\u3057\u305f\u5834\u5408\u3001\u5909\u6570\u306f\u30af\u30ea\u30a2\u3055\u308c\u307e\u3059\u3002\n\nGoogle\u30a2\u30ab\u30a6\u30f3\u30c8\u3067\u30ed\u30b0\u30a4\u30f3\u3059\u308b\u3068\u3001\u3057\u304b\u3057\u3001\u3042\u306a\u305f\u306f\u552f\u4e00\u306e\u516c\u8868\u30b9\u30d7\u30ec\u30c3\u30c9\u30b7\u30fc\u30c8\u3078\u306e\u30a2\u30af\u30bb\u30b9\u3092\u8a31\u53ef\u3055\u308c\u307e\u3059\u304c\u3001\u5fc5\u8981\u3042\u308a\u307e\u305b\u3093\u3002",
														"\u0414\u043b\u044f \u0410\u0441\u0435\u0441\u0441 \u043b\u0438\u0447\u043d\u044b\u0435 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u044b\u0435 \u0442\u0430\u0431\u043b\u0438\u0446\u044b Google, \u043f\u0440\u0438\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0435 \u043a \u0432\u0430\u0448\u0435\u0439 Google Drive, \u0432\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u0441\u043d\u0430\u0431\u0434\u0438\u0442\u044c \u0432\u0430\u0448 Google \u0438\u043c\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u0438 \u043f\u0430\u0440\u043e\u043b\u044c.\n\u00a0\n\u041f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u0441\u0438\u0441\u0442\u0435\u043c\u044b \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438: \u0423\u0447\u0435\u0442\u043d\u044b\u0435 \u0434\u0430\u043d\u043d\u044b\u0435 \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u044e\u0442\u0441\u044f \u0432 EditorPrefs, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043e\u0431\u044b\u0447\u043d\u044b\u0439 \u0442\u0435\u043a\u0441\u0442. \u042d\u0442\u043e \u043e\u0431\u044a\u044f\u0441\u043d\u044f\u0435\u0442\u0441\u044f \u0442\u0435\u043c, \u043f\u043b\u0430\u0433\u0438\u043d \u043c\u043e\u0436\u0435\u0442 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0432\u043e\u0439\u0442\u0438, \u043a\u043e\u0433\u0434\u0430 \u043e\u043a\u043d\u043e \u0437\u0430\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f, \u0438\u043b\u0438 \u0432 \u043f\u0435\u0440\u0438\u043e\u0434 \u043c\u0435\u0436\u0434\u0443 \u0441\u0435\u0441\u0441\u0438\u044f\u043c\u0438. \u0415\u0441\u043b\u0438 \u0432\u044b \u0412\u044b\u0445\u043e\u0434 \u0432\u0440\u0443\u0447\u043d\u0443\u044e \u043f\u043e\u0441\u043b\u0435 \u043a\u0430\u0436\u0434\u043e\u0439 \u0441\u0435\u0441\u0441\u0438\u0438, \u043f\u0435\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0435 \u0443\u0434\u0430\u043b\u044f\u044e\u0442\u0441\u044f.\n\n\u0412\u0445\u043e\u0434 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u0441 \u0443\u0447\u0435\u0442\u043d\u043e\u0439 \u0437\u0430\u043f\u0438\u0441\u044c\u044e Google \u043d\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u044b\u043c, \u043e\u0434\u043d\u0430\u043a\u043e \u0432\u0430\u043c \u0431\u0443\u0434\u0435\u0442 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u043e \u0442\u043e\u043b\u044c\u043a\u043e \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0430 \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0442\u0430\u0431\u043b\u0438\u0446\u044b.",
														"Acess Spreadsheets Google tin g\u1eafn li\u1ec1n v\u1edbi Google Drive c\u1ee7a b\u1ea1n, b\u1ea1n ph\u1ea3i cung c\u1ea5p t\u00ean S\u1eed d\u1ee5ng Google c\u1ee7a b\u1ea1n v\u00e0 m\u1eadt kh\u1ea9u.\n\u00a0\nC\u1ea3nh b\u00e1o an ninh: Gi\u00e2y ch\u1ee9ng nh\u1eadn \u0111\u01b0\u1ee3c l\u01b0u trong EditorPrefs, \u0111\u00f3 l\u00e0 v\u0103n b\u1ea3n \u0111\u01a1n gi\u1ea3n. \u0110i\u1ec1u n\u00e0y l\u00e0 \u0111\u1ec3 c\u00e1c plugin c\u00f3 th\u1ec3 t\u1ef1 \u0111\u1ed9ng \u0111\u0103ng nh\u1eadp khi c\u1eeda s\u1ed5 \u0111\u01b0\u1ee3c \u0111\u00f3ng l\u1ea1i, ho\u1eb7c gi\u1eefa phi\u00ean. N\u1ebfu b\u1ea1n Log Out tay sau m\u1ed7i phi\u00ean giao d\u1ecbch, c\u00e1c bi\u1ebfn s\u1ebd b\u1ecb x\u00f3a.\n\n\u0110\u0103ng nh\u1eadp v\u1edbi m\u1ed9t t\u00e0i kho\u1ea3n Google l\u00e0 kh\u00f4ng c\u1ea7n thi\u1ebft, tuy nhi\u00ean b\u1ea1n s\u1ebd ch\u1ec9 \u0111\u01b0\u1ee3c ph\u00e9p truy c\u1eadp v\u00e0o c\u00e1c b\u1ea3ng t\u00ednh \u0111\u01b0\u1ee3c xu\u1ea5t b\u1ea3n.",
