														"Saannissa yksityinen Google Spreadsheets yhdistet\u00e4\u00e4n Google Drive, sinun on annettava Google k\u00e4ytt\u00e4j\u00e4tunnus ja salasana.\n\u00a0\nTurvallisuus Varoitus: valtakirjojen tallennetaan EditorPrefs, jotka ovat pelkk\u00e4\u00e4 teksti\u00e4. T\u00e4m\u00e4 on niin plugin voi kirjautumaan automaattisesti, kun ikkuna suljetaan tai istuntojen v\u00e4lill\u00e4. Jos kirjaudut ulos manuaalisesti joka istunnon j\u00e4lkeen, muuttujat tyhjennet\u00e4\u00e4n.\n\nKirjautumalla sis\u00e4\u00e4n Google-tili ei ole v\u00e4ltt\u00e4m\u00e4t\u00f6n, mutta sinulla on vain p\u00e4\u00e4sev\u00e4t julkaistu taulukoita.",
														"Chun acess Scarbhileoga Google pr\u00edobh\u00e1ideach ceangailte le do Google Drive, n\u00ed m\u00f3r duit a chur ar f\u00e1il do Nickname Google agus Pasfhocal.\n\u00a0\nSl\u00e1nd\u00e1il Rabhadh: Dinti\u00far a sh\u00e1bh\u00e1il sa EditorPrefs, a bhfuil gn\u00e1th-th\u00e9acs. T\u00e1 s\u00e9 seo ionas gur f\u00e9idir leis an mbreise\u00e1n log\u00e1il isteach go huathoibr\u00edoch i nuair a bh\u00edonn an fhuinneog d\u00fanta, n\u00f3 idir seisi\u00fain. M\u00e1 t\u00e1 t\u00fa Log\u00e1il Amach l\u00e1imh tar \u00e9is gach seisi\u00fan, na hathr\u00f3ga at\u00e1 glanta.\n\nLog\u00e1il isteach le cuntas Google nach bhfuil g\u00e1, \u00e1fach, beidh t\u00fa a chead\u00fa ach amh\u00e1in chun rochtain a fh\u00e1il ar scarbhileoga foilsithe.",
