														"\u0905\u092a\u0928\u0947 \u0917\u0942\u0917\u0932 \u0921\u094d\u0930\u093e\u0907\u0935 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092c\u0902\u0927\u0947 \u0928\u093f\u091c\u0940 \u0917\u0942\u0917\u0932 \u0938\u094d\u092a\u094d\u0930\u0947\u0921\u0936\u0940\u091f\u094d\u0938 acess \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f, \u0906\u092a\u0915\u094b \u0905\u092a\u0928\u0947 Google \u0909\u092a\u092f\u094b\u0917\u0915\u0930\u094d\u0924\u093e \u0928\u093e\u092e \u0914\u0930 \u092a\u093e\u0938\u0935\u0930\u094d\u0921 \u092a\u094d\u0930\u0926\u093e\u0928 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f.\n\u00a0\n\u0938\u0941\u0930\u0915\u094d\u0937\u093e \u091a\u0947\u0924\u093e\u0935\u0928\u0940: \u0938\u093e\u0916 \u0938\u093e\u0926\u0947 \u092a\u093e\u0920 \u0939\u0948\u0902 \u091c\u094b EditorPrefs, \u092e\u0947\u0902 \u092c\u091a \u0930\u0939\u0947 \u0939\u0948\u0902. \u092f\u0939 \u0907\u0924\u0928\u093e \u092a\u094d\u0932\u0917\u0907\u0928 \u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0930\u0942\u092a \u0938\u0947 \u0916\u093f\u0921\u093c\u0915\u0940 \u092c\u0902\u0926 \u0915\u0930 \u0926\u093f\u092f\u093e \u0939\u0948 \u091c\u092c \u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0947\u0902, \u092f\u093e \u0938\u0924\u094d\u0930 \u0915\u0947 \u092c\u0940\u091a \u092e\u0947\u0902 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948. \u0906\u092a \u0939\u0930 \u0938\u0924\u094d\u0930 \u0915\u0947 \u092c\u093e\u0926 \u092e\u0948\u0928\u094d\u092f\u0941\u0905\u0932 \u0930\u0942\u092a \u0938\u0947 \u0932\u0949\u0917 \u0906\u0909\u091f \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u091a\u0930 \u092e\u0902\u091c\u0942\u0930\u0940 \u0926\u0947 \u0926\u0940 \u0939\u0948.\n\n\u090f\u0915 \u0917\u0942\u0917\u0932 \u0916\u093e\u0924\u0947 \u0915\u0947 \u0938\u093e\u0925 \u092a\u094d\u0930\u0935\u0947\u0936 \u0939\u093e\u0932\u093e\u0902\u0915\u093f \u0906\u092a \u0915\u0947\u0935\u0932 \u092a\u094d\u0