														"Da acess privatne Google prora\u010dunskih tablica je povezana s Google Drive, morate dati svoj Google korisni\u010dko ime i lozinku.\n\u00a0\nSigurnost Upozorenje: Mandatno spremaju u EditorPrefs, koji su obi\u010dan tekst. To je tako plugin automatski mogu se prijaviti u prozor kada je zatvoren, ili izme\u0111u sjednica. Ako se odjavite ru\u010dno nakon svake sjednice, varijable su izbrisani.\n\nPrijavljivanje sa Google ra\u010duna nije potrebno, ali da \u0107e biti dopu\u0161teno samo za pristup objavljene prora\u010dunske tablice.",
														"Acess prive Google tableur mare nan Google Drive ou, ou dwe bay Tinon Google ou ak yon Modpas.\n\u00a0\nAv\u00e8tisman Sekirite: Kredansy\u00e8l yo te sove nan EditorPrefs yo, ki f\u00e8 yo t\u00e8ks plenn. Sa a se konsa Plugin la ka otomatikman ouvri sesyon an l\u00e8 se fen\u00e8t la f\u00e8men, oswa ant sesyon yo. Si ou F\u00e8men sesyon an many\u00e8lman apre chak sesyon, varyab yo ap otorize.\n\nKoupe pye bwa nan ki gen yon kont Google se pa neses\u00e8, sepandan ou pral s\u00e8lman p\u00e8m\u00e8t yo gen aks\u00e8 pibliye Des.",
														"Untuk acess Spreadsheets Google swasta terkait dengan Google Drive Anda, Anda harus menyediakan Google User name dan Password.\n\u00a0\nPeringatan Keamanan: Kredensial disimpan dalam EditorPrefs, yang teks biasa. Hal ini agar plugin secara otomatis dapat log in ketika jendela ditutup, atau antara sesi. Jika Anda Log Out secara manual setelah setiap sesi, variabel akan dihapus.\n\nLog in dengan akun Google tidak diperlukan, namun Anda hanya akan diizinkan untuk mengakses spreadsheet diterbitkan.",
														"A\u00f0 Acess einka Google t\u00f6flureiknir bundi\u00f0 vi\u00f0 Google Drive, ver\u00f0ur \u00fe\u00fa a\u00f0 bj\u00f3\u00f0a upp \u00e1 Google inn Notandanafn og Lykilor\u00f0.\n\u00a0\n\u00d6ryggi Vi\u00f0v\u00f6run: Pers\u00f3nuskilr\u00edki eru vistu\u00f0 \u00ed EditorPrefs, sem eru l\u00e1tlaus texti. \u00deetta er svo vi\u00f0b\u00f3tina getur sj\u00e1lfkrafa inn \u00feegar glugginn er loka\u00f0ur, e\u00f0a \u00e1 milli fundur. Ef \u00fe\u00fa skr\u00e1ir \u00feig \u00fat handvirkt eftir hverja lotu, eru breytur hreinsa\u00f0ar.\n\nSkr\u00e1 \u00feig inn me\u00f0 Google reikning er ekki nau\u00f0synlegt, en \u00fe\u00fa ver\u00f0ur a\u00f0eins leyft a\u00f0 f\u00e1 a\u00f0gang birt tafla.",
														"\u05dcacess \u05d2\u05d9\u05dc\u05d9\u05d5\u05e0\u05d5\u05ea \u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9\u05d9\u05dd Google \u05e4\u05e8\u05d8\u05d9\u05d9\u05dd \u05e7\u05e9\u05d5\u05e8\u05d9\u05dd \u05dc-Google Drive \u05e9\u05dc\u05da, \u05e2\u05dc\u05d9\u05da \u05dc\u05e1\u05e4\u05e7 \u05d0\u05ea \u05e9\u05de\u05da \u05d2\u05d5\u05d2\u05dc \u05de\u05e9\u05ea\u05de\u05e9 \u05d5\u05e1\u05d9\u05e1\u05de\u05d0.\n\u00a0\n\u05d0\u05d6\u05d4\u05e8\u05ea \u05d0\u05d1\u05d8\u05d7\u05d4: \u05d0\u05d9\u05e9\u05d5\u05e8\u05d9\u05dd \u05e0\u05e9\u05de\u05e8\u05d9\u05dd \u05d1EditorPrefs, \u05e9\u05d4\u05dd \u05d8\u05e7\u05e1\u05d8 \u05e8\u05d2\u05d9\u05dc. \u05d6\u05d4 \u05db\u05dc \u05db\u05da \u05d0\u05ea \u05d4\u05ea\u05d5\u05e1\u05e3 \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9 \u05d9\u05db\u05d5\u05dc \u05dc\u05d4\u05ea\u05d7\u05d1\u05e8 \u05db\u05d0\u05e9\u05e8 \u05d4\u05d7\u05dc\u05d5\u05df \u05e1\u05d2\u05d5\u05e8, \u05d0\u05d5 \u05d1\u05d9\u05df \u05e4\u05d2\u05d9\u05e9\u05d5\u05ea. \u05d0\u05dd \u05ea\u05ea\u05e0\u05ea\u05e7 \u05d1\u05d0\u05d5\u05e4\u05df \u05d9\u05d3\u05e0\u05d9 \u05dc\u05d0\u05d7\u05e8 \u05db\u05dc \u05e4\u05d2\u05d9\u05e9\u05d4, \u05d4\u05de\u05e9\u05ea\u05e0\u05d9\u05dd \u05e0\u05de\u05d7\u05e7\u05d9\u05dd.\n\n\u05db\u05e0\u05d9\u05e1\u05d4 \u05e2\u05dd \u05d7\u05e9\u05d1\u05d5\u05df \u05d2\u05d5\u05d2\u05dc \u05d4\u05d9\u05d0 \u05dc\u05d0 \u05d4\u05db\u05e8\u05d7\u05d9\u05ea, \u05d0\u05d1\u05dc \u05d0\u05ea\u05d4 \u05d9\u05d4\u05d9\u05d4 \u05e8\u05e7 \u200b\u200b\u05ea\u05d5\u05e8\u05e9\u05d4 \u05dc\u05d2\u05e9\u05ea \u05dc\u05d2\u05d9\u05dc\u05d9\u05d5\u05e0\u05d5\u05ea \u05e9\u05e4\u05d5\u05e8\u05e1\u05de\u05d5.",
														"Nor\u0117dami Prieigos asmeninius Google skai\u010diuokl\u0117s susieta su j\u016bs\u0173 \"Google\" disk\u0105, j\u016bs turite pateikti savo \"Google\" vartotojo vard\u0105 ir slapta\u017eod\u012f.\n\u00a0\nSaugumo \u012esp\u0117jimas: Kvalifikacija yra i\u0161saugomas EditorPrefs, kurios teksto. Taip yra tod\u0117l, \u012fskiepiai gali automati\u0161kai prisijungti kai langas u\u017edarytas arba tarp sesij\u0173. Jei Atsijungti rankiniu b\u016bdu, po kiekvieno seanso, kintamieji yra i\u0161valytas.\n\nPrisijungdami su Google s\u0105skaita n\u0117ra b\u016btina, ta\u010diau jums bus leista naudotis paskelbti lenteles tik.",
														"Acess priv\u0101t\u0101s Google izkl\u0101jlapas piesaist\u012bti savam Google Drive, jums ir j\u0101sniedz savu Google lietot\u0101ja v\u0101rdu un paroli.\n\u00a0\nDro\u0161\u012bbas br\u012bdin\u0101jums: Kvalifik\u0101cija tiek saglab\u0101ts EditorPrefs, kas ir vienk\u0101r\u0161s teksts. Tas ir t\u0101p\u0113c, spraudnis var autom\u0101tiski ieiet, kad logs ir aizv\u0113rts, vai ar\u012b starp sesij\u0101m. Ja j\u016bs atteiktos manu\u0101li p\u0113c katras sesijas main\u012bgie tiek noskaidroti.\n\nPiesakoties ar Google kontu, nav nepiecie\u0161ams, bet jums b\u016bs iesp\u0113ja piek\u013c\u016bt public\u0113tos izkl\u0101jlapas tikai.",
														"\u0414\u0430 acess \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u0438 Google Spreadsheets \u0432\u0440\u0437\u0430\u043d\u0438 \u0437\u0430 \u0432\u0430\u0448\u0438\u043e\u0442 Google Drive, \u043c\u043e\u0440\u0430 \u0434\u0430 \u0441\u0435 \u043e\u0431\u0435\u0437\u0431\u0435\u0434\u0438 \u0432\u0430\u0448\u0438\u043e\u0442 Google \u043a\u043e\u0440\u0438\u0441\u043d\u0438\u0447\u043a\u043e \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0430.\n\u00a0\n\u0411\u0435\u0437\u0431\u0435\u0434\u043d\u043e\u0441\u043d\u043e \u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0434\u0443\u0432\u0430\u045a\u0435: \u0438\u043d\u0433\u0435\u0440\u0435\u043d\u0446\u0438\u0438\u0442\u0435 \u0441\u0435 \u0437\u0430\u0447\u0443\u0432\u0430\u043d\u0438 \u0432\u043e EditorPrefs, \u043a\u043e\u0438 \u0441\u0435 \u043e\u0431\u0438\u0447\u0435\u043d \u0442\u0435\u043a\u0441\u0442. \u041e\u0432\u0430 \u0435 \u0442\u0430\u043a\u0430 \u043f\u0440\u0438\u043a\u043b\u0443\u0447\u043e\u043a\u043e\u0442 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0441\u0435 \u043b\u043e\u0433\u0438\u0440\u0430\u0442\u0435 \u043a\u043e\u0433\u0430 \u043f\u0440\u043e\u0437\u043e\u0440\u0435\u0446\u043e\u0442 \u0435 \u0437\u0430\u0442\u0432\u043e\u0440\u0435\u043d, \u0438\u043b\u0438 \u043c\u0435\u0453\u0443 \u0441\u0435\u0441\u0438\u0438. \u0410\u043a\u043e \u0441\u0435 \u043e\u0434\u0458\u0430\u0432\u0438\u0442\u0435 \u0440\u0430\u0447\u043d\u043e \u043f\u043e\u0441\u043b\u0435 \u0441\u0435\u043a\u043e\u0458\u0430 \u0441\u0435\u0441\u0438\u0458\u0430, \u043f\u0440\u043e\u043c\u0435\u043d\u043b\u0438\u0432\u0438 \u0441\u0435 \u0438\u0441\u0447\u0438\u0441\u0442\u0430\u0442.\n\n\u041d\u0430\u0458\u0430\u0432\u0438\u0442\u0435 \u0441\u043e Google \u0441\u043c\u0435\u0442\u043a\u0430 \u043d\u0435 \u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u043d\u043e, \u0441\u0435\u043f\u0430\u043a \u045c\u0435 \u0438\u043c \u0431\u0438\u0434\u0