														"Untuk acess Spreadsheet Google swasta terikat dengan Google Drive anda, anda mesti memberikan nama pengguna Google dan Kata Laluan.\n\u00a0\nKeselamatan Amaran: Bukti kelayakan yang disimpan di dalam EditorPrefs, yang teks biasa. Ini adalah plugin secara automatik boleh log masuk apabila tetingkap ditutup, atau antara sesi. Jika anda Log Out manual selepas setiap sesi, pembolehubah dibersihkan.\n\nLog masuk dengan akaun Google tidak perlu, tetapi anda hanya dibenarkan untuk mengakses spreadsheet diterbitkan.",
														"Biex a\u010b\u010bess g\u0127at Spreadsheets Google privati \u200b\u200bmarbuta ma 'Google Drive tieg\u0127ek, g\u0127andek tipprovdi ismek User Google u Password.\n\u00a0\nTwissija Sigurt\u00e0: Kredenzjali huma salvati fil-EditorPrefs, li huma test sempli\u010bi. Dan sabiex it-plugin tista 'awtomatikament log fil meta l-tieqa huwa mag\u0127luq, jew bejn is-sessjonijiet. Jekk inti log out manwalment wara kull sessjoni, il-varjabbli huma kklerjati.\n\nQtug\u0127 fl ma 'kont Google mhuwiex me\u0127tie\u0121, madankollu inti se jkunu permessi biss g\u0127all-a\u010b\u010bess spreadsheets ppubblikati.",
														"\u00c5 acess private Google Spreadsheets knyttet til Google Drive, m\u00e5 du gi din Google brukernavn og passord.\n\u00a0\nSikkerhetsadvarsel: Legitimasjonen er lagret i EditorPrefs, som er ren tekst. Dette er s\u00e5 plugin kan automatisk logge p\u00e5 n\u00e5r vinduet er lukket, eller mellom \u00f8ktene. Hvis du logger ut manuelt etter hver \u00f8kt, er variablene ryddet.\n\nLogge p\u00e5 med en Google-konto er ikke n\u00f8dvendig, men du vil bare f\u00e5 lov til \u00e5 f\u00e5 tilgang til publiserte regneark.",
														"Acess prywatne Arkusze Google zwi\u0105zane z Dysku Google, nale\u017cy poda\u0107 nazw\u0119 u\u017cytkownika i has\u0142o w Google.\n\u00a0\nOstrze\u017cenie o zabezpieczeniach: Po\u015bwiadczenia s\u0105 zapisywane w EditorPrefs, kt\u00f3re zwyk\u0142y tekst. To jest tak, wtyczki automatycznie zalogowa\u0107 si\u0119, gdy okno jest zamkni\u0119te, lub mi\u0119dzy sesjami. Je\u015bli Wyloguj r\u0119cznie po ka\u017cdej sesji, zmienne s\u0105 usuwane.\n\nZalogowaniu si\u0119 do konta Google, nie jest konieczne, jednak mo\u017cna mie\u0107 tylko dost\u0119p do opublikowanych arkuszy kalkulacyjnych.",
														"Para acessar o Google Spreadsheets privadas vinculadas ao seu Google Drive, voc\u00ea deve fornecer seu nome de usu\u00e1rio e senha do Google.\n\u00a0\nAviso de Seguran\u00e7a: As credenciais s\u00e3o salvas nos EditorPrefs, que s\u00e3o texto simples. Isto \u00e9 assim o plugin pode logar automaticamente quando a janela \u00e9 fechada, ou entre as sess\u00f5es. Se voc\u00ea Sair manualmente depois de cada sess\u00e3o, as vari\u00e1veis \u200b\u200bs\u00e3o apagadas.\n\nEfetuando login com uma conta do Google n\u00e3o \u00e9 necess\u00e1rio, no entanto, s\u00f3 ser\u00e1 permitida para acessar planilhas publicadas.",
														"Pentru a acess Foi de calcul tabelar private de Google legate de Unitate dvs. Google, trebuie s\u0103 furniza\u021bi numele dvs. de utilizator Google \u0219i parola.\n\u00a0\nAvertisment de securitate: Atest\u0103ri sunt salvate \u00een EditorPrefs, care sunt text simplu. Acest lucru este at\u00e2t de plugin-ul se poate conecta \u00een mod automat \u00een cazul \u00een care fereastra este \u00eenchis\u0103, sau \u00eentre sesiuni. Dac\u0103 v\u0103 Log Out manual dup\u0103 fiecare sesiune, variabilele sunt \u0219terse.\n\nLogarea cu un cont Google nu este necesar, cu toate acestea va fi permis numai pentru a accesa foi de calcul publicate.",
														"Acess s\u00fakromn\u00e9 \u200b\u200bSpreadsheets Google viazan\u00e9 na Disk Google, mus\u00edte zada\u0165 svoj Google u\u017e\u00edvate\u013esk\u00e9 meno a heslo.\n\u00a0\nUpozornenie zabezpe\u010denia: Poverenia s\u00fa ulo\u017een\u00e9 v EditorPrefs, ktor\u00e9 s\u00fa oby\u010dajn\u00fd text. To je tak plugin automaticky prihl\u00e1si\u0165 pri zatvorenom okne, alebo medzi zasadnutiami. Ak Odhl\u00e1si\u0165 sa ru\u010dne po ka\u017edom zasadnut\u00ed, premenn\u00e9 s\u00fa vymazan\u00e9.\n\nPrihl\u00e1senie k \u00fa\u010dtu Google nie je nutn\u00e9, ale budete ma\u0165 pr\u00edstup publikovan\u00fdch tabuliek iba.",
														"\u010ce \u017eelite dostopati zasebnih Google Spreadsheets vezane na va\u0161 Google Drive, morate zagotoviti Googlovega uporabni\u0161kega imena in gesla.\n\u00a0\nVarnost Opozorilo: Mandatno se shranijo v EditorPrefs, ki so golo besedilo. To je tako, lahko plugin samodejno prijavili, ko je okno zaprto, ali med sejami. \u010ce se odjavite ro\u010dno po vsaki seji, so spremenljivke izbil.\n\nPri prijavi z Googlovim ra\u010dunom ni potrebno, vendar pa vam bo dovoljen dostop do objavljenih preglednic samo.",
														"P\u00ebr t\u00eb acess Spreadsheets private Google t\u00eb lidhura me Google Drive tuaj, ju duhet t\u00eb siguroj\u00eb Google emrin tuaj t\u00eb p\u00ebrdoruesit dhe fjal\u00ebkalimin.\n\u00a0\nWarning Sigurimit: Kredenciale t\u00eb jan\u00eb ruajtur n\u00eb EditorPrefs, t\u00eb cilat jan\u00eb tekst t\u00eb thjesht\u00eb. Kjo \u00ebsht\u00eb k\u00ebshtu plugin automatikisht mund t\u00eb hyni kur dritarja \u00ebsht\u00eb mbyllur, ose n\u00eb mes t\u00eb seancave. N\u00ebse ju Log Out dor\u00eb pas \u00e7do seanc\u00eb, variablat jan\u00eb pastruar.\n\nLogging n\u00eb me nj\u00eb llogari t\u00eb Google nuk \u00ebsht\u00eb e nevojshme, por ju do t\u00eb lejohet vet\u00ebm p\u00ebr t\u00eb hyr\u00eb n\u00eb spreadsheets botuar.",
