														"I-access ay pribadong Spreadsheets Google nakatali sa iyong Google Drive, dapat kang magbigay ng iyong Google ang user name at password.\n\u00a0\nBabala sa Seguridad: kredensyal ay naka-save sa EditorPrefs, na mga plain text. Ito ay upang maaaring awtomatikong mag-log in ang plugin kapag ang window ay sarado, o sa pagitan ng mga session. Kung ikaw Log Out mano-mano pagkatapos ng bawat session, ay clear ang mga variable.\n\nNagla-log in gamit ang isang Google account ay hindi kinakailangan, gayunpaman ikaw ay pinahihintulutan lamang na i-access publish na mga spreadsheet.",
														"Google Drive ba\u011fl\u0131 \u00f6zel Google Spreadsheets acess, Google kullan\u0131c\u0131 ad\u0131 ve parola sa\u011flaman\u0131z gerekir.\n\u00a0\nG\u00fcvenlik Uyar\u0131s\u0131: Kimlik bilgileri d\u00fcz metin EditorPrefs, kaydedilir. Bu \u00e7ok eklenti otomatik pencere kapat\u0131ld\u0131\u011f\u0131nda giri\u015f veya oturumlar\u0131 aras\u0131nda oldu\u011funu. Her seanstan sonra elle Log Out ise, de\u011fi\u015fkenler silinir.\n\nBir Google hesab\u0131 ile giri\u015f ancak sadece yay\u0131mlanan elektronik tablolar\u0131 eri\u015fmek i\u00e7in izin verilecek, gerekli de\u011fildir.",
														"\u0414\u043b\u044f \u0410\u0441\u0435\u0441\u0441 \u043e\u0441\u043e\u0431\u0438\u0441\u0442\u0456 \u0435\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0456 \u0442\u0430\u0431\u043b\u0438\u0446\u0456 Google, \u043f\u0440\u0438\u0432'\u044f\u0437\u0430\u043d\u0456 \u0434\u043e \u0432\u0430\u0448\u043e\u0457 Google Drive, \u0432\u0438 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0438\u0442\u0438 \u0432\u0430\u0448 Google \u0456\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0442\u0430 \u043f\u0430\u0440\u043e\u043b\u044c.\n\u00a0\n\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u0436\u0435\u043d\u043d\u044f \u0431\u0435\u0437\u043f\u0435\u043a\u0438: \u041e\u0431\u043b\u0456\u043a\u043e\u0432\u0456 \u0434\u0430\u043d\u0456 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0432 EditorPrefs, \u044f\u043a\u0456 \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442. \u0426\u0435 \u043f\u043e\u044f\u0441\u043d\u044e\u0454\u0442\u044c\u0441\u044f \u0442\u0438\u043c, \u043f\u043b\u0430\u0433\u0456\u043d \u043c\u043e\u0436\u0435 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0443\u0432\u0456\u0439\u0442\u0438, \u043a\u043e\u043b\u0438 \u0432\u0456\u043a\u043d\u043e \u0437\u0430\u043a\u0440\u0438\u0432\u0430\u0454\u0442\u044c\u0441\u044f, \u0430\u0431\u043e \u0432 \u043f\u0435\u0440\u0456\u043e\u0434 \u043c\u0456\u0436 \u0441\u0435\u0441\u0456\u044f\u043c\u0438. \u042f\u043a\u0449\u043e \u0432\u0438 \u0412\u0438\u0445\u0456\u0434 \u0432\u0440\u0443\u0447\u043d\u0443 \u043f\u0456\u0441\u043b\u044f \u043a\u043e\u0436\u043d\u043e\u0457 \u0441\u0435\u0441\u0456\u0457, \u0437\u043c\u0456\u043d\u043d\u0456 \u0432\u0438\u0434\u0430\u043b\u044f\u044e\u0442\u044c\u0441\u044f.\n\n\u0412\u0445\u0456\u0434 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u0437 \u043e\u0431\u043b\u0456\u043a\u043e\u0432\u0438\u043c \u0437\u0430\u043f\u0438\u0441\u043e\u043c Google \u043d\u0435 \u0454 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0438\u043c, \u043f\u0440\u043e\u0442\u0435 \u0432\u0430\u043c \u0431\u0443\u0434\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u043e \u0442\u0456\u043b\u044c\u043a\u0438 \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u043e\u043f\u0443\u0431\u043b\u0456\u043a\u043e\u0432\u0430\u043d\u0456 \u0442\u0430\u0431\u043b\u0438\u0446\u0456.",
														"\u05e6\u05d5 \u05d0\u05b7\u05e1\u05e2\u05e1\u05e1 \u05e4\u05bc\u05e8\u05d9\u05d5\u05d5\u05d0\u05b7\u05d8 \u05d2\u05d5\u05d2\u05dc \u05e1\u05e4\u05bc\u05e8\u05e2\u05d0\u05b7\u05d3\u05e9\u05e2\u05e2\u05e5 \u05d8\u05d9\u05d9\u05d3 \u05e6\u05d5 \u05d3\u05d9\u05d9\u05df Google \u05d3\u05e8\u05d9\u05d9\u05d5\u05d5, \u05d0\u05d9\u05e8 \u05de\u05d5\u05d6\u05df \u05e6\u05d5\u05e9\u05d8\u05e2\u05dc\u05df \u05d3\u05d9\u05d9\u05df Google \u05d1\u05d0\u05b7\u05e0\u05d9\u05e6\u05e2\u05e8 \u05e0\u05d0\u05b8\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc.\n\u00a0\n\u05d6\u05d9\u05db\u05e2\u05e8\u05d4\u05d9\u05d9\u05b7\u05d8 \u05d5\u05d5\u05d0\u05e8\u05e2\u05e0\u05d5\u05e0\u05d2: \u05e7\u05e8\u05d0\u05b7\u05d3\u05e2\u05e0\u05d8\u05e9\u05d0\u05b7\u05dc\u05d6 \u05d6\u05e2\u05e0\u05e2\u05df \u05d2\u05e2\u05e8\u05d0\u05d8\u05e2\u05d5\u05d5\u05e2\u05d8 \u05d0\u05d9\u05df \u05d3\u05d9 \u05e2\u05d3\u05d9\u05d8\u05d0\u05b8\u05e8\u05e4\u05bc\u05e8\u05e2\u05e4\u05e1, \u05d5\u05d5\u05d0\u05b8\u05e1 \u05d6\u05e2\u05e0\u05e2\u05df \u05e7\u05dc\u05d0\u05b8\u05e8 \u05d8\u05e2\u05e7\u05e1\u05d8. \u05d3\u05e2\u05dd \u05d0\u05d9\u05d6 \u05d0\u05b7\u05d6\u05d5\u05d9 \u05d3\u05d9 \u05e4\u05bc\u05dc\u05d5\u05d2\u05d9\u05df \u05e7\u05e2\u05e0\u05e2\u05df \u05d0\u05d5\u05d9\u05d8\u05d0\u05b8\u05de\u05d0\u05b7\u05d8\u05d9\u05e9 \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05d9\u05df \u05d5\u05d5\u05e2\u05df \u05d3\u05d9 \u05e4\u05bf\u05e2\u05e0\u05e6\u05d8\u05e2\u05e8 \u05d0\u05d9\u05d6 \u05e4\u05d0\u05e8\u05de\u05d0\u05db\u05d8, \u05d0\u05b8\u05d3\u05e2\u05e8 \u05e6\u05d5\u05d5\u05d9\u05e9\u05df \u05e1\u05e2\u05e9\u05d0\u05b7\u05e0\u05d6. \u05d0\u05d5\u05d9\u05d1 \u05d0\u05d9\u05e8 \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05b8\u05d5\u05d8 \u05de\u05d0\u05b7\u05e0\u05d9\u05d5\u05d0\u05b7\u05dc\u05d9 \u05e0\u05d0\u05b8\u05da \u05d9\u05e2\u05d3\u05e2\u05e8 \u05e1\u05e2\u05e1\u05d9\u05e2, \u05d3\u05d9 \u05d5\u05d5\u05e2\u05e8\u05d9\u05d0\u05b7\u05d1\u05d0\u05b7\u05dc\u05d6 \u05d6\u05e2\u05e0\u05e2\u05df \u05e7\u05dc\u05d9\u05e8\u05d3.\n\n\u05dc\u05d0\u05b8\u05d2\u05d9\u05e0\u05d2 \u05d0\u05d9\u05df \u05de\u05d9\u05d8 \u05d0\u05b7 Google \u05d7\u05e9\u05d1\u05d5\u05df \u05d0\u05d9\u05d6 \u05e0\u05d9\u05d8 \u05e0\u05d9\u05d9\u05d8\u05d9\u05e7, \u05d0\u05b8\u05d1\u05e2\u05e8 \u05d0\u05d9\u05e8 \u05d5\u05d5\u05e2\u05d8 \u05e0\u05d0\u05b8\u05e8 \u05d6\u05d9\u05d9\u05df \u05e2\u05e8\u05dc\u05d5\u05d9\u05d1\u05d8 \u05e6\u05d5 \u05e6\u05d5\u05d8\u05e8\u05d9\u05d8 \u05d0\u05e8\u05d5\u05d9\u05e1 \u05e1\u05e4\u05bc\u05e8\u05e2\u05d3\u05e9\u05d9\u05e5.",
														"\u63a5\u53d6\u79c1\u4eba\u8c37\u6b4c\u96fb\u5b50\u8868\u683c\u8207\u60a8\u7684\u8c37\u6b4c\u9a45\u52d5\u5668\uff0c\u60a8\u5fc5\u9808\u63d0\u4f9b\u60a8\u7684\u8c37\u6b4c\u7528\u6236\u540d\u548c\u5bc6\u78bc\u3002\n\u00a0\n\u5b89\u5168\u8b66\u544a\uff1a\u8b49\u66f8\u4fdd\u5b58\u5728EditorPrefs\uff0c\u9019\u662f\u7d14\u6587\u672c\u3002\u4e4b\u6240\u4ee5\u5982\u6b64\uff0c\u662f\u7576\u7a97\u53e3\u88ab\u95dc\u9589\u7684\u63d2\u4ef6\u53ef\u4ee5\u81ea\u52d5\u767b\u9304\uff0c\u6216\u6703\u8a71\u4e4b\u9593\u3002\u5982\u679c\u4f60\u6bcf\u6b21\u6703\u8b70\u5f8c\u624b\u52d5\u8a3b\u92b7\uff0c\u8a72\u8b8a\u91cf\u88ab\u6e05\u9664\u3002\n\n\u6709\u4e00\u500b\u8c37\u6b4c\u5e33\u6236\u767b\u9304\u662f\u6c92\u6709\u5fc5\u8981\u7684\uff0c\u4f46\u662f\u4f60\u53ea\u88ab\u5141\u8a31\u8a2a\u554f\u767c\u5e03\u7684\u96fb\u5b50\u8868\u683c\u3002"));
