			Rows.Add( new LocalizationRow("When you select a Google Spreadsheet to be Active, it becomes the Active Workbook. \n\nWhen there is an Active Workbook, the Tools menu will allow you to select individual worksheets from within the Active Workbook to be exported, as well as the Export Type.\n\nYou may Open the Workbook in a Browser Window by clicking the \"Open URL\" button.\n\nYou may Deactivate the Active Workbook by clicking the \"Deactivate\" button. ",
														"Lorsque vous s\u00e9lectionnez une feuille de calcul Google pour \u00eatre actif, il devient Active classeur.\n\nQuand il ya un classeur actif, dans le menu Outils vous permettra de s\u00e9lectionner des feuilles de calcul individuelles \u00e0 l'int\u00e9rieur du classeur actif \u00e0 exporter, ainsi que le type d'exportation.\n\nVous pouvez ouvrir le classeur dans une fen\u00eatre du navigateur en cliquant sur le bouton \"Ouvrir URL\".\n\nVous pouvez d\u00e9sactiver l'Active classeur en cliquant sur le bouton \"D\u00e9sactiver\".",
														"Quando si seleziona un foglio di calcolo di Google per essere attivo, diventa Active Workbook.\n\nQuando c'\u00e8 una cartella di lavoro attivo, il menu Strumenti vi permetter\u00e0 di selezionare i singoli fogli di lavoro all'interno della cartella di lavoro attiva per essere esportati, come pure il tipo di esportazione.\n\n\u00c8 possibile aprire la cartella di lavoro in una finestra del browser cliccando sul pulsante \"Apri URL\".\n\n\u00c8 possibile disattivare Active cartella di lavoro facendo clic sul pulsante \"Disattiva\".",
														"Wenn Sie eine Google-Tabelle w\u00e4hlen Sie Aktiv zu sein, wird es die aktive Arbeitsmappe.\n\nWenn es eine aktive Arbeitsmappe wird das Men\u00fc Extras k\u00f6nnen Sie einzelne Arbeitsbl\u00e4tter aus der aktiven Arbeitsmappe, die exportiert werden sollen, sowie die Export-Typ.\n\nSie k\u00f6nnen die Arbeitsmappe in einem Browser-Fenster \u00f6ffnen, indem Sie auf den Button \"URL \u00f6ffnen\".\n\nSie k\u00f6nnen die aktive Arbeitsmappe, indem Sie auf die Schaltfl\u00e4che \"Deaktivieren\"-Taste deaktivieren.",
														"Cuando se selecciona una hoja de c\u00e1lculo de Google para ser activo, se convierte en el Active Workbook.\n\nCuando hay un libro de trabajo activo, en el men\u00fa Herramientas le permite seleccionar hojas de c\u00e1lculo individuales desde dentro del libro activo a la exportaci\u00f3n, as\u00ed como el tipo de exportaci\u00f3n.\n\nUsted puede abrir el libro en una ventana del navegador, haga clic en el bot\u00f3n \"Abrir URL\".\n\nUsted puede desactivar el Active Workbook haciendo clic en el bot\u00f3n \"Desactivar\".",
														"\u0639\u0646\u062f \u062a\u062d\u062f\u064a\u062f \u062c\u062f\u0648\u0644 \u062c\u0648\u062c\u0644 \u0644\u062a\u0643\u0648\u0646 \u0628\u0627\u0644\u0645\u0648\u0642\u0639\u060c \u064a\u0635\u0628\u062d \u0627\u0644\u0645\u0635\u0646\u0641 \u0627\u0644\u0646\u0634\u0637.\n\n\u0639\u0646\u062f\u0645\u0627 \u064a\u0643\u0648\u0646 \u0647\u0646\u0627\u0643 \u0645\u0635\u0646\u0641 \u0628\u0627\u0644\u0645\u0648\u0642\u0639\u060c \u0641\u0625\u0646 \u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u0623\u062f\u0648\u0627\u062a \u062a\u0633\u0645\u062d \u0644\u0643 \u0644\u062a\u062d\u062f\u064a\u062f \u0623\u0648\u0631\u0627\u0642 \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0641\u0631\u062f\u064a\u0629 \u0645\u0646 \u062f\u0627\u062e\u0644 \u0645\u0635\u0646\u0641 \u0628\u0627\u0644\u0645\u0648\u0642\u0639 \u0627\u0644\u0645\u0631\u0627\u062f \u062a\u0635\u062f\u064a\u0631\u0647\u0627\u060c \u0648\u0643\u0630\u0644\u0643 \u0646\u0648\u0639 \u0627\u0644\u062a\u0635\u062f\u064a\u0631.\n\n\u064a\u0645\u0643\u0646\u0643 \u0641\u062a\u062d \u0627\u0644\u0645\u0635\u0646\u0641 \u0641\u064a \u0625\u0637\u0627\u0631 \u0645\u0633\u062a\u0639\u0631\u0636 \u0628\u0627\u0644\u0646\u0642\u0631 \u0639\u0644\u0649 \u0632\u0631 \"\u0641\u062a\u062d URL\".\n\n\u064a\u0645\u0643\u0646\u0643 \u0625\u0644\u063a\u0627\u0621 \u062a\u0646\u0634\u064a\u0637 \u0627\u0644\u0645\u0635\u0646\u0641 \u0628\u0627\u0644\u0645\u0648\u0642\u0639 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0627\u0644\u0646\u0642\u0631 \u0639\u0644\u0649 \u0632\u0631 \"\u0625\u064a\u0642\u0627\u0641\".",
														"\ub2f9\uc2e0\uc774 \ud65c\uc57d \ud560 \uc218\uc788\ub294 \uad6c\uae00 \uc2a4\ud504\ub808\ub4dc \uc2dc\ud2b8\ub97c \uc120\ud0dd\ud558\uba74 \ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c\uac00\ub429\ub2c8\ub2e4.\n\n\ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c\uac00\uc788\ub294 \uacbd\uc6b0, \ub3c4\uad6c \uba54\ub274\ub97c \ub0b4\ubcf4\ub0bc \ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c \ub0b4\uc5d0\uc11c \uac1c\ubcc4 \uc6cc\ud06c \uc2dc\ud2b8\ub97c \uc120\ud0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4,\ubfd0\ub9cc \uc544\ub2c8\ub77c \uc218\ucd9c \uc720\ud615\uc774\ub429\ub2c8\ub2e4.\n\n\ub2f9\uc2e0\uc740 \"\uc5f4\uae30 URL\"\ubc84\ud2bc\uc744 \ud074\ub9ad\ud558\uc5ec \ube0c\ub77c\uc6b0\uc800 \ucc3d\uc5d0\uc11c \ud1b5\ud569 \ubb38\uc11c\ub97c \uc5f4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\ub2f9\uc2e0\uc740 \"\ube44\ud65c\uc131\ud654\"\ubc84\ud2bc\uc744 \ud074\ub9ad\ud558\uc5ec \ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c\ub97c \ube44\ud65c\uc131\ud654 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
