														"\u3042\u306a\u305f\u304c\u30a2\u30af\u30c6\u30a3\u30d6\u306b\u3059\u308bGoogle\u30b9\u30d7\u30ec\u30c3\u30c9\u30b7\u30fc\u30c8\u3092\u9078\u629e\u3059\u308b\u3068\u3001\u4f5c\u696d\u4e2d\u306e\u30d6\u30c3\u30af\u306b\u306a\u308a\u307e\u3059\u3002\n\n\u30a2\u30af\u30c6\u30a3\u30d6\u306a\u30d6\u30c3\u30af\u304c\u3042\u308b\u5834\u5408\u306f\u3001[\u30c4\u30fc\u30eb]\u30e1\u30cb\u30e5\u30fc\u3092\u4f7f\u7528\u3059\u308b\u3068\u3001\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u3059\u308b\u30a2\u30af\u30c6\u30a3\u30d6\u30d6\u30c3\u30af\u3060\u3051\u3067\u306a\u304f\u3001\u8f38\u51fa\u578b\u306e\u4e2d\u304b\u3089\u500b\u3005\u306e\u30ef\u30fc\u30af\u30b7\u30fc\u30c8\u3092\u9078\u629e\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u308b\u3088\u3046\u306b\u306a\u308a\u307e\u3059\u3002\n\n\u3042\u306a\u305f\u306f\u3001\u300cURL\u3092\u958b\u304f\u300d\u30dc\u30bf\u30f3\u3092\u30af\u30ea\u30c3\u30af\u3057\u3066\u3001\u30d6\u30e9\u30a6\u30b6\u30a6\u30a3\u30f3\u30c9\u30a6\u3067\u30d6\u30c3\u30af\u3092\u958b\u304f\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u3002\n\n\u3042\u306a\u305f\u306f\u3001\u300c\u7121\u52b9\u5316\u300d\u30dc\u30bf\u30f3\u3092\u30af\u30ea\u30c3\u30af\u3057\u3066\u3001\u30a2\u30af\u30c6\u30a3\u30d6\u306a\u30d6\u30c3\u30af\u3092\u975e\u30a2\u30af\u30c6\u30a3\u30d6\u306b\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u308b\u3002",
														"\u041f\u0440\u0438 \u0432\u044b\u0431\u043e\u0440\u0435 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u043e\u0439 \u0442\u0430\u0431\u043b\u0438\u0446\u044b Google, \u0447\u0442\u043e\u0431\u044b \u0431\u044b\u0442\u044c \u0430\u043a\u0442\u0438\u0432\u043d\u044b\u043c, \u043e\u043d \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438.\n\n\u041a\u043e\u0433\u0434\u0430 \u0435\u0441\u0442\u044c \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438, \u043c\u0435\u043d\u044e \u0418\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u044b \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442 \u0432\u0430\u043c \u0432\u044b\u0431\u0440\u0430\u0442\u044c \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u044b\u0435 \u043b\u0438\u0441\u0442\u044b \u0432\u043d\u0443\u0442\u0440\u0438 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438 \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430, \u0430 \u0442\u0430\u043a\u0436\u0435 \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430 \u0422\u0438\u043f.\n\n\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u044c \u043a\u043d\u0438\u0433\u0443 \u0432 \u043e\u043a\u043d\u0435 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430, \u043d\u0430\u0436\u0430\u0432 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u041e\u0442\u043a\u0440\u044b\u0442\u044c URL\".\n\n\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u041e\u0442\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438, \u043d\u0430\u0436\u0430\u0432 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u041e\u0442\u043a\u043b\u044e\u0447\u0438\u0442\u044c\".",
