														"\u041f\u0440\u044b \u0432\u044b\u0431\u0430\u0440\u044b \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0430\u0439 \u0442\u0430\u0431\u043b\u0456\u0446\u044b Google, \u043a\u0430\u0431 \u0431\u044b\u0446\u044c \u0430\u043a\u0442\u044b\u045e\u043d\u044b\u043c, \u0451\u043d \u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0446\u0446\u0430 \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456.\n\n\u041a\u0430\u043b\u0456 \u0451\u0441\u0446\u044c \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456, \u043c\u0435\u043d\u044e \u0406\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u044b \u0434\u0430\u0437\u0432\u043e\u043b\u0456\u0446\u044c \u0432\u0430\u043c \u0432\u044b\u0431\u0440\u0430\u0446\u044c \u0430\u0441\u043e\u0431\u043d\u044b\u044f \u043b\u0456\u0441\u0442\u044b \u045e\u043d\u0443\u0442\u0440\u044b \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456 \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443, \u0430 \u0442\u0430\u043a\u0441\u0430\u043c\u0430 \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443 \u0422\u044b\u043f.\n\n\u0412\u044b \u043c\u043e\u0436\u0430\u0446\u0435 \u0430\u0434\u043a\u0440\u044b\u0446\u044c \u043a\u043d\u0456\u0433\u0443 \u045e \u0430\u043a\u043d\u0435 \u0431\u0440\u0430\u045e\u0437\u044d\u0440\u0430, \u043d\u0430\u0446\u0456\u0441\u043d\u0443\u045e\u0448\u044b \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u0410\u0434\u043a\u0440\u044b\u0446\u044c URL\".\n\n\u0412\u044b \u043c\u043e\u0436\u0430\u0446\u0435 \u0410\u0434\u043a\u043b\u044e\u0447\u044d\u043d\u043d\u0435 \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456, \u043d\u0430\u0446\u0456\u0441\u043d\u0443\u045e\u0448\u044b \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u0410\u0434\u043a\u043b\u044e\u0447\u044b\u0446\u044c\".",
														"Quan es selecciona un full de c\u00e0lcul de Google per ser actiu, esdev\u00e9 l'Active Workbook.\n\nQuan hi ha un llibre de treball actiu, al men\u00fa Eines us permet seleccionar fulls de c\u00e0lcul individuals des de dins del llibre actiu a l'exportaci\u00f3, aix\u00ed com el tipus d'exportaci\u00f3.\n\nVost\u00e8 pot obrir el llibre en una finestra del navegador, feu clic al bot\u00f3 \"Obre URL\".\n\nVost\u00e8 pot desactivar l'Active Workbook fent clic al bot\u00f3 \"Desactivar\".",
														"Kdy\u017e vyberete tabulku Satelitn\u00ed b\u00fdt aktivn\u00ed, to se st\u00e1v\u00e1 aktivn\u00edm se\u0161itu.\n\nKdy\u017e je aktivn\u00ed se\u0161it, bude v nab\u00eddce N\u00e1stroje v\u00e1m umo\u017en\u00ed vybrat jednotliv\u00e9 listy v r\u00e1mci aktivn\u00edho se\u0161itu, kter\u00e9 maj\u00ed b\u00fdt vyv\u00e1\u017een\u00e9, stejn\u011b jako export typu.\n\nM\u016f\u017eete Otev\u0159ete se\u0161it v okn\u011b prohl\u00ed\u017ee\u010de, klikn\u011bte na tla\u010d\u00edtko \"Otev\u0159\u00edt URL\".\n\nM\u016f\u017eete vypnout aktivn\u00ed se\u0161it klepnut\u00edm na tla\u010d\u00edtko \"deaktivovat\".",
