														"Kai pasirenkate \"Google\" skai\u010diuokl\u0119 b\u016bti aktyvus, jis tampa aktyvus darbaknyg\u0117.\n\nKai yra aktyvus darbaknyg\u0117, meniu \u012erankiai leis jums pasirinkti atskirus lapus i\u0161 vidaus Active Workbook b\u016bti eksportuojamos, taip pat Eksporto tipas.\n\nJ\u016bs galite atidaryti darbaknyg\u0119 nar\u0161ykl\u0117s lange, paspaudus mygtuk\u0105 \"Atidaryti URL\" mygtuk\u0105.\n\nGalite I\u0161jungti Active Segtuvas paspaud\u0119 \"i\u0161jungti\" mygtuk\u0105.",
														"Kad j\u016bs izv\u0113laties Google izkl\u0101jlapu b\u016bs akt\u012bvs, tas k\u013c\u016bst Active burtn\u012bca.\n\nJa ir akt\u012bvs Workbook, R\u012bki \u013caus jums izv\u0113l\u0113ties atsevi\u0161\u0137as darblapas no iek\u0161puses Active burtn\u012bca, kas eksport\u0113, k\u0101 ar\u012b eksporta veids.\n\nJ\u016bs varat atv\u0113rt darbgr\u0101matu p\u0101rl\u016bkprogrammas log\u0101, noklik\u0161\u0137inot uz \"Open URL\" pogu.\n\nJ\u016bs varat deaktiviz\u0113tu akt\u012bvo darbgr\u0101matu, noklik\u0161\u0137inot uz \"atsl\u0113gt\" pogu.",
														"\u041a\u043e\u0433\u0430 \u045c\u0435 \u0438\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u0442\u0430\u0431\u0435\u043b\u0430 \u043d\u0430 Google \u0434\u0430 \u0431\u0438\u0434\u0430\u0442 \u0430\u043a\u0442\u0438\u0432\u043d\u0438, \u0441\u0442\u0430\u043d\u0443\u0432\u0430 \u0430\u043a\u0442\u0438\u0432\u0435\u043d \u0414\u0435\u043b\u043e\u0432\u043d\u0438\u043a.\n\n\u041a\u043e\u0433\u0430 \u0438\u043c\u0430 \u0430\u043a\u0442\u0438\u0432\u0435\u043d \u0414\u0435\u043b\u043e\u0432\u043d\u0438\u043a, \u043d\u0430 \u043c\u0435\u043d\u0438\u0442\u043e Tools \u045c\u0435 \u0432\u0438 \u043e\u0432\u043e\u0437\u043c\u043e\u0436\u0438 \u0434\u0430 \u0438\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u043f\u043e\u0435\u0434\u0438\u043d\u0435\u0447\u043d\u0438 \u043b\u0438\u0441\u0442\u043e\u0432\u0438 \u043e\u0434 \u0440\u0430\u043c\u043a\u0438\u0442\u0435 \u0410\u043a\u0442\u0438\u0432\u043d\u0438 \u0414\u0435\u043b\u043e\u0432\u043d\u0438\u043a \u0437\u0430 \u0438\u0437\u0432\u043e\u0437, \u043a\u0430\u043a\u043e \u0438 \u0422\u0438\u043f \u0438\u0437\u0432\u043e\u0437.\n\n\u041c\u043e\u0436\u0435\u0442\u0435 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0458\u0430 \u043e\u0442\u0432\u043e\u0440\u0438 \u0414\u0435\u043b\u043e\u0432\u043d\u0438\u043a \u0432\u043e \u043f\u0440\u043e\u0437\u043e\u0440\u0435\u0446\u043e\u0442 \u043d\u0430 \u043f\u0440\u0435\u043b\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u043e\u0442 \u0441\u043e \u043a\u043b\u0438\u043a\u043d\u0443\u0432\u0430\u045a\u0435 \u043d\u0430 \"\u041e\u0442\u0432\u043e\u0440\u0438 URL\" \u043a\u043e\u043f\u0447\u0435\u0442\u043e.\n\n\u041c\u043e\u0436\u0435 \u0434\u0430 \u0414\u0435\u0430\u043a\u0442\u0438\u0432\u0438\u0440\u0430\u045a\u0435 \u0410\u043a\u0442\u0438\u0432\u043d\u0438 \u0414\u0435\u043b\u043e\u0432\u043d\u0438\u043a \u0441\u043e \u043a\u043b\u0438\u043a\u043d\u0443\u0432\u0430\u045a\u0435 \u043d\u0430 \"\u0414\u0435\u0430\u043a\u0442\u0438\u0432\u0438\u0440\u0430\u0458\" \u043a\u043e\u043f\u0447\u0435\u0442\u043e.",
														"Apabila anda memilih Spreadsheet Google untuk menjadi aktif, ia menjadi Buku Kerja Aktif.\n\nApabila ada Buku Kerja Aktif, menu Alat akan membolehkan anda untuk memilih lembaran kerja individu dari dalam Buku Kerja Aktif yang akan dieksport, serta Jenis Eksport.\n\nAnda boleh Buka Buku Kerja dalam tetingkap penyemak imbas dengan mengklik butang \"Open URL\".\n\nAnda boleh Nyahaktifkan Buku Kerja Aktif dengan mengklik butang \"Nyahaktifkan\".",
														"Meta inti tag\u0127\u017cel Spreadsheet Google tkun Active, din issir l-Workbook Active.\n\nMeta jkun hemm Workbook Active, il-Tools menu se jippermetti li inti tag\u0127\u017cel worksheets individwali minn \u0121ewwa l-Workbook Active ji\u0121u esportati, kif ukoll tat-Tip Esportazzjoni.\n\nInti tista Ifta\u0127 il-Workbook fi browser billi tikklikkja l-\"Open URL\" buttuna.\n\nInti tista deattivat Workbook Active billi tikklikkja l-\"Irrendi inattiv\" buttuna.",
														"N\u00e5r du velger et Google-regneark til \u00e5 v\u00e6re aktiv, blir det den aktive arbeidsboken.\n\nN\u00e5r det er en aktiv arbeidsbok, vil Verkt\u00f8y-menyen lar deg velge individuelle regneark fra innen den aktive arbeidsboken som skal eksporteres, samt eksporttype.\n\nDu kan \u00e5pne arbeidsboken i et nettleservindu ved \u00e5 klikke p\u00e5 \"\u00c5pne URL-adresse\"-knappen.\n\nDu kan deaktivere den aktive arbeidsboken ved \u00e5 klikke p\u00e5 \"Deaktiver\"-knappen.",
														"Po wybraniu arkusza kalkulacyjnego Google by\u0107 aktywny, staje si\u0119 aktywnym skoroszycie.\n\nGdy istnieje aktywny skoroszyt, menu Narz\u0119dzia pozwoli wybra\u0107 poszczeg\u00f3lne arkusze od wewn\u0105trz aktywnym skoroszycie zosta\u0107 wywiezione, jak r\u00f3wnie\u017c typ eksportu.\n\nMo\u017cna otworzy\u0107 skoroszyt w oknie przegl\u0105darki, klikaj\u0105c na przycisk \"Otw\u00f3rz URL\".\n\nMo\u017cesz Wy\u0142\u0105cz aktywnym skoroszycie, klikaj\u0105c przycisk \"wy\u0142\u0105czy\u0107\".",
														"Quando voc\u00ea seleciona uma planilha do Google para ser ativo, torna-se a pasta de trabalho ativa.\n\nQuando h\u00e1 um livro activo, no menu Ferramentas ir\u00e1 permitir que voc\u00ea selecione planilhas individuais de dentro da pasta de trabalho ativa a ser exportado, bem como o tipo de exporta\u00e7\u00e3o.\n\nVoc\u00ea pode abrir o livro em uma janela do navegador, clique no bot\u00e3o \"Abrir URL\".\n\nVoc\u00ea pode Desative a pasta de trabalho ativa, clicando no bot\u00e3o \"Desativar\".",
														"C\u00e2nd selecta\u021bi o foaie de calcul Google pentru a fi activ, acesta devine activ Workbook.\n\nAtunci c\u00e2nd exist\u0103 un registru de lucru activ, \u00een meniul Tools va permite s\u0103 selecta\u021bi foile de lucru individuale din cadrul registrului de lucru activ pentru a fi exportate, precum \u0219i tipul de export.\n\nEste posibil s\u0103 deschide\u021bi registrul de lucru \u00eentr-o fereastr\u0103 de browser, f\u0103c\u00e2nd clic pe butonul \"Open URL\".\n\nEste posibil s\u0103 Dezactiva\u021bi Active Workbook f\u0103c\u00e2nd clic pe butonul \"Dezactiva\u021bi\".",
														"Ke\u010f vyberiete tabu\u013eku Satelitn\u00e9 by\u0165 akt\u00edvny, to sa st\u00e1va akt\u00edvnym zo\u0161ita.\n\nKe\u010f je akt\u00edvny zo\u0161it, bude v ponuke N\u00e1stroje v\u00e1m umo\u017en\u00ed vybra\u0165 jednotliv\u00e9 listy v r\u00e1mci akt\u00edvneho zo\u0161ita, ktor\u00e9 maj\u00fa by\u0165 vyv\u00e1\u017een\u00e9, rovnako ako export typu.\n\nM\u00f4\u017eete Otvorte zo\u0161it v okne prehliada\u010da, kliknite na tla\u010didlo \"Otvori\u0165 URL\".\n\nM\u00f4\u017eete vypn\u00fa\u0165 akt\u00edvny zo\u0161it kliknut\u00edm na tla\u010didlo \"deaktivova\u0165\".",
														"Ko izberete Googlovo preglednico biti aktiven, postane aktiven delovni zvezek.\n\nKo je aktiven delovni zvezek, bo Orodja vam omogo\u010dajo, da izberete posamezne delovne liste od znotraj aktivnega zvezka, ki se izvozi, kot tudi Export Type.\n\nLahko odprete delovni zvezek v oknu brskalnika s klikom na gumb \"Odpri URL\u00ab.\n\nMorda boste Izklopite Active delovni zvezek s klikom na gumb \"izklju\u010ditve\".",
														"Kur ju zgjidhni nj\u00eb spreadsheet Google p\u00ebr t\u00eb qen\u00eb aktiv, ai b\u00ebhet Lib\u00ebr pune ne forum.\n\nKur ka nj\u00eb Lib\u00ebr pune ne forum, menu Tools do t\u00eb ju lejojn\u00eb t\u00eb zgjidhni pune individuale nga brenda manual aktiv q\u00eb do t\u00eb eksportohet, si dhe Lloji Export.\n\nJu mund t\u00eb Hapni manual n\u00eb nj\u00eb dritare t\u00eb shfletuesit duke klikuar tek \"Open URL\" button.\n\nJu mund t\u00eb \u00e7aktivizoni manual aktiv duke klikuar \"\u00e7aktivizuar\" button.",
