			Rows.Add( new LocalizationRow("Your Google User Name and Password can be stored locally, so that you do not need to log in every time. \n\nHowever, keep in mind these values are saved in PLAIN TEXT form and can be accessed if your computer is compromised.\n \nIf you use the Log out button, your User Name and Password are cleared as well. ",
														"Votre nom d'utilisateur Google et mot de passe peuvent \u00eatre stock\u00e9s localement, de sorte que vous n'avez pas besoin de vous connecter \u00e0 chaque fois.\n\nCependant, gardez \u00e0 l'esprit ces valeurs sont enregistr\u00e9es sous forme de texte en clair et peuvent \u00eatre accessibles que si votre ordinateur est compromise.\n\u00a0\nSi vous utilisez le bouton D\u00e9connexion, votre nom d'utilisateur et mot de passe sont effac\u00e9s aussi.",
														"Il tuo nome utente Google e la password possono essere memorizzate in locale, in modo che non \u00e8 necessario effettuare il login ogni volta.\n\nTuttavia, tenere a mente questi valori vengono salvati in formato di testo semplice e si pu\u00f2 accedere se il computer \u00e8 compromesso.\n\u00a0\nSe si utilizza il pulsante Log out, il tuo nome utente e password vengono cancellate pure.",
														"Ihr Google-Benutzernamen und Kennwort k\u00f6nnen lokal gespeichert werden, so dass Sie nicht brauchen, um jedes Mal einloggen.\n\nJedoch im Auge behalten, diese Werte werden im Klartext Form gespeichert und k\u00f6nnen abgerufen werden, wenn Ihr Computer ist gef\u00e4hrdet.\n\u00a0\nWenn Sie die Schaltfl\u00e4che Protokoll aus verwenden, werden Sie Ihren Benutzernamen und Passwort als auch gel\u00f6scht.",
														"Su Google Nombre de usuario y Contrase\u00f1a se pueden almacenar de forma local, de modo que usted no tiene que iniciar sesi\u00f3n cada vez.\n\nSin embargo, tenga en cuenta estos valores se guardan en forma de texto sin formato y se puede acceder si su equipo est\u00e1 en peligro.\n\u00a0\nSi utiliza el bot\u00f3n Desconectar, su nombre de usuario y contrase\u00f1a se borran tambi\u00e9n.",
														"\u062c\u0648\u062c\u0644 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u064a\u0645\u0643\u0646 \u062a\u062e\u0632\u064a\u0646\u0647\u0627 \u0645\u062d\u0644\u064a\u0627\u060c \u0628\u062d\u064a\u062b \u0644\u0627 \u062a\u062d\u062a\u0627\u062c \u0644\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0641\u064a \u0643\u0644 \u0645\u0631\u0629.\n\n\u0648\u0645\u0639 \u0630\u0644\u0643\u060c \u0646\u0636\u0639 \u0641\u064a \u0627\u0639\u062a\u0628\u0627\u0631\u0646\u0627 \u064a\u062a\u0645 \u062d\u0641\u0638 \u0647\u0630\u0647 \u0627\u0644\u0642\u064a\u0645 \u0641\u064a \u0634\u0643\u0644 \u0646\u0635 \u0639\u0627\u062f\u064a \u0648\u064a\u0645\u0643\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u064a\u0647\u0627 \u0625\u0630\u0627 \u062a\u0645 \u0627\u0644\u0645\u0633\u0627\u0633 \u062c\u0647\u0627\u0632 \u0627\u0644\u0643\u0645\u0628\u064a\u0648\u062a\u0631 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.\n\u00a0\n\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0633\u062a\u062e\u062f\u0645 \u062e\u0631\u0648\u062c \u0632\u0631\u060c \u064a\u062a\u0645 \u0645\u0633\u062d \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0643\u0630\u0644\u0643.",
														"\ub2f9\uc2e0\uc774 \ubaa8\ub4e0 \uc2dc\uac04\uc5d0 \ub85c\uadf8\uc778 \ud560 \ud544\uc694\uac00 \uc5c6\ub3c4\ub85d Google \uc0ac\uc6a9\uc790 \uc774\ub984\uacfc \uc554\ud638\ub294 \ub85c\uceec\uc5d0 \uc800\uc7a5 \ub420 \uc218\uc788\ub2e4.\n\n\uadf8\ub7ec\ub098,\uc774 \uac12\uc774 \uc77c\ubc18 \ud14d\uc2a4\ud2b8 \ud615\ud0dc\ub85c \uc800\uc7a5\ub418\uace0 \ucef4\ud4e8\ud130\uac00 \uc190\uc0c1\ub418\ub294 \uacbd\uc6b0\uc5d0 \uc561\uc138\uc2a4 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4 \uba85\uc2ec\ud558\uc2ed\uc2dc\uc624.\n\u00a0\n\ub2f9\uc2e0\uc774 \ub85c\uadf8 \uc544\uc6c3 \ubc84\ud2bc\uc744 \uc0ac\uc6a9\ud558\ub294 \uacbd\uc6b0, \uc0ac\uc6a9\uc790 \uc774\ub984\uacfc \ube44\ubc00\ubc88\ud638\ubfd0\ub9cc \uc544\ub2c8\ub77c \uc0ad\uc81c\ub429\ub2c8\ub2e4.",
														"\u60a8\u7684\u8c37\u6b4c\u7528\u6237\u540d\u548c\u5bc6\u7801\u53ef\u4ee5\u5728\u672c\u5730\u5b58\u50a8\uff0c\u8fd9\u6837\u4f60\u5c31\u4e0d\u9700\u8981\u6bcf\u6b21\u90fd\u767b\u5f55\u3002\n\n\u4f46\u662f\uff0c\u8bf7\u8bb0\u4f4f\u8fd9\u4e9b\u503c\u4fdd\u5b58\u5728\u7eaf\u6587\u672c\u7684\u5f62\u5f0f\uff0c\u5982\u679c\u60a8\u7684\u8ba1\u7b97\u673a\u88ab\u653b\u7834\u53ef\u4ee5\u8bbf\u95ee\u3002\n\u00a0\n\u5982\u679c\u60a8\u4f7f\u7528\u7684\u6ce8\u9500\u6309\u94ae\uff0c\u60a8\u7684\u7528\u6237\u540d\u548c\u5bc6\u7801\u88ab\u6e05\u9664\u3002",
														"\u3042\u306a\u305f\u304c\u3059\u308b\u305f\u3073\u306b\u30ed\u30b0\u30a4\u30f3\u3059\u308b\u5fc5\u8981\u304c\u306a\u3044\u3088\u3046\u306b\u3042\u306a\u305f\u306eGoogle\u30e6\u30fc\u30b6\u30fc\u540d\u3068\u30d1\u30b9\u30ef\u30fc\u30c9\u306f\u3001\u30ed\u30fc\u30ab\u30eb\u306b\u4fdd\u5b58\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\n\n\u3057\u304b\u3057\u3001\u3053\u308c\u3089\u306e\u5024\u306f\u30d7\u30ec\u30fc\u30f3\u30c6\u30ad\u30b9\u30c8\u5f62\u5f0f\u3067\u4fdd\u5b58\u3055\u308c\u3001\u30b3\u30f3\u30d4\u30e5\u30fc\u30bf\u304c\u4fb5\u5bb3\u3055\u308c\u305f\u5834\u5408\u306b\u30a2\u30af\u30bb\u30b9\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u308b\u3053\u3068\u306b\u7559\u610f\u3057\u3066\u304f\u3060\u3055\u3044\u3002\n\u00a0\n\u3042\u306a\u305f\u306f[\u30ed\u30b0\u30a2\u30a6\u30c8]\u30dc\u30bf\u30f3\u3092\u4f7f\u7528\u3057\u3066\u3044\u308b\u5834\u5408\u306f\u3001\u30e6\u30fc\u30b6\u30fc\u540d\u3068\u30d1\u30b9\u30ef\u30fc\u30c9\u3082\u540c\u69d8\u306b\u30af\u30ea\u30a2\u3055\u308c\u307e\u3059\u3002",
														"\u0412\u0430\u0448 Google \u0418\u043c\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u0438 \u043f\u0430\u0440\u043e\u043b\u044c \u043c\u043e\u0433\u0443\u0442 \u0431\u044b\u0442\u044c \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u044b \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u043e, \u0442\u0430\u043a \u0447\u0442\u043e \u0432\u0430\u043c \u043d\u0435 \u043d\u0443\u0436\u043d\u043e, \u0447\u0442\u043e\u0431\u044b \u0432\u043e\u0439\u0442\u0438 \u0432 \u043b\u044e\u0431\u043e\u0435 \u0432\u0440\u0435\u043c\u044f.\n\n\u041e\u0434\u043d\u0430\u043a\u043e, \u0438\u043c\u0435\u0439\u0442\u0435 \u0432 \u0432\u0438\u0434\u0443, \u044d\u0442\u0438 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u044e\u0442\u0441\u044f \u0432 \u0432\u0438\u0434\u0435 \u043f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0435\u043a\u0441\u0442\u0430 \u0438 \u043c\u043e\u0433\u0443\u0442 \u0431\u044b\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b, \u0435\u0441\u043b\u0438 \u0432\u0430\u0448 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043f\u043e\u0434 \u0443\u0433\u0440\u043e\u0437\u043e\u0439.\n\u00a0\n\u0415\u0441\u043b\u0438 \u0432\u044b \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0435 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0435 \u0412\u044b\u0445\u043e\u0434, \u0412\u0430\u0448\u0435 \u0438\u043c\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u0438 \u043f\u0430\u0440\u043e\u043b\u044c \u0431\u0443\u0434\u0443\u0442 \u043e\u0447\u0438\u0449\u0435\u043d\u044b, \u0430 \u0442\u0430\u043a\u0436\u0435.",
														"Google c\u1ee7a b\u1ea1n T\u00ean t\u00e0i kho\u1ea3n v\u00e0 m\u1eadt kh\u1ea9u c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef t\u1ea1i \u0111\u1ecba ph\u01b0\u01a1ng, do \u0111\u00f3 b\u1ea1n kh\u00f4ng c\u1ea7n ph\u1ea3i \u0111\u0103ng nh\u1eadp v\u00e0o t\u1ea5t c\u1ea3 c\u00e1c th\u1eddi gian.\n\nTuy nhi\u00ean, h\u00e3y ghi nh\u1edb nh\u1eefng gi\u00e1 tr\u1ecb \u0111\u01b0\u1ee3c l\u01b0u l\u1ea1i d\u01b0\u1edbi d\u1ea1ng v\u0103n b\u1ea3n \u0111\u01a1n gi\u1ea3n v\u00e0 c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c truy c\u1eadp n\u1ebfu m\u00e1y t\u00ednh c\u1ee7a b\u1ea1n b\u1ecb t\u1ed5n th\u01b0\u01a1ng.\n\u00a0\nN\u1ebfu b\u1ea1n s\u1eed d\u1ee5ng nh\u1eadp Tho\u00e1t n\u00fat, T\u00ean t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n v\u00e0 m\u1eadt kh\u1ea9u \u0111\u01b0\u1ee3c th\u00f4ng l\u00e0 t\u1ed1t.",
														"Uw Google-gebruikersnaam en wachtwoord kunnen lokaal worden opgeslagen, zodat u niet hoeft in te loggen elke keer.\n\nEchter, in gedachten te houden deze waarden worden opgeslagen in platte tekst vorm en kan worden geraadpleegd als uw computer in het gedrang komt.\n\u00a0\nAls u de Log gebruiken uit-knop, worden uw gebruikersnaam en wachtwoord ook gewist.",
														"Jou Google gebruikersnaam en wagwoord kan plaaslik gestoor word, sodat jy nie nodig het om aan te meld in elke keer.\n\nHou egter in gedagte hierdie waardes word gestoor in gewone teks vorm en kan verkry word indien jou rekenaar in die gedrang kom.\n\u00a0\nAs jy die Meld uit knoppie, jou gebruikersnaam en wagwoord asook skoongemaak.",
														"\u0412\u0430\u0448\u0438\u044f\u0442 Google \u041f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u0441\u043a\u043e \u0438\u043c\u0435 \u0438 \u043f\u0430\u0440\u043e\u043b\u0430 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0441\u0435 \u0441\u044a\u0445\u0440\u0430\u043d\u044f\u0432\u0430 \u043d\u0430 \u043c\u044f\u0441\u0442\u043e, \u0442\u0430\u043a\u0430 \u0447\u0435 \u043d\u0435 \u0435 \u043d\u0443\u0436\u043d\u043e \u0434\u0430 \u0432\u043b\u0435\u0437\u0435\u0442\u0435 \u0432\u044a\u0432 \u0432\u0441\u0435\u043a\u0438 \u043c\u043e\u043c\u0435\u043d\u0442.\n\n\u0412\u0441\u0435 \u043f\u0430\u043a, \u0438\u043c\u0430\u0439\u0442\u0435 \u043f\u0440\u0435\u0434\u0432\u0438\u0434, \u0442\u0435\u0437\u0438 \u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u0438 \u0441\u0435 \u0437\u0430\u043f\u0438\u0441\u0432\u0430\u0442 \u0432 \u043e\u0431\u0438\u043a\u043d\u043e\u0432\u0435\u043d \u0442\u0435\u043a\u0441\u0442 \u0438 \u0444\u043e\u0440\u043c\u0430 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0431\u044a\u0434\u0435 \u0434\u043e\u0441\u0442\u044a\u043f\u0435\u043d, \u0430\u043a\u043e \u043a\u043e\u043c\u043f\u044e\u0442\u044a\u0440\u044a\u0442 \u0432\u0438 \u0435 \u0438\u0437\u043b\u043e\u0436\u0435\u043d\u043e \u043d\u0430 \u0440\u0438\u0441\u043a.\n\u00a0\n\u0410\u043a\u043e \u0438\u0437\u043f\u043e\u043b\u0437\u0432\u0430\u0442\u0435 \u0431\u0443\u0442\u043e\u043d\u0430 \u0418\u0437\u0445\u043e\u0434, \u0432\u0430\u0448\u0435\u0442\u043e \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u0441\u043a\u043e \u0438\u043c\u0435 \u0438 \u043f\u0430\u0440\u043e\u043b\u0430 \u0441\u0430 \u0438\u0437\u0447\u0438\u0441\u0442\u0435\u043d\u0438, \u043a\u0430\u043a\u0442\u043e \u0434\u043e\u0431\u0440\u0435.",
														"\u0412\u0430\u0448 Google \u0406\u043c\u044f \u043a\u0430\u0440\u044b\u0441\u0442\u0430\u043b\u044c\u043d\u0456\u043a\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u043c\u043e\u0433\u0443\u0446\u044c \u0431\u044b\u0446\u044c \u0437\u0430\u0445\u0430\u0432\u0430\u043d\u044b \u043b\u0430\u043a\u0430\u043b\u044c\u043d\u0430, \u0442\u0430\u043a \u0448\u0442\u043e \u0432\u0430\u043c \u043d\u0435 \u0442\u0440\u044d\u0431\u0430, \u043a\u0430\u0431 \u0443\u0432\u0430\u0439\u0441\u0446\u0456 \u045e \u043b\u044e\u0431\u044b \u0447\u0430\u0441.\n\n\u0410\u0434\u043d\u0430\u043a, \u043c\u0430\u0439\u0446\u0435 \u043d\u0430 \u045e\u0432\u0430\u0437\u0435, \u0433\u044d\u0442\u044b\u044f \u0437\u043d\u0430\u0447\u044d\u043d\u043d\u0456 \u0437\u0430\u0445\u043e\u045e\u0432\u0430\u044e\u0446\u0446\u0430 \u045e \u0432\u044b\u0433\u043b\u044f\u0434\u0437\u0435 \u043f\u0430\u0441\u043b\u044f\u0434\u043e\u045e\u043d\u0430\u0433\u0430 \u0442\u044d\u043a\u0441\u0442\u0443 \u0456 \u043c\u043e\u0433\u0443\u0446\u044c \u0431\u044b\u0446\u044c \u0434\u0430\u0441\u0442\u0443\u043f\u043d\u044b\u044f, \u043a\u0430\u043b\u0456 \u0432\u0430\u0448 \u043a\u0430\u043c\u043f\u0443\u0442\u0430\u0440 \u0437\u043d\u0430\u0445\u043e\u0434\u0437\u0456\u0446\u0446\u0430 \u043f\u0430\u0434 \u043f\u0430\u0433\u0440\u043e\u0437\u0430\u0439.\n\u00a0\n\u041a\u0430\u043b\u0456 \u0432\u044b \u0432\u044b\u043a\u0430\u0440\u044b\u0441\u0442\u043e\u045e\u0432\u0430\u0435\u0446\u0435 \u043d\u0430 \u043a\u043d\u043e\u043f\u0446\u044b \u0412\u044b\u0445\u0430\u0434, \u0412\u0430\u0448\u0430 \u0456\u043c\u044f \u043a\u0430\u0440\u044b\u0441\u0442\u0430\u043b\u044c\u043d\u0456\u043a\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u0431\u0443\u0434\u0443\u0446\u044c \u0430\u0447\u044b\u0448\u0447\u0430\u043d\u044b, \u0430 \u0442\u0430\u043a\u0441\u0430\u043c\u0430.",
														"La seva Google Nom d'usuari i Contrasenya es poden emmagatzemar de forma local, de manera que vost\u00e8 no ha d'iniciar sessi\u00f3 cada vegada.\n\nNo obstant aix\u00f2, tingui en compte aquests valors es guarden en forma de text sense format i es pot accedir si el seu equip est\u00e0 en perill.\n\u00a0\nSi utilitzeu el bot\u00f3 Desconnectar, el seu nom d'usuari i contrasenya s'esborren tamb\u00e9.",
