														"E\u011fer her zaman giri\u015f gerekmez b\u00f6ylece Google Kullan\u0131c\u0131 Ad\u0131 ve \u015eifre, yerel saklanabilir.\n\nAncak, bu de\u011ferler d\u00fcz metin bi\u00e7iminde kaydedilir ve bilgisayar\u0131n\u0131z\u0131 tehlikeye ise ula\u015f\u0131labilir ak\u0131lda tutmak.\n\u00a0\nE\u011fer d\u00fc\u011fmeye Oturum d\u0131\u015far\u0131 kullan\u0131rsan\u0131z, Kullan\u0131c\u0131 Ad\u0131 ve \u015eifre de silinir.",
														"\u0412\u0430\u0448 Google \u0406\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0456 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u043e, \u0442\u0430\u043a \u0449\u043e \u0432\u0430\u043c \u043d\u0435 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e, \u0449\u043e\u0431 \u0443\u0432\u0456\u0439\u0442\u0438 \u0432 \u0431\u0443\u0434\u044c-\u044f\u043a\u0438\u0439 \u0447\u0430\u0441.\n\n\u041e\u0434\u043d\u0430\u043a, \u043c\u0430\u0439\u0442\u0435 \u043d\u0430 \u0443\u0432\u0430\u0437\u0456, \u0446\u0456 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0443 \u0432\u0438\u0433\u043b\u044f\u0434\u0456 \u043f\u043e\u0441\u043b\u0456\u0434\u043e\u0432\u043d\u043e\u0433\u043e \u0442\u0435\u043a\u0441\u0442\u0443 \u0456 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456, \u044f\u043a\u0449\u043e \u0432\u0430\u0448 \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440 \u043f\u0435\u0440\u0435\u0431\u0443\u0432\u0430\u0454 \u043f\u0456\u0434 \u0437\u0430\u0433\u0440\u043e\u0437\u043e\u044e.\n\u00a0\n\u042f\u043a\u0449\u043e \u0432\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435 \u043d\u0430 \u043a\u043d\u043e\u043f\u0446\u0456 \u0412\u0438\u0445\u0456\u0434, \u0412\u0430\u0448\u0435 \u0456\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0442\u0430 \u043f\u0430\u0440\u043e\u043b\u044c \u0431\u0443\u0434\u0443\u0442\u044c \u043e\u0447\u0438\u0449\u0435\u043d\u0456, \u0430 \u0442\u0430\u043a\u043e\u0436.",
														"\u05d3\u05d9\u05d9\u05df Google \u05d1\u05d0\u05b7\u05e0\u05d9\u05e6\u05e2\u05e8 \u05e0\u05d0\u05b8\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05e7\u05e2\u05e0\u05e2\u05df \u05d6\u05d9\u05d9\u05df \u05e1\u05d8\u05d0\u05b8\u05e8\u05d3 \u05dc\u05d0\u05b8\u05d5\u05e7\u05d0\u05b7\u05dc\u05d9, \u05d0\u05b7\u05d6\u05d5\u05d9 \u05d0\u05b7\u05d6 \u05d0\u05d9\u05e8 \u05d8\u05d0\u05b8\u05df \u05e0\u05d9\u05d8 \u05d3\u05d0\u05b7\u05e8\u05e4\u05bf\u05df \u05e6\u05d5 \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05d9\u05df \u05d9\u05e2\u05d3\u05e2\u05e8 \u05e6\u05d9\u05d9\u05b7\u05d8.\n\n\u05d0\u05b8\u05d1\u05e2\u05e8, \u05d4\u05d0\u05b7\u05dc\u05d8\u05df \u05d0\u05d9\u05df \u05d2\u05d9\u05d9\u05b7\u05e1\u05d8 \u05d3\u05d9 \u05d5\u05d5\u05d0\u05b7\u05dc\u05d5\u05e2\u05e1 \u05d6\u05e2\u05e0\u05e2\u05df \u05d2\u05e2\u05e8\u05d0\u05d8\u05e2\u05d5\u05d5\u05e2\u05d8 \u05d0\u05d9\u05df \u05e7\u05dc\u05d0\u05b8\u05e8 \u05d8\u05e2\u05e7\u05e1\u05d8 \u05e4\u05d0\u05b8\u05e8\u05e2\u05dd \u05d0\u05d5\u05df \u05e7\u05e2\u05e0\u05e2\u05df \u05d6\u05d9\u05d9\u05df \u05d0\u05b7\u05e7\u05e1\u05e2\u05e1\u05d8 \u05d0\u05d5\u05d9\u05d1 \u05d0\u05d9\u05d9\u05e2\u05e8 \u05e7\u05d0\u05b8\u05de\u05e4\u05bc\u05d9\u05d5\u05d8\u05e2\u05e8 \u05d0\u05d9\u05d6 \u05e7\u05d0\u05b7\u05de\u05e4\u05bc\u05e8\u05d0\u05b7\u05de\u05d9\u05d9\u05d6\u05d3.\n\u00a0\n\u05d0\u05d5\u05d9\u05d1 \u05d0\u05d9\u05e8 \u05e0\u05d5\u05e6\u05df \u05d3\u05d9 \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05d5\u05d9\u05e1 \u05e7\u05e0\u05e2\u05e4\u05bc\u05dc, \u05d3\u05d9\u05d9\u05df \u05d1\u05d0\u05b7\u05e0\u05d9\u05e6\u05e2\u05e8 \u05e0\u05d0\u05b8\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05d6\u05e2\u05e0\u05e2\u05df \u05e7\u05dc\u05d9\u05e8\u05d3 \u05d5\u05d5\u05d9 \u05d2\u05e2\u05d6\u05d5\u05e0\u05d8.",
														"\u60a8\u7684\u8c37\u6b4c\u7528\u6236\u540d\u548c\u5bc6\u78bc\u53ef\u4ee5\u5728\u672c\u5730\u5b58\u5132\uff0c\u9019\u6a23\u4f60\u5c31\u4e0d\u9700\u8981\u6bcf\u6b21\u90fd\u767b\u9304\u3002\n\n\u4f46\u662f\uff0c\u8acb\u8a18\u4f4f\u9019\u4e9b\u503c\u4fdd\u5b58\u5728\u7d14\u6587\u672c\u7684\u5f62\u5f0f\uff0c\u5982\u679c\u60a8\u7684\u8a08\u7b97\u6a5f\u88ab\u653b\u7834\u53ef\u4ee5\u8a2a\u554f\u3002\n\u00a0\n\u5982\u679c\u60a8\u4f7f\u7528\u7684\u8a3b\u92b7\u6309\u9215\uff0c\u60a8\u7684\u7528\u6236\u540d\u548c\u5bc6\u78bc\u88ab\u6e05\u9664\u3002"));
