			Rows.Add( new LocalizationRow("If GoogleFu has detected that Playmaker is present in the project, it will allow you to set a Playmaker Actions path.\n\nEnabling the Playmaker Actions generation for the Object Database export will allow GoogleFu to create Playmaker Actions automatically. ",
														"Si GoogleFu a d\u00e9tect\u00e9 que le meneur de jeu est pr\u00e9sent dans le projet, il vous permettra de d\u00e9finir un chemin Playmaker Actions.\n\nActivation de la g\u00e9n\u00e9ration Playmaker Actions pour l'exportation de base de donn\u00e9es de l'objet permettra de cr\u00e9er GoogleFu Playmaker Actions automatiquement.",
														"Se GoogleFu ha rilevato che Playmaker \u00e8 presente nel progetto, vi permetter\u00e0 di impostare un percorso di Playmaker azioni.\n\nAttivazione della generazione di Playmaker Azioni per l'esportazione Object Database permetter\u00e0 GoogleFu per creare automaticamente Playmaker azioni.",
														"Wenn GoogleFu hat erkannt, dass Spielmacher im Projekt vorhanden ist, wird er Ihnen, einen Spielmacher Aktionen Weg zu bringen.\n\nAktivieren der Spielmacher Aktionen Generation f\u00fcr den Object Database Export erm\u00f6glicht GoogleFu um Spielmacher Aktionen automatisch erstellen.",
														"Si googleFU ha detectado que Playmaker est\u00e1 presente en el proyecto, que permitir\u00e1 establecer una ruta de acciones Jug\u00f3n.\n\nHabilitaci\u00f3n de la generaci\u00f3n de acciones Jug\u00f3n para la exportaci\u00f3n de objetos de base permitir\u00e1 googleFU crear Jug\u00f3n acciones autom\u00e1ticamente.",
														"\u0625\u0630\u0627 \u0643\u0634\u0641 GoogleFu \u0623\u0646 \u0635\u0627\u0646\u0639 \u0627\u0644\u0627\u0644\u0639\u0627\u0628 \u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u0645\u0634\u0631\u0648\u0639\u060c \u0648\u0633\u0648\u0641 \u062a\u0633\u0645\u062d \u0644\u0643 \u0644\u062a\u062d\u062f\u064a\u062f \u0645\u0633\u0627\u0631 \u0627\u0644\u0625\u062c\u0631\u0627\u0621\u0627\u062a \u0635\u0627\u0646\u0639 \u0627\u0644\u0627\u0644\u0639\u0627\u0628.\n\n\u0648\u062a\u0645\u0643\u064a\u0646 \u0627\u0644\u062c\u064a\u0644 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0635\u0627\u0646\u0639 \u0627\u0644\u0627\u0644\u0639\u0627\u0628 \u0644\u062a\u0635\u062f\u064a\u0631 \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0643\u0627\u0626\u0646 \u062a\u0633\u0645\u062d GoogleFu \u0644\u0625\u0646\u0634\u0627\u0621 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0635\u0627\u0646\u0639 \u0627\u0644\u0627\u0644\u0639\u0627\u0628 \u062a\u0644\u0642\u0627\u0626\u064a\u0627.",
														"GoogleFu\ub294 \ud50c\ub808\uc774 \uba54\uc774\ucee4 \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc788\ub294\uc9c0 \uac10\uc9c0\ud558\ub294 \uacbd\uc6b0\uc5d0, \ub2f9\uc2e0\uc774 \ud50c\ub808\uc774 \uba54\uc774\ucee4\uc758 \uc791\uc5c5 \uacbd\ub85c\ub97c \uc124\uc815 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\uac1d\uccb4 \ub370\uc774\ud130\ubca0\uc774\uc2a4 \uc218\ucd9c\uc758 \ud50c\ub808\uc774 \uba54\uc774\ucee4 \ub3d9\uc791 \uc0dd\uc131\uc744 \ud65c\uc131\ud654\ud558\uba74 GoogleFu\uac00 \uc790\ub3d9\uc73c\ub85c \ud50c\ub808\uc774 \uba54\uc774\ucee4 \uc791\uc5c5\uc744 \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
														"\u5982\u679cGoogleFu\u68c0\u6d4b\u5230\u4e2d\u573a\u662f\u76ee\u524d\u5728\u9879\u76ee\u4e2d\uff0c\u5b83\u53ef\u4ee5\u8ba9\u4f60\u8bbe\u7f6e\u4e00\u4e2a\u4e2d\u573a\u64cd\u4f5c\u8def\u5f84\u3002\n\n\u542f\u7528\u4e2d\u573a\u64cd\u4f5c\u751f\u6210\u7684\u5bf9\u8c61\u6570\u636e\u5e93\u5bfc\u51fa\u5c06\u4f7fGoogleFu\u81ea\u52a8\u521b\u5efa\u7b56\u52a8\u8fdb\u653b\u884c\u52a8\u3002",
														"GoogleFu\u306f\u53f8\u4ee4\u5854\u306f\u3001\u30d7\u30ed\u30b8\u30a7\u30af\u30c8\u5185\u306b\u5b58\u5728\u3059\u308b\u3053\u3068\u3092\u691c\u51fa\u3057\u305f\u5834\u5408\u3001\u305d\u308c\u306f\u3042\u306a\u305f\u304c\u53f8\u4ee4\u5854\u30a2\u30af\u30b7\u30e7\u30f3\u30d1\u30b9\u3092\u8a2d\u5b9a\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\n\n\u30aa\u30d6\u30b8\u30a7\u30af\u30c8\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u306e\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u7528\u306e\u53f8\u4ee4\u5854\u30a2\u30af\u30b7\u30e7\u30f3\u306e\u767a\u751f\u3092\u6709\u52b9\u306b\u3059\u308b\u3068\u3001GoogleFu\u304c\u81ea\u52d5\u7684\u306b\u53f8\u4ee4\u5854\u306e\u30a2\u30af\u30b7\u30e7\u30f3\u3092\u4f5c\u6210\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002",
														"\u0415\u0441\u043b\u0438 GoogleFu \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0438\u043b, \u0447\u0442\u043e \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0432 \u043f\u0440\u043e\u0435\u043a\u0442\u0435, \u044d\u0442\u043e \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442 \u0432\u0430\u043c \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u0443\u0442\u044c.\n\n\u0412\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u0435 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430 \u0431\u0430\u0437\u044b \u0434\u0430\u043d\u043d\u044b\u0445 \u043e\u0431\u044a\u0435\u043a\u0442\u043e\u0432 \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442 GoogleFu \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438.",
														"N\u1ebfu GoogleFu \u0111\u00e3 ph\u00e1t hi\u1ec7n ra r\u1eb1ng Playmaker c\u00f3 m\u1eb7t trong d\u1ef1 \u00e1n, n\u00f3 s\u1ebd cho ph\u00e9p b\u1ea1n thi\u1ebft l\u1eadp m\u1ed9t con \u0111\u01b0\u1eddng Playmaker Actions.\n\nT\u1ea1o \u0111i\u1ec1u ki\u1ec7n cho th\u1ebf h\u1ec7 Playmaker h\u00e0nh \u0111\u1ed9ng cho c\u00e1c \u0111\u1ed1i t\u01b0\u1ee3ng xu\u1ea5t kh\u1ea9u c\u01a1 s\u1edf d\u1eef li\u1ec7u s\u1ebd cho ph\u00e9p GoogleFu \u0111\u1ec3 t\u1ea1o ra Playmaker Actions t\u1ef1 \u0111\u1ed9ng.",
														"Als googleFU heeft gedetecteerd dat spelmaker aanwezig is in het project is, zal het u toestaan \u200b\u200bom een \u200b\u200bspelmaker Acties pad te zetten.\n\nHet inschakelen van de spelmaker Acties generatie voor de Object Database export zal googleFU om spelmaker Acties automatisch cre\u00ebren.",
														"As GoogleFu het ontdek dat Play Maker teenwoordig is in die projek, sal dit jou toelaat om 'n Play Maker aksies pad te stel.\n\nSodat die Play Maker aksies generasie vir 'n voorwerp databasis uitvoer sal toelaat GoogleFu Play Maker aksies outomaties skep.",
														"\u0410\u043a\u043e GoogleFu \u043e\u0442\u043a\u0440\u0438, \u0447\u0435 \u041f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440\u044a\u0442 \u043f\u0440\u0438\u0441\u044a\u0441\u0442\u0432\u0430 \u0432 \u043f\u0440\u043e\u0435\u043a\u0442\u0430, \u0442\u044f \u0449\u0435 \u0432\u0438 \u043f\u043e\u0437\u0432\u043e\u043b\u0438 \u0434\u0430 \u0441\u0435 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438 \u043f\u044a\u0442\u044f \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440 Actions.\n\n\u0420\u0430\u0437\u0440\u0435\u0448\u0430\u0432\u0430\u043d\u0435\u0442\u043e \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u0435 \u041f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440\u044a\u0442 \u0414\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0437\u0430 \u0438\u0437\u043d\u043e\u0441\u0430 \u043d\u0430 \u043e\u0431\u0435\u043a\u0442 \u043d\u0430 \u0431\u0430\u0437\u0430 \u0434\u0430\u043d\u043d\u0438 \u0449\u0435 \u043f\u043e\u0437\u0432\u043e\u043b\u0438 \u0434\u0430 \u0441\u0435 \u0441\u044a\u0437\u0434\u0430\u0434\u0435 GoogleFu \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440 \u0414\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e.",
														"\u041a\u0430\u043b\u0456 GoogleFu \u0432\u044b\u044f\u0432\u0456\u045e, \u0448\u0442\u043e \u043f\u043b\u044d\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u043f\u0440\u044b\u0441\u0443\u0442\u043d\u0456\u0447\u0430\u0435 \u045e \u043f\u0440\u0430\u0435\u043a\u0446\u0435, \u0433\u044d\u0442\u0430 \u0434\u0430\u0437\u0432\u043e\u043b\u0456\u0446\u044c \u0432\u0430\u043c \u0443\u0441\u0442\u0430\u043b\u044f\u0432\u0430\u0446\u044c \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440\u0430 \u0434\u0437\u0435\u044f\u043d\u043d\u0456 \u0448\u043b\u044f\u0445.\n\n\u040e\u043a\u043b\u044e\u0447\u044d\u043d\u043d\u0435 \u043f\u0430\u043a\u0430\u043b\u0435\u043d\u043d\u0435 \u043f\u043b\u044d\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u0437\u0435\u044f\u043d\u043d\u0456 \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443 \u0431\u0430\u0437\u044b \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445 \u0430\u0431'\u0435\u043a\u0442\u0430\u045e \u0434\u0430\u0441\u0446\u044c \u043c\u0430\u0433\u0447\u044b\u043c\u0430\u0441\u0446\u044c GoogleFu \u0441\u0442\u0432\u0430\u0440\u044b\u0446\u044c \u043f\u043b\u044d\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u0437\u0435\u044f\u043d\u043d\u0456 \u0430\u045e\u0442\u0430\u043c\u0430\u0442\u044b\u0447\u043d\u0430.",
