														"Za\u010diarknut\u00edm tohto pol\u00ed\u010dka, u\u017e\u00edvate\u013esk\u00e9 meno a heslo s\u00fa ulo\u017een\u00e9 a automaticky na\u010d\u00edta\u0165, ak je GoogleFu otvoren\u00fd.\n\nBezpe\u010dnostn\u00e9 riziko - u\u017e\u00edvate\u013esk\u00e9 meno a heslo s\u00fa ulo\u017een\u00e9 v registri vo form\u00e1te oby\u010dajn\u00e9ho textu. Pou\u017e\u00edvajte iba t\u00fato mo\u017enos\u0165, ak ste spokojn\u00ed s t\u00fdm.",
														"S potrditvijo tega polja, so uporabni\u0161ko ime in geslo shrani in samodejno nalo\u017ei, ko se GoogleFu ponovno odprta.\n\nVarnostno tveganje - ime in geslo so shranjeni v registru, v golega besedila. Uporabite to mo\u017enost samo, \u010de ste zadovoljni s tem.",
														"Duke kontrolluar k\u00ebt\u00eb kuti, Emri perdoruesit dhe jan\u00eb ruajtur dhe automatikisht shikohet kur GoogleFu \u00ebsht\u00eb rihapur.\n\nRREZIKU SIGURIA - Emri perdoruesit dhe jan\u00eb t\u00eb depozituara n\u00eb regjist\u00ebr n\u00eb format t\u00eb thjesht\u00eb teksti. Vet\u00ebm t\u00eb p\u00ebrdorni k\u00ebt\u00eb opsion, n\u00ebse ju jeni t\u00eb k\u00ebnaqur me k\u00ebt\u00eb.",
														"\u041f\u043e\u0442\u0432\u0440\u0434\u043e\u043c \u043e\u0432\u043e\u043c \u043f\u043e\u0459\u0443, \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0430 \u0441\u0435 \u0441\u043a\u043b\u0430\u0434\u0438\u0448\u0442\u0438 \u0438 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u043f\u0440\u0435\u0443\u0437\u0438\u043c\u0430\u0458\u0443 \u043a\u0430\u0434\u0430 \u0458\u0435 \u043f\u043e\u043d\u043e\u0432\u043e \u043e\u0442\u0432\u043e\u0440\u0435\u043d \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443.\n\n\u0411\u0435\u0437\u0431\u0435\u0434\u043d\u043e\u0441\u043d\u0438 \u0440\u0438\u0437\u0438\u043a - \u041a\u043e\u0440\u0438\u0441\u043d\u0438\u0447\u043a\u043e \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0430 \u0441\u0443 \u0443\u043f\u0438\u0441\u0430\u043d\u0438 \u0443 \u0440\u0435\u0433\u0438\u0441\u0442\u0430\u0440 \u0443 \u043e\u0431\u0438\u0447\u0430\u043d \u0442\u0435\u043a\u0441\u0442 \u0444\u043e\u0440\u043c\u0430\u0442\u0443. \u041a\u043e\u0440\u0438\u0441\u0442\u0438\u0442\u0435 \u0441\u0430\u043c\u043e \u043e\u0432\u0443 \u043e\u043f\u0446\u0438\u0458\u0443 \u0430\u043a\u043e \u0441\u0442\u0435 \u0437\u0430\u0434\u043e\u0432\u043e\u0459\u043d\u0438 \u043e\u0432\u0438\u043c.",
														"Genom att kryssa i denna ruta, \u00e4r det anv\u00e4ndarnamn och l\u00f6senord lagras och h\u00e4mtas automatiskt n\u00e4r GoogleFu \u00f6ppnas p\u00e5 nytt.\n\nS\u00c4KERHET RISK - Det anv\u00e4ndarnamn och l\u00f6senord lagras i registret i oformaterad text. Anv\u00e4nd bara det h\u00e4r alternativet om du \u00e4r bekv\u00e4m med det h\u00e4r.",
														"By kuangalia sanduku hili, username na password ni kuhifadhiwa na moja kwa moja Rudishwa wakati GoogleFu ni ilifunguliwa.\n\nHatari ya usalama - username na password ni kuhifadhiwa katika usajili katika PLAIN TEXT format. Kutumia tu fursa hii kama wewe ni starehe na hili.",
														"\u0e42\u0e14\u0e22\u0e01\u0e32\u0e23\u0e15\u0e23\u0e27\u0e08\u0e2a\u0e2d\u0e1a\u0e01\u0e25\u0e48\u0e2d\u0e07\u0e19\u0e35\u0e49\u0e0a\u0e37\u0e48\u0e2d\u0e1c\u0e39\u0e49\u0e43\u0e0a\u0e49\u0e41\u0e25\u0e30\u0e23\u0e2b\u0e31\u0e2a\u0e1c\u0e48\u0e32\u0e19\u0e08\u0e30\u0e16\u0e39\u0e01\u0e40\u0e01\u0e47\u0e1a\u0e44\u0e27\u0e49\u0e41\u0e25\u0e30\u0e08\u0e30\u0e40\u0e23\u0e35\u0e22\u0e01\u0e40\u0e21\u0e37\u0e48\u0e2d GoogleFu \u0e16\u0e39\u0e01\u0e40\u0e1b\u0e34\u0e14\n\n\u0e40\u0e2a\u0e35\u0e48\u0e22\u0e07\u0e15\u0e48\u0e2d\u0e04\u0e27\u0e32\u0e21\u0e1b\u0e25\u0e2d\u0e14\u0e20\u0e31\u0e22 - \u0e0a\u0e37\u0e48\u0e2d\u0e1c\u0e39\u0e49\u0e43\u0e0a\u0e49\u0e41\u0e25\u0e30\u0e23\u0e2b\u0e31\u0e2a\u0e1c\u0e48\u0e32\u0e19\u0e17\u0e35\u0e48\u0e16\u0e39\u0e01\u0e40\u0e01\u0e47\u0e1a\u0e44\u0e27\u0e49\u0e43\u0e19\u0e23\u0e35\u0e08\u0e34\u0e2a\u0e17\u0e23\u0e35\u0e43\u0e19\u0e23\u0e39\u0e1b\u0e41\u0e1a\u0e1a\u0e02\u0e49\u0e2d\u0e04\u0e27\u0e32\u0e21\u0e18\u0e23\u0e23\u0e21\u0e14\u0e32 \u0e40\u0e1e\u0e35\u0e22\u0e07 \u0e41\u0e15\u0e48\u0e43\u0e0a\u0e49\u0e15\u0e31\u0e27\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e19\u0e35\u0e49\u0e16\u0e49\u0e32\u0e04\u0e38\u0e13\u0e21\u0e35\u0e04\u0e27\u0e32\u0e21\u0e2a\u0e30\u0e14\u0e27\u0e01\u0e2a\u0e1a\u0e32\u0e22\u0e14\u0e49\u0e27\u0e22",
														"Sa pamamagitan ng pagsuri sa kahon na ito, ang username at password ay naka-imbak at awtomatikong nabawi kapag GoogleFu ay muling bubuksan.\n\nSEGURIDAD PELIGRO - Ang username at password ay naka-imbak sa registry sa simpleng format TEXT. Gamitin lamang ang pagpipiliang ito kung ikaw ay komportable na ito.",
														"Bu kutuyu i\u015faretleyerek, Kullan\u0131c\u0131 Ad\u0131 ve \u015eifre kaydedilmi\u015f ve otomatik olarak GoogleFu a\u00e7\u0131ld\u0131\u011f\u0131nda al\u0131n\u0131r.\n\nG\u00dcVENL\u0130K R\u0130SK\u0130 - Kullan\u0131c\u0131 ad\u0131 ve \u015fifre d\u00fcz metin format\u0131nda kay\u0131t defterinde saklan\u0131r. Bu rahat, yaln\u0131zca bu se\u00e7ene\u011fi kullan\u0131n.",
														"\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0438 \u0446\u0435\u0439 \u043f\u0440\u0430\u043f\u043e\u0440\u0435\u0446\u044c, \u0406\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0456 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0443\u044e\u0442\u044c\u0441\u044f \u043f\u0440\u0438 GoogleFu \u0431\u0443\u0434\u0435 \u0437\u043d\u043e\u0432\u0443 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0438\u0439.\n\n\u0417\u0430\u0433\u0440\u043e\u0437\u0430 \u0431\u0435\u0437\u043f\u0435\u043a\u0438 - \u0406\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0432 \u0440\u0435\u0454\u0441\u0442\u0440\u0456 \u043d\u0430 \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442. \u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0446\u044e \u043e\u043f\u0446\u0456\u044e \u0442\u0456\u043b\u044c\u043a\u0438 \u044f\u043a\u0449\u043e \u0432\u0438 \u0437\u043d\u0430\u0439\u043e\u043c\u0456 \u0437 \u0446\u0438\u043c.",
														"\u05d3\u05d5\u05e8\u05da \u05e7\u05d0\u05b8\u05e0\u05d8\u05e8\u05d0\u05b8\u05dc\u05d9\u05e8\u05d5\u05e0\u05d2 \u05d3\u05e2\u05dd \u05e7\u05e2\u05e1\u05d8\u05dc, \u05d3\u05d9 \u05e0\u05d0\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05d6\u05e2\u05e0\u05e2\u05df \u05e1\u05d8\u05d0\u05b8\u05e8\u05d3 \u05d0\u05d5\u05df \u05d0\u05d5\u05d9\u05d8\u05d0\u05b8\u05de\u05d0\u05b7\u05d8\u05d9\u05e9 \u05e8\u05d9\u05d8\u05e8\u05d9\u05d5\u05d5\u05d3 \u05d5\u05d5\u05e2\u05df \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d0\u05d9\u05d6 \u05e8\u05d9\u05d0\u05b8\u05d5\u05e4\u05bc\u05d0\u05b7\u05e0\u05d3.\n\n\u05d6\u05d9\u05db\u05e2\u05e8\u05d4\u05d9\u05d9\u05b7\u05d8 \u05e8\u05d9\u05d6\u05d9\u05e7\u05d9\u05e8\u05df - \u05d3\u05d9 \u05e0\u05d0\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05d6\u05e2\u05e0\u05e2\u05df \u05e1\u05d8\u05d0\u05b8\u05e8\u05d3 \u05d0\u05d9\u05df \u05d3\u05d9 \u05e8\u05e2\u05d2\u05d9\u05e1\u05d8\u05e8\u05d9 \u05d0\u05d9\u05df \u05e7\u05dc\u05d0\u05b8\u05e8 \u05d8\u05e2\u05e7\u05e1\u05d8 \u05e4\u05bf\u05d0\u05b8\u05e8\u05de\u05d0\u05b7\u05d8. \u05d1\u05dc\u05d5\u05d9\u05d6 \u05e0\u05d5\u05e6\u05df \u05d3\u05e2\u05dd \u05d0\u05b8\u05e4\u05bc\u05e6\u05d9\u05e2 \u05d0\u05d5\u05d9\u05d1 \u05d0\u05d9\u05e8 \u05d6\u05e2\u05e0\u05e2\u05df \u05d1\u05d0\u05b7\u05e7\u05d5\u05d5\u05e2\u05dd \u05de\u05d9\u05d8 \u05d3\u05e2\u05dd.",
														"\u9078\u4e2d\u6b64\u6846\uff0c\u7528\u6236\u540d\u548c\u5bc6\u78bc\u9032\u884c\u5b58\u5132\u548c\u81ea\u52d5\u7576GoogleFu\u91cd\u65b0\u6253\u958b\u6aa2\u7d22\u3002\n\n\u5b89\u5168\u98a8\u96aa - \u7528\u6236\u540d\u548c\u5bc6\u78bc\u5b58\u5132\u5728\u8a3b\u518a\u8868\u4e2d\u4ee5\u7d14\u6587\u672c\u683c\u5f0f\u3002\u53ea\u6709\u7576\u60a8\u719f\u6089\u9019\u500b\u4f7f\u7528\u9019\u500b\u9078\u9805\u3002"));
			Rows.Add( new LocalizationRow("By checking this box, GoogleFu will automatically attempt to log in to the account when it opens. Understand that the login process blocks all functionality until it is complete, so it may seem to freeze Unity while logging in, and make starting up slower.  ",
														"En cochant cette case, GoogleFu tentera automatiquement de se connecter au compte quand il s'ouvre. Comprendre que les blocs de processus de connexion tout de fonctionnalit\u00e9 jusqu'\u00e0 ce qu'il soit complet, il peut sembler \u00e0 geler l'unit\u00e9 lors de la connexion, et faire partir plus lentement.",
														"Selezionando questa casella, GoogleFu tenter\u00e0 automaticamente di accedere al conto quando si apre. Capire che i blocchi del processo di login tutte le funzionalit\u00e0 finch\u00e9 non \u00e8 completo, quindi pu\u00f2 sembrare di congelare l'Unit\u00e0, mentre il login, e rendere l'avvio pi\u00f9 lento.",
														"Wenn dieses Feld markiert, werden GoogleFu automatisch versuchen, sich in dem Konto an, wenn sie sich \u00f6ffnet. Verstehen Sie, dass die Login-Prozess blockiert alle Funktionen, bis er abgeschlossen ist, so mag es scheinen, zur Einheit einfrieren w\u00e4hrend der Anmeldung und machen Inbetriebnahme langsamer.",
														"Al marcar esta casilla, googleFU autom\u00e1ticamente intentar\u00e1 iniciar sesi\u00f3n en la cuenta cuando se abre. Entender que los bloques de proceso de inicio de sesi\u00f3n Todas las funciones hasta que se haya completado, por lo que puede parecer a congelar la Unidad durante el registro en, y hacer la puesta en marcha m\u00e1s lenta.",
														"\u0639\u0646 \u0637\u0631\u064a\u0642 \u0641\u062d\u0635 \u0647\u0630\u0627 \u0627\u0644\u0625\u0637\u0627\u0631\u060c \u0633\u0648\u0641 GoogleFu \u0645\u062d\u0627\u0648\u0644\u0629 \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0644\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u062d\u0633\u0627\u0628 \u0639\u0646\u062f \u0641\u062a\u062d\u0647. \u0646\u0641\u0647\u0645 \u0623\u0646 \u0643\u062a\u0644 \u0639\u0645\u0644\u064a\u0629 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0639\u0646 \u0648\u0638\u064a\u0641\u0629 \u062d\u062a\u0649 \u0627\u0643\u062a\u0645\u0627\u0644\u060c \u0644\u0630\u0644\u0643 \u0642\u062f \u064a\u0628\u062f\u0648 \u0644\u062a\u062c\u0645\u064a\u062f \u0627\u0644\u0648\u062d\u062f\u0629 \u0623\u062b\u0646\u0627\u0621 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644\u060c \u0648\u062c\u0639\u0644 \u0628\u062f\u0621 \u0623\u0628\u0637\u0623.",
														"\uc774 \uc0c1\uc790\ub97c \uc120\ud0dd\ud558\uc5ec, GoogleFu \uc790\ub3d9\uc73c\ub85c \uc5f4 \ub54c \uacc4\uc815\uc73c\ub85c \ub85c\uadf8\uc778\uc744 \uc2dc\ub3c4\ud569\ub2c8\ub2e4. \ub85c\uadf8\uc778 \ud504\ub85c\uc138\uc2a4\ub97c \ubaa8\ub450 \ucc28\ub2e8 \uae30\ub2a5\uc774 \uc644\ub8cc, \uadf8\ub798\uc11c\uc5d0 \ub85c\uadf8\uc778 \ud560 \ub54c \uc720\ub2c8\ud2f0\ub97c \ub3d9\uacb0\ud558\ub294 \uac83, \ub290\ub9b0 \uc2dc\uc791 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4 \ub54c\uae4c\uc9c0 \uc774\ud574\ud569\ub2c8\ub2e4.",
														"\u52fe\u9009\u6b64\u65b9\u5757\uff0cGoogleFu\u4f1a\u81ea\u52a8\u5c1d\u8bd5\u5728\u5b83\u6253\u5f00\u65f6\u767b\u5f55\u5230\u8be5\u5e10\u6237\u3002\u8bb0\u8005\u4e86\u89e3\u5230\uff0c\u5728\u767b\u5f55\u8fc7\u7a0b\u4e2d\u963b\u6b62\u6240\u6709\u529f\u80fd\uff0c\u76f4\u5230\u5b83\u662f\u5b8c\u6574\u7684\uff0c\u6240\u4ee5\u5b83\u53ef\u80fd\u4f3c\u4e4e\u51bb\u7ed3\u5728\u7edf\u4e00\u767b\u5f55\uff0c\u5e76\u8fdb\u884c\u6162\u542f\u52a8\u3002",
														"\u3053\u306e\u30dc\u30c3\u30af\u30b9\u3092\u30c1\u30a7\u30c3\u30af\u3059\u308b\u3053\u3068\u306b\u3088\u308a\u3001GoogleFu\u304c\u81ea\u52d5\u7684\u306b\u958b\u3044\u305f\u3068\u304d\u306e\u30a2\u30ab\u30a6\u30f3\u30c8\u306b\u30ed\u30b0\u30a4\u30f3\u3057\u3088\u3046\u3068\u3057\u307e\u3059\u3002\u305d\u308c\u306f\u30ed\u30b0\u30a4\u30f3\u6642Unity\u3092\u51cd\u7d50\u3059\u308b\u3088\u3046\u306b\u898b\u3048\u308b\u3001\u3068\u9045\u304f\u3001\u8d77\u52d5\u3059\u308b\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u306e\u3067\u3001\u305d\u308c\u304c\u5b8c\u4e86\u3059\u308b\u307e\u3067\u3001\u30ed\u30b0\u30a4\u30f3\u30d7\u30ed\u30bb\u30b9\u3092\u30d6\u30ed\u30c3\u30af\u3059\u308b\u3059\u3079\u3066\u306e\u6a5f\u80fd\u3092\u7406\u89e3\u3057\u3066\u3044\u307e\u3059\u3002",
														"\u0423\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432 \u044d\u0442\u043e\u0442 \u0444\u043b\u0430\u0436\u043e\u043a, GoogleFu \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u043f\u043e\u043f\u044b\u0442\u0430\u0435\u0442\u0441\u044f \u0432\u043e\u0439\u0442\u0438 \u043d\u0430 \u0441\u0447\u0435\u0442, \u043a\u043e\u0433\u0434\u0430 \u043e\u043d \u043e\u0442\u043a\u0440\u043e\u0435\u0442\u0441\u044f. \u041f\u043e\u0439\u043c\u0438\u0442\u0435, \u0447\u0442\u043e \u043d\u0435 \u043d\u0430 \u0412\u043e\u0439\u0442\u0438 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430 \u0431\u043b\u043e\u043a\u0438 \u0432\u0441\u0435 \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0435, \u043f\u043e\u043a\u0430 \u043e\u043d\u0430 \u0431\u0443\u0434\u0435\u0442 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0430, \u0442\u0430\u043a \u0447\u0442\u043e \u043c\u043e\u0436\u0435\u0442 \u043f\u043e\u043a\u0430\u0437\u0430\u0442\u044c\u0441\u044f, \u0447\u0442\u043e\u0431\u044b \u0437\u0430\u043c\u043e\u0440\u043e\u0437\u0438\u0442\u044c \u0415\u0434\u0438\u043d\u0441\u0442\u0432\u043e \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0432\u0445\u043e\u0434\u0430 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443, \u0438 \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0437\u0430\u043f\u0443\u0441\u043a\u0430 \u043c\u0435\u0434\u043b\u0435\u043d\u043d\u0435\u0435.",
														"B\u1eb1ng c\u00e1ch ki\u1ec3m tra h\u1ed9p n\u00e0y, GoogleFu s\u1ebd t\u1ef1 \u0111\u1ed9ng c\u1ed1 g\u1eafng \u0111\u1ec3 \u0111\u0103ng nh\u1eadp v\u00e0o t\u00e0i kho\u1ea3n khi m\u1edf ra. Hi\u1ec3u r\u1eb1ng c\u00e1c kh\u1ed1i qu\u00e1 tr\u00ecnh \u0111\u0103ng nh\u1eadp t\u1ea5t c\u1ea3 c\u00e1c ch\u1ee9c n\u0103ng cho \u0111\u1ebfn khi n\u00f3 \u0111\u01b0\u1ee3c ho\u00e0n th\u00e0nh, do \u0111\u00f3, n\u00f3 c\u00f3 th\u1ec3 d\u01b0\u1eddng nh\u01b0 \u0111\u00f3ng b\u0103ng Unity trong khi \u0111\u0103ng nh\u1eadp, v\u00e0 l\u00e0m cho kh\u1edfi \u0111\u1ed9ng ch\u1eadm h\u01a1n.",
														"Door het aanvinken van dit vakje, zal googleFU automatisch proberen in te loggen op de rekening wanneer het wordt geopend. Begrijp dat het login proces blokkeert alle functionaliteit tot deze is voltooid, dus het lijkt misschien Unity bevriezen tijdens het inloggen, en maakt het opstarten langzamer.",
														"Deur die nagaan van die boks, GoogleFu sal outomaties probeer om aan te meld by die rekening wanneer dit oopmaak. Verstaan \u200b\u200bdat die aanmelding proses blokke al die funksies totdat dit voltooi is, so dit mag lyk Unity te vries terwyl aan te meld, en maak die oprigting van stadiger.",
														"\u0427\u0440\u0435\u0437 \u043f\u0440\u043e\u0432\u0435\u0440\u043a\u0430 \u043d\u0430 \u0442\u043e\u0432\u0430 \u043f\u043e\u043b\u0435, GoogleFu \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0449\u0435 \u0441\u0435 \u043e\u043f\u0438\u0442\u0430 \u0434\u0430 \u0432\u043b\u0435\u0437\u0435\u0442\u0435 \u0432 \u0441\u043c\u0435\u0442\u043a\u0430\u0442\u0430, \u043a\u043e\u0433\u0430\u0442\u043e \u0442\u044f \u0441\u0435 \u043e\u0442\u0432\u0430\u0440\u044f. \u0420\u0430\u0437\u0431\u0435\u0440\u0435\u0442\u0435, \u0447\u0435 \u043d\u0430 \u043f\u0440\u043e\u0446\u0435\u0441\u0430 \u0432\u0445\u043e\u0434 \u0431\u043b\u043e\u043a\u0438\u0440\u0430 \u0446\u044f\u043b\u0430\u0442\u0430 \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u043d\u043e\u0441\u0442, \u0434\u043e\u043a\u0430\u0442\u043e \u0442\u044f \u0435 \u043f\u044a\u043b\u043d\u0430, \u0442\u0430\u043a\u0430 \u0447\u0435 \u0442\u044f \u043c\u043e\u0436\u0435 \u0434\u0430 \u0438\u0437\u0433\u043b\u0435\u0436\u0434\u0430 \u0434\u0430 \u0441\u0435 \u0437\u0430\u043c\u0440\u0430\u0437\u044f\u0432\u0430, \u0434\u043e\u043a\u0430\u0442\u043e Unity \u0432\u043b\u0438\u0437\u0430\u043d\u0435 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0430\u0442\u0430, \u0438 \u0434\u0430 \u0437\u0430\u043f\u043e\u0447\u043d\u0435 \u0434\u043e \u043f\u043e-\u0431\u0430\u0432\u043d\u043e.",
														"\u0423\u0441\u0442\u0430\u043b\u044f\u0432\u0430\u045e\u0448\u044b \u0433\u044d\u0442\u044b \u0441\u0446\u044f\u0436\u043e\u043a, GoogleFu \u0430\u045e\u0442\u0430\u043c\u0430\u0442\u044b\u0447\u043d\u0430 \u043f\u0430\u0441\u043f\u0440\u0430\u0431\u0443\u0435 \u045e\u0432\u0430\u0439\u0441\u0446\u0456 \u043d\u0430 \u0440\u0430\u0445\u0443\u043d\u0430\u043a, \u043a\u0430\u043b\u0456 \u0451\u043d \u0430\u0434\u043a\u0440\u044b\u0435\u0446\u0446\u0430. \u0417\u0440\u0430\u0437\u0443\u043c\u0435\u0439\u0446\u0435, \u0448\u0442\u043e \u043d\u0435 \u043d\u0430 \u0423\u0432\u0430\u0439\u0441\u0446\u0456 \u043f\u0440\u0430\u0446\u044d\u0441\u0443 \u0431\u043b\u043e\u043a\u0456 \u0443\u0441\u0435 \u0444\u0443\u043d\u043a\u0446\u044b\u044f\u043d\u0430\u043b\u044c\u043d\u044b\u044f, \u043f\u0430\u043a\u0443\u043b\u044c \u044f\u043d\u0430 \u0431\u0443\u0434\u0437\u0435 \u0437\u0430\u0432\u0435\u0440\u0448\u0430\u043d\u0430, \u0442\u0430\u043a \u0448\u0442\u043e \u043c\u043e\u0436\u0430 \u0437\u0434\u0430\u0446\u0446\u0430, \u043a\u0430\u0431 \u0437\u0430\u043c\u0430\u0440\u043e\u0437\u0456\u0446\u044c \u0410\u0434\u0437\u0456\u043d\u0441\u0442\u0432\u0430 \u043f\u0430\u0434\u0447\u0430\u0441 \u045e\u0432\u0430\u0445\u043e\u0434\u0443 \u045e \u0441\u0456\u0441\u0442\u044d\u043c\u0443, \u0456 \u0437\u0440\u0430\u0431\u0456\u0446\u044c \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0431\u043e\u043b\u044c\u0448 \u043f\u0430\u0432\u043e\u043b\u044c\u043d\u0430.",
														"En marcar aquesta casella, googleFU autom\u00e0ticament intentar\u00e0 iniciar sessi\u00f3 al compte quan s'obre. Entendre que els blocs de proc\u00e9s d'inici de sessi\u00f3 Totes les funcions fins que s'hagi completat, pel que pot semblar a congelar la Unitat durant el registre en, i fer la posada en marxa m\u00e9s lenta.",
														"Za\u0161krtnut\u00edm tohoto pol\u00ed\u010dka, bude GoogleFu automaticky pokus\u00ed p\u0159ihl\u00e1sit k \u00fa\u010dtu, kdy\u017e se otev\u0159e. Pochopte, \u017ee proces p\u0159ihl\u00e1\u0161en\u00ed bloky v\u0161echny funkce, dokud nen\u00ed dokon\u010dena, tak\u017ee se m\u016f\u017ee zd\u00e1t, \u017ee zmrazit jednotu p\u0159i p\u0159ihl\u00e1\u0161en\u00ed, a aby spu\u0161t\u011bn\u00ed pomalej\u0161\u00ed.",
														"Drwy ddarllen y blwch hwn, bydd GoogleFu ceisio yn awtomatig i logio i mewn i'r cyfrif pan fydd yn agor. Deall bod y broses mewngofnodi blociau holl ymarferoldeb nes ei fod yn gyflawn, felly y mae'n ymddangos i rewi Undod wrth logio i mewn, ac yn gwneud dechrau arafach.",
														"Selle kasti, GoogleFu automaatselt \u00fcritavad sisse v\u00f5tta, kui see avaneb. Aru, et login protsessi blokeerib k\u00f5ik funktsioonid, kuni see on valmis, nii et see v\u00f5ib tunduda k\u00fclmutada Unity sisselogimisel ja teeb k\u00e4ivitamise aeglasemaks.",
														"\u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0646 \u0627\u06cc\u0646 \u06af\u0632\u06cc\u0646\u0647\u060c GoogleFu \u0628\u0647 \u0637\u0648\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631 \u0628\u0647 \u0633\u06cc\u0633\u062a\u0645 \u0648\u0627\u0631\u062f \u0634\u0648\u06cc\u062f \u0628\u0647 \u062d\u0633\u0627\u0628 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0622\u0646 \u0631\u0627 \u0628\u0627\u0632 \u0645\u06cc \u06a9\u0646\u062f \u062a\u0644\u0627\u0634. \u0628\u062f\u0627\u0646\u06cc\u062f \u06a9\u0647 \u0628\u0644\u0648\u06a9 \u0647\u0627\u06cc \u0641\u0631\u0622\u06cc\u0646\u062f \u0648\u0631\u0648\u062f \u062a\u0645\u0627\u0645 \u0642\u0627\u0628\u0644\u06cc\u062a \u0647\u0627 \u062a\u0627 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u06a9\u0627\u0645\u0644 \u0627\u0633\u062a\u060c \u067e\u0633 \u0627\u0632 \u0622\u0646 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc \u0631\u0633\u062f \u0628\u0647 \u0645\u0633\u062f\u0648\u062f \u0648\u062d\u062f\u062a \u062f\u0631 \u062d\u0627\u0644\u06cc \u06a9\u0647 \u0648\u0631\u0648\u062f \u0648 \u062e\u0631\u0648\u062c \u06a9\u0627\u0631\u0645\u0646\u062f\u0627\u0646\u060c \u0648 \u0634\u0631\u0648\u0639 \u06a9\u0646\u062f\u062a\u0631 \u0627\u0633\u062a.",
														"T\u00e4m\u00e4n ruudun, GoogleFu yritt\u00e4\u00e4 automaattisesti kirjautua tilille, kun se avautuu. Ymm\u00e4rr\u00e4, ett\u00e4 sis\u00e4\u00e4nkirjautumista est\u00e4\u00e4 kaikki toiminnot, kunnes se on valmis, niin se voi tuntua j\u00e4\u00e4dytt\u00e4\u00e4 Unity taas kirjautumalla sis\u00e4\u00e4n ja tee k\u00e4ynnistym\u00e4ss\u00e4 hitaammin.",
														"Tr\u00ed seice\u00e1il sa bhosca seo, beidh GoogleFu iarracht go huathoibr\u00edoch chun log\u00e1il isteach leis an gcuntas nuair a oscla\u00edonn s\u00e9. A thuiscint go bhfuil na bloic pr\u00f3iseas log\u00e1la gach feidhmi\u00falacht dt\u00ed go bhfuil s\u00e9 cr\u00edochnaithe, mar sin d'fh\u00e9adfadh s\u00e9 cos\u00fail a Gn\u00edomhacha Aontacht fad log\u00e1il isteach, agus a dh\u00e9anamh ag tos\u00fa suas n\u00edos moille.",
														"Marcando esta caixa, GoogleFu tentar\u00e1 automaticamente entrar \u00e1 conta cando se abre. Entender que os bloques do proceso de inicio de sesi\u00f3n toda funci\u00f3n ata que estea completa, polo que pode parecer conxelar Unity mentres a sesi\u00f3n, e facer o arranque m\u00e1is lento.",
														"\u0907\u0938 \u092c\u0949\u0915\u094d\u0938 \u0915\u094b \u091a\u0947\u0915 \u0915\u0930\u0915\u0947, GoogleFu \u092f\u0939 \u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0930\u0942\u092a \u0938\u0947 \u0916\u0941\u0932\u0924\u093e \u0939\u0948 \u091c\u092c \u0916\u093e\u0924\u0947 \u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0928\u0947 \u0915\u093e \u092a\u094d\u0930\u092f\u093e\u0938 \u0915\u0930\u0947\u0902\u0917\u0947. \u092a\u094d\u0930\u0935\u0947\u0936 \u092a\u094d\u0930\u0915\u094d\u0930\u093f\u092f\u093e \u092c\u094d\u0932\u0949\u0915\u094b\u0902 \u0938\u092d\u0940 \u0915\u093e\u0930\u094d\u092f\u0915\u094d\u0937\u092e\u0924\u093e \u092f\u0939 \u092a\u0942\u0930\u093e \u0939\u094b \u0917\u092f\u093e \u0939\u0948, \u0924\u094b \u0909\u0938 \u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0928\u0947, \u091c\u092c\u0915\u093f \u090f\u0915\u0924\u093e \u092b\u094d\u0930\u0940\u091c \u0915\u0930\u0928\u0947 \u0932\u0917\u0924\u0947 \u0939\u0948\u0902, \u0914\u0930 \u0927\u0940\u092e\u0940 \u0915\u094b \u0936\u0941\u0930\u0942 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u091c\u092c \u0924\u0915 \u0915\u093f \u0938\u092e\u091d\u0947\u0902.",
														"Odabirom ove opcije, GoogleFu automatski \u0107e se poku\u0161ati prijaviti na ra\u010dun kada se otvara. Shvatite da je prijava procesne blokova sve funkcionalnosti dok se ne dovr\u0161i, tako da se mo\u017ee \u010diniti da zamrzne Jedinstvo dok prijavom, i u\u010diniti pokretanje sporije.",
														"L\u00e8 w tcheke bwat sa a, GoogleFu pral otomatikman eseye ouvri sesyon an nan kont la l\u00e8 li louvri. Konprann ke pwosesis login bl\u00f2k yo tout fonctionnalit\u00e9s jouk li se fin ranpli, kididonk li pouvwa sanble friz Inite pandan y ap ouvri sesyon an, epi f\u00e8 k\u00f2manse moute pi dousman.",
														"Dengan mencentang kotak ini, GoogleFu otomatis akan mencoba untuk masuk ke akun ketika terbuka. Memahami bahwa blok proses login semua fungsi sampai selesai, sehingga mungkin tampak untuk membekukan Unity saat log in, dan membuat memulai lambat.",
														"Me\u00f0 \u00fev\u00ed a\u00f0 merkja \u00ed \u00feennan reit, GoogleFu mun sj\u00e1lfkrafa reyna a\u00f0 skr\u00e1 \u00feig inn \u00e1 reikninginn \u00feegar \u00fea\u00f0 opnar. Skilja a\u00f0 \u00e1 innskr\u00e1ningu stendur blokkir alla virkni fyrr en \u00fea\u00f0 er loki\u00f0, svo \u00fea\u00f0 kann a\u00f0 vir\u00f0ast a\u00f0 frysta Unity me\u00f0an a\u00f0 skr\u00e1 \u00feig inn og gera a\u00f0 byrja upp h\u00e6gar.",
														"\u05e2\u05dc \u05d9\u05d3\u05d9 \u05e1\u05d9\u05de\u05d5\u05df \u05ea\u05d9\u05d1\u05d4 \u05d6\u05d5, GoogleFu \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9 \u05de\u05e0\u05e1\u05d4 \u05dc\u05d4\u05ea\u05d7\u05d1\u05e8 \u05dc\u05d7\u05e9\u05d1\u05d5\u05df \u05d1\u05e2\u05ea \u200b\u200b\u05e9\u05d4\u05d5\u05d0 \u05e4\u05d5\u05ea\u05d7. \u05dc\u05d4\u05d1\u05d9\u05df \u05e9\u05dc\u05d5\u05e7\u05d9 \u05ea\u05d4\u05dc\u05d9\u05da \u05d4\u05db\u05e0\u05d9\u05e1\u05d4 \u05db\u05dc \u05d4\u05e4\u05d5\u05e0\u05e7\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05d5\u05ea \u05e2\u05d3 \u05e9\u05d4\u05d5\u05e9\u05dc\u05dd, \u05db\u05da \u05e9\u05d6\u05d4 \u05e0\u05e8\u05d0\u05d4 \u05dc\u05d4\u05e7\u05e4\u05d9\u05d0 \u05d0\u05ea \u05d4\u05d0\u05d7\u05d3\u05d5\u05ea \u05d5\u05d0\u05d9\u05dc\u05d5 \u05d1\u05db\u05e0\u05d9\u05e1\u05d4, \u05d5\u05dc\u05e2\u05e9\u05d5\u05ea \u05de\u05ea\u05d7\u05d9\u05dc \u05d0\u05d9\u05d8\u05d9 \u05d9\u05d5\u05ea\u05e8.",
														"Pa\u017eym\u0117damas \u0161\u012f langel\u012f, GoogleFu automati\u0161kai bando prisijungti prie savo s\u0105skaitos, kai ji prasid\u0117s. Suprasti, kad proceso prisijungimo blokai Visos funkcijos, kol jis bus baigtas, tod\u0117l gali atrodyti, kad u\u017e\u0161aldyti vienov\u0119 prisijungti ir padaryti pradedant l\u0117\u010diau.",
														"P\u0101rbaudot \u0161o lodzi\u0146u, GoogleFu autom\u0101tiski m\u0113\u0123ina pieteikties kont\u0101, kad t\u0101 tiek atv\u0113rta. Saprast, ka pieteik\u0161an\u0101s process bloki viss funkcionalit\u0101ti, l\u012bdz tas ir pabeigts, t\u0101p\u0113c tas var likties iesald\u0113t Vienot\u012bbu, bet piesakoties, un padar\u012bt uzs\u0101kot l\u0113n\u0101k.",
														"\u041e\u0434 \u043f\u0440\u043e\u0432\u0435\u0440\u043a\u0430 \u043d\u0430 \u043e\u0432\u0430 \u043f\u043e\u043b\u0435, GoogleFu \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u045c\u0435 \u043f\u0440\u043e\u0431\u0430\u0430\u0442 \u0434\u0430 \u0432\u043b\u0435\u0437\u0435\u0442\u0435 \u0432\u043e \u0441\u043c\u0435\u0442\u043a\u0430\u0442\u0430 \u043a\u043e\u0433\u0430 \u0441\u0435 \u043e\u0442\u0432\u043e\u0440\u0430. \u0421\u0435 \u0440\u0430\u0437\u0431\u0435\u0440\u0435 \u0434\u0435\u043a\u0430 \u0412\u043b\u0435\u0437\u043e\u0442 \u043f\u0440\u043e\u0446\u0435\u0441 \u0431\u043b\u043e\u043a\u0438\u0440\u0430 \u0441\u0438\u0442\u0435 \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u043d\u043e\u0441\u0442 \u0434\u043e\u0434\u0435\u043a\u0430 \u043d\u0435 \u0441\u0435 \u043a\u043e\u043c\u043f\u043b\u0435\u0442\u0438\u0440\u0430, \u043f\u0430 \u0442\u043e\u0430 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0438\u0437\u0433\u043b\u0435\u0434\u0430 \u0434\u0430 \u0441\u0435 \u0437\u0430\u043c\u0440\u0437\u043d\u0435 \u0415\u0434\u0438\u043d\u0441\u0442\u0432\u043e \u0434\u043e\u0434\u0435\u043a\u0430 \u0432\u043b\u0435\u0437\u0435\u0442\u0435 \u0432\u043e, \u0438 \u0431\u0438\u0434\u0435\u0442\u0435 \u0441\u0442\u0430\u0440\u0442\u0443\u0432\u0430\u045a\u0435 \u043f\u043e\u0431\u0430\u0432\u043d\u043e.",
														"Dengan menandakan kotak ini, GoogleFu secara automatik akan cuba untuk log masuk ke dalam akaun apabila ia dibuka. Memahami bahawa blok proses log masuk semua fungsi sehingga ia selesai, jadi ia mungkin kelihatan untuk membekukan Perpaduan manakala log masuk, dan membuat memulakan lebih perlahan.",
														"Permezz ta 'verifika f'din il-kaxxa, GoogleFu awtomatikament se jippruvaw log fil-kont meta tifta\u0127. Jifhmu li l-blokki pro\u010bess login kollha funzjonalit\u00e0 jekk tkun kompleta, u g\u0127alhekk jista 'jidher li jiffri\u017caw Unit\u00e0 waqt qtug\u0127 fil, u jag\u0127mlu bidu kajman.",
														"Ved \u00e5 krysse av denne boksen, vil GoogleFu automatisk fors\u00f8ke \u00e5 logge deg p\u00e5 kontoen n\u00e5r den \u00e5pner. Forst\u00e5 at p\u00e5loggingsprosessen blokkerer all funksjonalitet til den er ferdig, s\u00e5 det kan synes \u00e5 fryse Unity mens du logger inn, og gj\u00f8r oppstart tregere.",
														"Zaznaczaj\u0105c to pole, GoogleFu automatycznie spr\u00f3buje zalogowa\u0107 si\u0119 do konta, kiedy otwiera. Rozumiemy, \u017ce bloki proces logowania wszystkich funkcji, dop\u00f3ki nie jest pe\u0142na, wi\u0119c mo\u017ce si\u0119 wydawa\u0107, aby zamrozi\u0107 Jedno\u015b\u0107 podczas logowania, i dokona\u0107 rozruchu wolniej.",
														"Ao marcar esta caixa, GoogleFu tentar\u00e1 automaticamente fazer login para a conta quando se abre. Entenda que os blocos do processo de login toda funcionalidade at\u00e9 que esteja completo, por isso pode parecer congelar Unity enquanto o login, e fazer o arranque mais lento.",
														"Bif\u00e2nd aceast\u0103 caset\u0103, GoogleFu va \u00eencerca \u00een mod automat s\u0103 v\u0103 conecta\u021bi la contul atunci c\u00e2nd se deschide. \u00cen\u021belege\u021bi c\u0103 blocurile procesul de conectare toate func\u021bionalitate p\u00e2n\u0103 c\u00e2nd este complet\u0103, a\u0219a c\u0103 poate p\u0103rea s\u0103 \u00eenghe\u021be unitate \u00een timp ce v\u0103 autentifica\u021bi, \u0219i face pornirea mai lent.",
														"Za\u010diarknut\u00edm tohto pol\u00ed\u010dka, bude GoogleFu automaticky pok\u00fasi prihl\u00e1si\u0165 k \u00fa\u010dtu, ke\u010f sa otvor\u00ed. Pochopte, \u017ee proces prihl\u00e1senia bloky v\u0161etky funkcie, k\u00fdm nie je dokon\u010den\u00e1, tak\u017ee sa m\u00f4\u017ee zda\u0165, \u017ee zmrazi\u0165 jednotu pri prihl\u00e1sen\u00ed, a aby spustenie pomal\u0161\u00ed.",
														"S potrditvijo tega polja, bo GoogleFu samodejno poskus, da se prijavite v ra\u010dun, ko se odpre. Razumeti, da je proces prijave blokov vse funkcionalnosti, dokler ni kon\u010dana, zato se zdi, da zamrzne enotnosti, medtem ko pri prijavi, in da zagon po\u010dasnej\u0161i.",
														"Duke kontrolluar k\u00ebt\u00eb kuti, GoogleFu automatikisht do t\u00eb b\u00ebjn\u00eb t\u00eb pamundur\u00ebn t\u00eb hyni n\u00eb llogarin\u00eb e kur ajo hapet. Kuptoni se bllokon procesin login t\u00eb gjitha funksionet deri sa ajo \u00ebsht\u00eb e plot\u00eb, k\u00ebshtu q\u00eb mund t\u00eb duket p\u00ebr t\u00eb ngrir\u00eb Unitetit, nd\u00ebrsa logging in, dhe t\u00eb b\u00ebj\u00eb duke u nisur ngadalsh\u00ebm.",
														"\u041f\u043e\u0442\u0432\u0440\u0434\u043e\u043c \u043e\u0432\u043e\u043c \u043f\u043e\u0459\u0443, \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u045b\u0435 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u043f\u043e\u043a\u0443\u0448\u0430\u0442\u0438 \u0434\u0430 \u0441\u0435 \u043f\u0440\u0438\u0458\u0430\u0432\u0438\u0442\u0435 \u043d\u0430 \u0440\u0430\u0447\u0443\u043d \u043a\u0430\u0434\u0430 \u0441\u0435 \u043e\u0442\u0432\u043e\u0440\u0438. \u0421\u0445\u0432\u0430\u0442\u0438\u0442\u0435 \u0434\u0430 \u0441\u0443 \u043f\u0440\u0438\u0458\u0430\u0432\u0443 \u043f\u0440\u043e\u0446\u0435\u0441\u0430 \u0431\u043b\u043e\u043a\u043e\u0432\u0430 \u0441\u0432\u0435 \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u043d\u043e\u0441\u0442\u0438 \u0434\u043e\u043a \u0441\u0435 \u043d\u0435 \u0437\u0430\u0432\u0440\u0448\u0438, \u043f\u0430 \u043c\u043e\u0436\u0435 \u0438\u0437\u0433\u043b\u0435\u0434\u0430\u0442\u0438 \u0434\u0430 \u0437\u0430\u043c\u0440\u0437\u043d\u0435 \u0458\u0435\u0434\u0438\u043d\u0441\u0442\u0432\u043e \u0434\u043e\u043a \u043b\u043e\u0433\u043e\u0432\u0430\u045a\u0435, \u0430 \u0447\u0438\u043d\u0435 \u0437\u0430\u043f\u043e\u0447\u0438\u045a\u0430\u045a\u0435 \u0441\u043f\u043e\u0440\u0438\u0458\u0435.",
														"Genom att kryssa i denna ruta kommer GoogleFu automatiskt att f\u00f6rs\u00f6ka logga in p\u00e5 kontot n\u00e4r den \u00f6ppnar. F\u00f6rst\u00e5 att inloggningsprocessen blockerar all funktionalitet tills den \u00e4r klar, s\u00e5 det kan tyckas att frysa Unity n\u00e4r du loggar in, och att starta upp l\u00e5ngsammare.",
														"By kuangalia sanduku hili, GoogleFu moja kwa moja kujaribu kuingia kwenye akaunti wakati kuufungua. Kuelewa kwamba mchakato wa kuingia vitalu utendaji wote mpaka ni kamili, hivyo inaweza kuonekana kwa kufungia Unity wakati magogo katika, na kufanya kuanzisha polepole.",
														"\u0e42\u0e14\u0e22\u0e01\u0e32\u0e23\u0e15\u0e23\u0e27\u0e08\u0e2a\u0e2d\u0e1a\u0e01\u0e25\u0e48\u0e2d\u0e07\u0e19\u0e35\u0e49 GoogleFu \u0e08\u0e30\u0e1e\u0e22\u0e32\u0e22\u0e32\u0e21\u0e42\u0e14\u0e22\u0e2d\u0e31\u0e15\u0e42\u0e19\u0e21\u0e31\u0e15\u0e34\u0e40\u0e1e\u0e37\u0e48\u0e2d\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e1a\u0e31\u0e0d\u0e0a\u0e35\u0e40\u0e21\u0e37\u0e48\u0e2d\u0e40\u0e1b\u0e34\u0e14 \u0e40\u0e02\u0e49\u0e32\u0e43\u0e08\u0e27\u0e48\u0e32\u0e01\u0e32\u0e23\u0e1a\u0e25\u0e47\u0e2d\u0e01\u0e01\u0e32\u0e23\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e23\u0e30\u0e1a\u0e1a\u0e01\u0e32\u0e23\u0e17\u0e33\u0e07\u0e32\u0e19\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14\u0e08\u0e19\u0e01\u0e27\u0e48\u0e32\u0e08\u0e30\u0e40\u0e2a\u0e23\u0e47\u0e08\u0e2a\u0e21\u0e1a\u0e39\u0e23\u0e13\u0e4c\u0e14\u0e31\u0e07\u0e19\u0e31\u0e49\u0e19\u0e08\u0e36\u0e07\u0e2d\u0e32\u0e08\u0e14\u0e39\u0e40\u0e2b\u0e21\u0e37\u0e2d\u0e19\u0e08\u0e30\u0e2b\u0e22\u0e38\u0e14\u0e04\u0e27\u0e32\u0e21\u0e2a\u0e32\u0e21\u0e31\u0e04\u0e04\u0e35\u0e43\u0e19\u0e02\u0e13\u0e30\u0e17\u0e35\u0e48\u0e01\u0e32\u0e23\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e23\u0e30\u0e1a\u0e1a\u0e41\u0e25\u0e30\u0e43\u0e2b\u0e49\u0e40\u0e23\u0e34\u0e48\u0e21\u0e15\u0e49\u0e19\u0e02\u0e36\u0e49\u0e19\u0e0a\u0e49\u0e32\u0e25\u0e07",
														"Sa pamamagitan ng pagsuri sa kahon na ito, awtomatikong susubukan ng GoogleFu na mag-log in sa account kapag ito ay bubukas. Unawain na ang proseso ng pag-login bloke ang lahat ng pagpapagana hanggang sa ito ay kumpleto, kaya maaaring mukhang ito upang mag-freeze ng Unity habang nagla-log in, at gumawa ng naguumpisa mas mabagal.",
														"Bu kutuyu i\u015faretleyerek, GoogleFu otomatik olarak a\u00e7\u0131ld\u0131\u011f\u0131nda hesab\u0131n\u0131za giri\u015f \u00e7al\u0131\u015facakt\u0131r. Oturum a\u00e7ma i\u015flemi bloklar\u0131 t\u00fcm i\u015flevselli\u011fi tamamlanmadan, bu y\u00fczden oturum a\u00e7arken Birlik dondurmak gibi g\u00f6r\u00fcn\u00fcyor, ve yava\u015f yukar\u0131ya ba\u015flang\u0131\u00e7 \u200b\u200byapabilir kadar anl\u0131yorum.",
														"\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0438 \u0446\u0435\u0439 \u043f\u0440\u0430\u043f\u043e\u0440\u0435\u0446\u044c, GoogleFu \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0441\u043f\u0440\u043e\u0431\u0443\u0454 \u0443\u0432\u0456\u0439\u0442\u0438 \u043d\u0430 \u0440\u0430\u0445\u0443\u043d\u043e\u043a, \u043a\u043e\u043b\u0438 \u0432\u0456\u043d \u0432\u0456\u0434\u043a\u0440\u0438\u0454\u0442\u044c\u0441\u044f. \u0417\u0440\u043e\u0437\u0443\u043c\u0456\u0439\u0442\u0435, \u0449\u043e \u043d\u0435 \u043d\u0430 \u0412\u0432\u0456\u0439\u0442\u0438 \u043f\u0440\u043e\u0446\u0435\u0441\u0443 \u0431\u043b\u043e\u043a\u0438 \u0432\u0441\u0456 \u0444\u0443\u043d\u043a\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0456, \u043f\u043e\u043a\u0438 \u0432\u043e\u043d\u0430 \u0431\u0443\u0434\u0435 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0430, \u0442\u0430\u043a \u0449\u043e \u043c\u043e\u0436\u0435 \u0437\u0434\u0430\u0442\u0438\u0441\u044f, \u0449\u043e\u0431 \u0437\u0430\u043c\u043e\u0440\u043e\u0437\u0438\u0442\u0438 \u0404\u0434\u043d\u0456\u0441\u0442\u044c \u043f\u0456\u0434 \u0447\u0430\u0441 \u0432\u0445\u043e\u0434\u0443 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443, \u0456 \u0437\u0440\u043e\u0431\u0438\u0442\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043f\u043e\u0432\u0456\u043b\u044c\u043d\u0456\u0448\u0435.",
														"\u05d3\u05d5\u05e8\u05da \u05e7\u05d0\u05b8\u05e0\u05d8\u05e8\u05d0\u05b8\u05dc\u05d9\u05e8\u05d5\u05e0\u05d2 \u05d3\u05e2\u05dd \u05e7\u05e2\u05e1\u05d8\u05dc, \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05d0\u05d5\u05d9\u05d8\u05d0\u05b8\u05de\u05d0\u05b7\u05d8\u05d9\u05e9 \u05e4\u05bc\u05e8\u05d5\u05d5\u05d5\u05df \u05e6\u05d5 \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05d9\u05df \u05e6\u05d5 \u05d3\u05e2\u05dd \u05d7\u05e9\u05d1\u05d5\u05df \u05d5\u05d5\u05e2\u05df \u05e2\u05e1 \u05d0\u05b8\u05e4\u05bc\u05e2\u05e0\u05e1. \u05e4\u05bf\u05d0\u05b7\u05e8\u05e9\u05d8\u05d9\u05d9\u05df \u05d0\u05b7\u05d6 \u05d3\u05d9 \u05dc\u05d0\u05b8\u05d2\u05d9\u05df \u05e4\u05bc\u05e8\u05d0\u05b8\u05e6\u05e2\u05e1 \u05d1\u05dc\u05d0\u05b7\u05e7\u05e1 \u05d0\u05b7\u05dc\u05e2 \u05e4\u05d0\u05b7\u05e0\u05d2\u05e7\u05e9\u05d0\u05b7\u05e0\u05d0\u05b7\u05dc\u05d9\u05d8\u05d9 \u05d1\u05d9\u05d6 \u05e2\u05e1 \u05d0\u05d9\u05d6 \u05d2\u05d0\u05b7\u05e0\u05e5, \u05d0\u05b7\u05d6\u05d5\u05d9 \u05e2\u05e1 \u05d6\u05d0\u05dc \u05d5\u05d9\u05e1\u05e7\u05d5\u05de\u05e2\u05df \u05e6\u05d5 \u05e4\u05e8\u05d9\u05e8\u05df \u05d5\u05e0\u05d9\u05d8\u05d9 \u05d1\u05e9\u05e2\u05ea \u05dc\u05d0\u05b8\u05d2\u05d9\u05e0\u05d2 \u05d0\u05d9\u05df, \u05d0\u05d5\u05df \u05de\u05d0\u05b7\u05db\u05df \u05e1\u05d8\u05d0\u05b7\u05e8\u05d8\u05d9\u05e0\u05d2 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e3 \u05e1\u05dc\u05d0\u05b8\u05d5\u05e2\u05e8.",
														"\u52fe\u9078\u6b64\u65b9\u584a\uff0cGoogleFu\u6703\u81ea\u52d5\u5617\u8a66\u5728\u5b83\u6253\u958b\u6642\u767b\u9304\u5230\u8a72\u5e33\u6236\u3002\u8a18\u8005\u4e86\u89e3\u5230\uff0c\u5728\u767b\u9304\u904e\u7a0b\u4e2d\u963b\u6b62\u6240\u6709\u529f\u80fd\uff0c\u76f4\u5230\u5b83\u662f\u5b8c\u6574\u7684\uff0c\u6240\u4ee5\u5b83\u53ef\u80fd\u4f3c\u4e4e\u51cd\u7d50\u5728\u7d71\u4e00\u767b\u9304\uff0c\u4e26\u9032\u884c\u6162\u555f\u52d5\u3002"));
			Rows.Add( new LocalizationRow("The GoogleFu GUI has been localized using Google Translation. Understand this is not a perfect localization, but if English is not your native language, you may be better off with the translation.  ",
														"Le GoogleFu interface graphique a \u00e9t\u00e9 localis\u00e9e \u00e0 l'aide de Google Traduction. Comprendre ce n'est pas une localisation parfaite, mais si l'anglais n'est pas votre langue maternelle, vous pouvez \u00eatre mieux avec la traduction.",
														"Il GoogleFu GUI \u00e8 stato localizzato con Google Traduttore. Capire questa non \u00e8 una localizzazione perfetta, ma se l'inglese non \u00e8 la lingua nativa, si potrebbe essere meglio con la traduzione.",
														"Die GoogleFu GUI wurde mit Google \u00fcbersetzen lokalisiert. Verstehen Sie, das ist nicht eine perfekte Lokalisierung, aber wenn Englisch nicht Ihre Muttersprache ist, k\u00f6nnen Sie besser dran mit der \u00dcbersetzung sein.",
														"La GUI googleFU se ha localizado a trav\u00e9s de Google Translation. Entender esto no es una localizaci\u00f3n perfecta, pero si el Ingl\u00e9s no es su lengua materna, es posible que sea mejor con la traducci\u00f3n.",
														"\u0648\u062a\u0645 \u062d\u0635\u0631 GoogleFu \u0648\u0627\u062c\u0647\u0629 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u0631\u0633\u0648\u0645\u064a\u0629 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u062a\u0631\u062c\u0645\u0629 \u062c\u0648\u062c\u0644. \u0641\u0647\u0645 \u0647\u0630\u0627 \u0644\u064a\u0633 \u062a\u0648\u0637\u064a\u0646 \u0627\u0644\u0643\u0645\u0627\u0644\u060c \u0648\u0644\u0643\u0646 \u0625\u0630\u0627 \u0644\u0645 \u062a\u0643\u0646 \u0627\u0644\u0625\u0646\u062c\u0644\u064a\u0632\u064a\u0629 \u0644\u063a\u062a\u0643 \u0627\u0644\u0623\u0645\u060c \u0642\u062f \u064a\u0643\u0648\u0646 \u0623\u0641\u0636\u0644 \u062d\u0627\u0644\u0627 \u0645\u0639 \u0627\u0644\u062a\u0631\u062c\u0645\u0629.",
														"GoogleFu GUI \uad6c\uae00 \ubc88\uc5ed\uae30\ub97c \uc0ac\uc6a9\ud558\uc5ec \uc9c0\uc5ed\ud654\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc774 \uc644\ubcbd\ud55c \ud604\uc9c0\ud654\ud558\uc9c0 \uc54a\ub2e4\ub294 \uac83\uc744 \uc774\ud574\ud558\uc9c0\ub9cc, \uc601\uc5b4\uac00 \ubaa8\uad6d\uc5b4\uac00 \uc544\ub2cc \uacbd\uc6b0, \ub2f9\uc2e0\uc740 \ubc88\uc5ed \ub354 \ub098\uc744 \uc218\uc788\ub2e4.",
														"\u8be5GoogleFu\u754c\u9762\u4e00\u76f4\u4f7f\u7528\u8c37\u6b4c\u7ffb\u8bd1\u672c\u5730\u5316\u3002\u660e\u767d\u8fd9\u4e0d\u662f\u4e00\u4e2a\u5b8c\u7f8e\u7684\u672c\u5730\u5316\uff0c\u4f46\u5982\u679c\u82f1\u8bed\u4e0d\u662f\u4f60\u7684\u6bcd\u8bed\uff0c\u4f60\u53ef\u80fd\u4f1a\u66f4\u597d\u7684\u7ffb\u8bd1\u3002",
														"GoogleFu GUI\u306f\u3001Google\u306e\u7ffb\u8a33\u3092\u4f7f\u7528\u3057\u3066\u30ed\u30fc\u30ab\u30e9\u30a4\u30ba\u3055\u308c\u3066\u3044\u307e\u3059\u3002\u3053\u308c\u306f\u5b8c\u74a7\u306a\u30ed\u30fc\u30ab\u30e9\u30a4\u30ba\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u82f1\u8a9e\u304c\u6bcd\u56fd\u8a9e\u3067\u306a\u3044\u5834\u5408\u306f\u3001\u7ffb\u8a33\u3068\u3057\u305f\u307b\u3046\u304c\u826f\u3044\u5834\u5408\u304c\u3042\u308a\u7406\u89e3\u3057\u3066\u3044\u307e\u3059\u3002",
														"GoogleFu GUI \u0431\u044b\u043b \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u043e\u0432\u0430\u043d \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u041f\u0435\u0440\u0435\u0432\u043e\u0434\u0447\u0438\u043a Google. \u041f\u043e\u0439\u043c\u0438\u0442\u0435, \u0447\u0442\u043e \u044d\u0442\u043e \u043d\u0435 \u0438\u0434\u0435\u0430\u043b\u044c\u043d\u044b\u0439 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044f, \u043d\u043e \u0435\u0441\u043b\u0438 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043d\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0432\u0430\u0448\u0438\u043c \u0440\u043e\u0434\u043d\u044b\u043c \u044f\u0437\u044b\u043a\u043e\u043c, \u0432\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0431\u044b\u0442\u044c \u043b\u0443\u0447\u0448\u0435 \u0441 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u043e\u043c.",
														"C\u00e1c GoogleFu giao di\u1ec7n \u0111\u00e3 \u0111\u01b0\u1ee3c b\u1ea3n \u0111\u1ecba ho\u00e1 s\u1eed d\u1ee5ng Google d\u1ecbch. Hi\u1ec3u \u0111\u00e2y kh\u00f4ng ph\u1ea3i l\u00e0 n\u1ed9i \u0111\u1ecba h\u00f3a ho\u00e0n h\u1ea3o, nh\u01b0ng n\u1ebfu ti\u1ebfng Anh kh\u00f4ng ph\u1ea3i l\u00e0 ng\u00f4n ng\u1eef m\u1eb9 \u0111\u1ebb c\u1ee7a b\u1ea1n, b\u1ea1n c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c t\u1ed1t h\u01a1n v\u1edbi b\u1ea3n d\u1ecbch.",
														"De googleFU GUI is vertaald met behulp van Google Translation. Begrijpen dat dit niet een perfecte lokalisatie, maar als Engels niet je moedertaal, kan je beter af met de vertaling zijn.",
														"Die GoogleFu GUI is gelokaliseerde met behulp van Google vertaal. Verstaan \u200b\u200bdit is nie 'n perfekte spoor, maar as Engels nie jou moedertaal is, kan jy beter af met die vertaling wees.",
														"The GoogleFu GUI \u0435 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0438\u0440\u0430\u043d, \u0438\u0437\u043f\u043e\u043b\u0437\u0432\u0430\u0439\u043a\u0438 Google Translation. \u0420\u0430\u0437\u0431\u0435\u0440\u0435\u0442\u0435, \u0442\u043e\u0432\u0430 \u043d\u0435 \u0435 \u043f\u0435\u0440\u0444\u0435\u043a\u0442\u0435\u043d \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044f, \u043d\u043e \u0430\u043a\u043e \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u044f\u0442 \u043d\u0435 \u0435 \u0440\u043e\u0434\u0435\u043d \u0435\u0437\u0438\u043a, \u043c\u043e\u0436\u0435 \u0434\u0430 \u0431\u044a\u0434\u0435 \u043f\u043e-\u0434\u043e\u0431\u0440\u0435 \u0441 \u043f\u0440\u0435\u0432\u043e\u0434\u0430.",
														"GoogleFu GUI \u0431\u044b\u045e \u043b\u0430\u043a\u0430\u043b\u0456\u0437\u0430\u0432\u0430\u043d\u044b \u0437 \u0434\u0430\u043f\u0430\u043c\u043e\u0433\u0430\u0439 \u041f\u0435\u0440\u0430\u043a\u043b\u0430\u0434\u0447\u044b\u043a Google. \u0417\u0440\u0430\u0437\u0443\u043c\u0435\u0439\u0446\u0435, \u0448\u0442\u043e \u0433\u044d\u0442\u0430 \u043d\u0435 \u0456\u0434\u044d\u0430\u043b\u044c\u043d\u044b \u043b\u0430\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u044b\u044f, \u0430\u043b\u0435 \u043a\u0430\u043b\u0456 \u0430\u043d\u0433\u043b\u0456\u0439\u0441\u043a\u0430\u044f \u043d\u0435 \u0437'\u044f\u045e\u043b\u044f\u0435\u0446\u0446\u0430 \u0432\u0430\u0448\u044b\u043c \u0440\u043e\u0434\u043d\u044b\u043c \u043c\u043e\u0432\u0430\u0439, \u0432\u044b \u043c\u043e\u0436\u0430\u0446\u0435 \u0431\u044b\u0446\u044c \u043b\u0435\u043f\u0448 \u0437 \u043f\u0435\u0440\u0430\u043a\u043b\u0430\u0434\u0430\u043c.",
														"La GUI googleFU s'ha localitzat a trav\u00e9s de Google Translation. Entendre aix\u00f2 no \u00e9s una localitzaci\u00f3 perfecta, per\u00f2 si l'angl\u00e8s no \u00e9s la seva llengua materna, \u00e9s possible que sigui millor amb la traducci\u00f3.",
														"GoogleFu GUI byl lokalizov\u00e1n pomoc\u00ed Google Translation. Pochopte, \u017ee to nen\u00ed perfektn\u00ed lokalizace, ale pokud angli\u010dtina nen\u00ed va\u0161\u00edm rodn\u00fdm jazykem, m\u016f\u017eete b\u00fdt l\u00e9pe s p\u0159ekladem.",
														"Mae'r GoogleFu GUI wedi cael ei lleol gan ddefnyddio Google Cyfieithu. Deall nad yw hyn yn lleoleiddio berffaith, ond os nad Saesneg yw eich iaith frodorol, efallai y byddwch yn well eich byd gyda'r cyfieithiad.",
														"GoogleFu GUI on lokaliseeritud Google Translation. Aru ei ole ideaalne asukoht, vaid kui inglise keel ei ole teie emakeel, siis v\u00f5ib olla parem t\u00f5lge.",
														"GoogleFu GUI \u0627\u0633\u062a \u0628\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u06af\u0648\u06af\u0644 \u062a\u0631\u062c\u0645\u0647 \u062a\u0631\u062c\u0645\u0647 \u0634\u062f\u0647 \u0627\u0646\u062f. \u062f\u0631\u06a9 \u0627\u06cc\u0646 \u0627\u0633\u062a \u06a9\u0647 \u0645\u062d\u0644\u06cc \u0633\u0627\u0632\u06cc \u06a9\u0627\u0645\u0644 \u0646\u06cc\u0633\u062a\u060c \u0627\u0645\u0627 \u0627\u06af\u0631 \u0627\u0646\u06af\u0644\u06cc\u0633\u06cc \u0632\u0628\u0627\u0646 \u0645\u0627\u062f\u0631\u06cc \u0634\u0645\u0627 \u0646\u06cc\u0633\u062a\u060c \u0634\u0645\u0627 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0628\u0647\u062a\u0631 \u0627\u0633\u062a \u0628\u0627 \u062a\u0631\u062c\u0645\u0647.",
														"GoogleFu GUI on lokalisoitu Google Translation. Ymm\u00e4rr\u00e4 t\u00e4m\u00e4 ei ole t\u00e4ydellinen lokalisointi, mutta jos Englanti ei ole \u00e4idinkieli, saatat olla parempi k\u00e4\u00e4nn\u00f6s.",
														"T\u00e1 an GUI GoogleFu T\u00e1 log\u00e1naithe baint \u00fas\u00e1ide as Google Aistri\u00fach\u00e1in. Tuig nach bhfuil s\u00e9 seo ina log\u00e1n\u00fa foirfe, ach m\u00e1s rud \u00e9 nach \u00e9 an B\u00e9arla do theanga dh\u00fachais, f\u00e9adfaidh t\u00fa a bheith n\u00edos fearr as leis an aistri\u00fach\u00e1n.",
														"A GUI GoogleFu foi localizado a usar Google Tradutor. Entender iso non \u00e9 unha situaci\u00f3n perfecta, pero se o ingl\u00e9s non \u00e9 a s\u00faa lingua nativa, pode ser mellor f\u00f3ra coa traduci\u00f3n.",
														"GoogleFu \u091c\u0940\u092f\u0942\u0906\u0908 \u0917\u0942\u0917\u0932 \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930 \u0938\u094d\u0925\u093e\u0928\u0940\u092f\u0915\u0943\u0924 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948. \u092f\u0939 \u090f\u0915 \u0938\u0902\u092a\u0942\u0930\u094d\u0923 \u0938\u094d\u0925\u093e\u0928\u0940\u092f\u0915\u0930\u0923 \u0928\u0939\u0940\u0902 \u0939\u0948 \u0938\u092e\u091d\u0924\u0947 \u0939\u0948\u0902, \u0932\u0947\u0915\u093f\u0928 \u0905\u0902\u0917\u094d\u0930\u0947\u091c\u0940 \u0905\u092a\u0928\u0940 \u092e\u0942\u0932 \u092d\u093e\u0937\u093e \u0928\u0939\u0940\u0902 \u0939\u0948, \u0924\u094b \u0906\u092a \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0947 \u0938\u093e\u0925 \u092c\u0947\u0939\u0924\u0930 \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948.",
														"GoogleFu GUI je lokaliziran pomo\u0107u Google prevoditelj. Shvatite ovo nije savr\u0161ena lokalizacija, ali ako engleski nije va\u0161 materinji jezik, \u0161to mo\u017ee biti bolje s prijevodom.",
														"GoogleFu ent\u00e8fas a ki te lokalize l\u00e8 l s\u00e8vi av\u00e8k Google Creole. Konprann sa a se pa yon lokalizasyon paf\u00e8, men si angle se pa lang natif natal ou an, ou kapab pi bon koupe ak tradiksyon an.",
														"The GoogleFu GUI telah diterjemahkan menggunakan Google Terjemahan. Memahami ini bukan lokalisasi sempurna, tetapi jika bahasa Inggris bukan bahasa asli Anda, Anda mungkin akan lebih baik dengan terjemahan.",
														"The GoogleFu GUI hefur veri\u00f0 sta\u00f0f\u00e6rt a\u00f0 nota Google \u00de\u00fd\u00f0ing. Skilja \u00feetta er ekki fullkomin sta\u00f0setning, en ef enska er ekki m\u00f3\u00f0urm\u00e1l \u00feitt, \u00fe\u00fa mega vera betri burt me\u00f0 \u00fe\u00fd\u00f0ingunni.",
														"GoogleFu GUI \u05db\u05d1\u05e8 \u05de\u05e7\u05d5\u05de\u05d9 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05d2\u05d5\u05d2\u05dc \u05ea\u05e8\u05d2\u05d5\u05dd. \u05dc\u05d4\u05d1\u05d9\u05df \u05d0\u05ea \u05d6\u05d4 \u05d4\u05d5\u05d0 \u05dc\u05d0 \u05dc\u05d5\u05e7\u05dc\u05d9\u05d6\u05e6\u05d9\u05d4 \u05de\u05d5\u05e9\u05dc\u05de\u05ea, \u05d0\u05d1\u05dc \u05d0\u05dd \u05d0\u05e0\u05d2\u05dc\u05d9\u05ea \u05d4\u05d9\u05d0 \u05dc\u05d0 \u05d4\u05e9\u05e4\u05d4 \u05d4\u05d0\u05dd \u05e9\u05dc\u05da, \u05d0\u05ea\u05d4 \u05d9\u05db\u05d5\u05dc \u05dc\u05d4\u05d9\u05d5\u05ea \u05d9\u05d5\u05ea\u05e8 \u05d8\u05d5\u05d1 \u05e2\u05dd \u05d4\u05ea\u05e8\u05d2\u05d5\u05dd.",
														"GoogleFu GUI buvo lokalizuotas, naudojant \"Google\" vertimas. Suprantame, kad tai n\u0117ra tobula lokalizacija, bet jei angl\u0173 kalba n\u0117ra j\u016bs\u0173 gimtoji kalba, jums gali b\u016bti geriau su vertimu.",
														"GoogleFu GUI ir lokaliz\u0113ts, izmantojot Google Translation. Saprotu, tas nav ide\u0101ls lokaliz\u0101cija, bet, ja ang\u013cu valoda nav j\u016bsu dzimt\u0101 valoda, jums var b\u016bt lab\u0101k ar tulkojumu.",
														"\u041d\u0430 GoogleFu GUI \u0435 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0438\u0440\u0430\u043d \u043f\u043e\u043c\u043e\u0448 \u043d\u0430 Google \u043f\u0440\u0435\u0432\u043e\u0434. \u0421\u0435 \u0440\u0430\u0437\u0431\u0435\u0440\u0435 \u043e\u0432\u0430 \u043d\u0435 \u0435 \u0441\u043e\u0432\u0440\u0448\u0435\u043d \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0458\u0430, \u043d\u043e \u0430\u043a\u043e \u0435 \u043d\u0430 \u0430\u043d\u0433\u043b\u0438\u0441\u043a\u0438 \u043d\u0435 \u0435 \u043c\u0430\u0458\u0447\u0438\u043d \u0458\u0430\u0437\u0438\u043a, \u043c\u043e\u0436\u0435\u0431\u0438 \u045c\u0435 \u0431\u0438\u0434\u0435 \u043f\u043e\u0434\u043e\u0431\u0440\u043e \u0441\u043e \u043f\u0440\u0435\u0432\u043e\u0434\u043e\u0442.",
														"Yang GoogleFu GUI telah setempat menggunakan Google Terjemahan. Memahami ini tidak penyetempatan yang sempurna, tetapi jika Bahasa Inggeris bukan bahasa ibunda anda, anda boleh menjadi lebih baik dengan terjemahan.",
														"Il-GUI GoogleFu \u0121ie lokalizzat ju\u017caw Google Traduzzjoni. Jifhmu dan mhux lokalizzazzjoni perfetta, imma jekk l-Ingli\u017c mhux lingwa nattiva tieg\u0127ek, inti tista 'tkun a\u0127jar off ma' l-traduzzjoni.",
														"Den GoogleFu GUI har blitt lokalisert ved hjelp av Google Translation. Forst\u00e5 dette er ikke en perfekt lokalisering, men hvis engelsk ikke er morsm\u00e5let ditt, kan du bli bedre med oversettelsen.",
														"GoogleFu GUI zosta\u0142 zlokalizowany przy u\u017cyciu T\u0142umaczenie Google. Rozumiem, nie jest to idealne lokalizacja, ale je\u015bli angielski nie jest j\u0119zykiem ojczystym, mo\u017ce by\u0107 lepiej z t\u0142umaczeniem.",
														"A GUI GoogleFu foi localizado usando Google Tradutor. Entender isso n\u00e3o \u00e9 uma localiza\u00e7\u00e3o perfeita, mas se o Ingl\u00eas n\u00e3o \u00e9 sua l\u00edngua nativa, voc\u00ea pode ser melhor fora com a tradu\u00e7\u00e3o.",
														"GoogleFu GUI a fost localizat cu ajutorul Google Traducere. S\u0103 \u00een\u021beleag\u0103 acest lucru nu este o localizare perfecta, dar \u00een cazul \u00een care engleza nu este limba ta matern\u0103, s-ar putea fi mai bine cu traducerea.",
														"GoogleFu GUI bol lokalizovan\u00fd pomocou Google Translation. Pochopte, \u017ee to nie je perfektn\u00e1 lokaliz\u00e1cia, ale ak angli\u010dtina nie je va\u0161\u00edm rodn\u00fdm jazykom, m\u00f4\u017eete by\u0165 lep\u0161ie s prekladom.",
														"GoogleFu GUI je bila lokalizirana pomo\u010djo Google prevod. Razumem, to ni popolna lokalizacija, vendar, \u010de angle\u0161\u010dina ni va\u0161 materni jezik, boste morda bolje s prevodom.",
														"GoogleFu GUI \u00ebsht\u00eb lokalizuar duke p\u00ebrdorur Google Translation. Kuptojn\u00eb kjo nuk \u00ebsht\u00eb nj\u00eb localization p\u00ebrsosur, por n\u00ebse anglishtja nuk \u00ebsht\u00eb gjuha juaj amtare, ju mund t\u00eb jet\u00eb m\u00eb mir\u00eb me p\u00ebrkthimin.",
														"\u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0413\u0423\u0418 \u0458\u0435 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u043e\u0432\u0430\u043d \u043f\u043e\u043c\u043e\u045b\u0443 \u0413\u043e\u043e\u0433\u043b\u0435 \u0422\u0440\u0430\u043d\u0441\u043b\u0430\u0442\u0438\u043e\u043d. \u0421\u0445\u0432\u0430\u0442\u0438\u0442\u0435 \u043e\u0432\u043e \u043d\u0438\u0458\u0435 \u0441\u0430\u0432\u0440\u0448\u0435\u043d \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0458\u0430, \u0430\u043b\u0438 \u0430\u043a\u043e \u0435\u043d\u0433\u043b\u0435\u0441\u043a\u0438 \u043d\u0438\u0458\u0435 \u0432\u0430\u0448 \u043c\u0430\u0442\u0435\u0440\u045a\u0438 \u0458\u0435\u0437\u0438\u043a, \u043c\u043e\u0436\u0434\u0430 \u045b\u0435\u0442\u0435 \u0431\u0438\u0442\u0438 \u0431\u043e\u0459\u0435 \u0441\u0430 \u043f\u0440\u0435\u0432\u043e\u0434\u043e\u043c.",
														"Den GoogleFu GUI har lokaliserats med hj\u00e4lp skrevs. F\u00f6rst\u00e5 detta inte \u00e4r en perfekt lokalisering, men om engelska inte \u00e4r ditt modersm\u00e5l, kan du vara b\u00e4ttre med \u00f6vers\u00e4ttningen.",
														"GoogleFu GUI imekuwa za ndani kwa kutumia Google Tafsiri. Kuelewa hii si ujanibishaji kamili, lakini ikiwa Kiingereza sio lugha yako ya asili, unaweza kuwa bora zaidi na tafsiri.",
														"GoogleFu GUI \u0e44\u0e14\u0e49\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e41\u0e1b\u0e25\u0e40\u0e1b\u0e47\u200b\u200b\u0e19\u0e20\u0e32\u0e29\u0e32\u0e17\u0e49\u0e2d\u0e07\u0e16\u0e34\u0e48\u0e19\u0e17\u0e35\u0e48\u0e43\u0e0a\u0e49\u0e1b\u0e23\u0e30\u0e42\u0e22\u0e0a\u0e19\u0e4c \u0e40\u0e02\u0e49\u0e32\u0e43\u0e08\u0e43\u0e19\u0e40\u0e23\u0e37\u0e48\u0e2d\u0e07\u0e19\u0e35\u0e49\u0e44\u0e21\u0e48\u0e44\u0e14\u0e49\u0e40\u0e1b\u0e47\u0e19\u0e17\u0e49\u0e2d\u0e07\u0e16\u0e34\u0e48\u0e19\u0e17\u0e35\u0e48\u0e2a\u0e21\u0e1a\u0e39\u0e23\u0e13\u0e4c\u0e41\u0e1a\u0e1a \u0e41\u0e15\u0e48\u0e16\u0e49\u0e32\u0e20\u0e32\u0e29\u0e32\u0e2d\u0e31\u0e07\u0e01\u0e24\u0e29\u0e44\u0e21\u0e48\u0e43\u0e0a\u0e48\u0e20\u0e32\u0e29\u0e32\u0e41\u0e21\u0e48\u0e02\u0e2d\u0e07\u0e04\u0e38\u0e13\u0e04\u0e38\u0e13\u0e2d\u0e32\u0e08\u0e08\u0e30\u0e14\u0e35\u0e01\u0e27\u0e48\u0e32\u0e14\u0e49\u0e27\u0e22\u0e01\u0e32\u0e23\u0e41\u0e1b\u0e25",
														"Ang GoogleFu GUI ay na-localize na gamit ang Google Translation. Intindihin na ito ay hindi isang perpektong lokalisasyon, ngunit kung ang Ingles ay hindi ang iyong katutubong wika, maaari kang maging mas mahusay na off sa pagsasalin.",
														"GoogleFu GUI Google Translation kullanarak lokalize olmu\u015ftur. Bu m\u00fckemmel bir yerelle\u015ftirme de\u011fil anl\u0131yorum, ama \u0130ngilizce ana diliniz de\u011filse, size \u00e7eviri ile daha iyi olabilir.",
														"GoogleFu GUI \u0431\u0443\u043b\u0430 \u043b\u043e\u043a\u0430\u043b\u0456\u0437\u043e\u0432\u0430\u043d\u0430 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u041f\u0435\u0440\u0435\u043a\u043b\u0430\u0434\u0430\u0447 Google. \u0417\u0440\u043e\u0437\u0443\u043c\u0456\u0439\u0442\u0435, \u0449\u043e \u0446\u0435 \u043d\u0435 \u0456\u0434\u0435\u0430\u043b\u044c\u043d\u0438\u0439 \u043b\u043e\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044f, \u0430\u043b\u0435 \u044f\u043a\u0449\u043e \u0430\u043d\u0433\u043b\u0456\u0439\u0441\u044c\u043a\u0430 \u043d\u0435 \u0454 \u0432\u0430\u0448\u043e\u044e \u0440\u0456\u0434\u043d\u043e\u044e \u043c\u043e\u0432\u043e\u044e, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0431\u0443\u0442\u0438 \u043a\u0440\u0430\u0449\u0435 \u0437 \u043f\u0435\u0440\u0435\u043a\u043b\u0430\u0434\u043e\u043c.",
														"\u05d3\u05d9 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d2\u05d5\u05d9 \u05d4\u05d0\u05d8 \u05e9\u05d5\u05d9\u05df \u05dc\u05d0\u05b8\u05d5\u05e7\u05d0\u05b7\u05dc\u05d9\u05d9\u05d6\u05d3 \u05e0\u05d9\u05e6\u05df \u05d2\u05d5\u05d2\u05dc \u05d0\u05d9\u05d1\u05e2\u05e8\u05d6\u05e2\u05e6\u05d5\u05e0\u05d2. \u05e4\u05bf\u05d0\u05b7\u05e8\u05e9\u05d8\u05d9\u05d9\u05df \u05d3\u05e2\u05dd \u05d0\u05d9\u05d6 \u05e0\u05d9\u05d8 \u05d0\u05b7 \u05d2\u05d0\u05e0\u05e5 \u05dc\u05d0\u05b8\u05d5\u05e7\u05d0\u05b7\u05dc\u05d0\u05b7\u05d6\u05d9\u05d9\u05e9\u05d0\u05b7\u05df, \u05d0\u05b8\u05d1\u05e2\u05e8 \u05d0\u05d5\u05d9\u05d1 \u05e2\u05e0\u05d2\u05dc\u05d9\u05e9 \u05d0\u05d9\u05d6 \u05e0\u05d9\u05d8 \u05d0\u05d9\u05d9\u05e2\u05e8 \u05d2\u05e2\u05d1\u05d5\u05d9\u05e8\u05df \u05e9\u05e4\u05bc\u05e8\u05d0\u05b7\u05da, \u05d0\u05d9\u05e8 \u05d6\u05d0\u05dc\u05d8 \u200b\u200b\u05d6\u05d9\u05d9\u05df \u05d1\u05e2\u05e1\u05e2\u05e8 \u05d0\u05b7\u05d5\u05d5\u05e2\u05e7 \u05de\u05d9\u05d8 \u05d3\u05d9 \u05d0\u05d9\u05d1\u05e2\u05e8\u05d6\u05e2\u05e6\u05d5\u05e0\u05d2.",
														"\u8a72GoogleFu\u754c\u9762\u4e00\u76f4\u4f7f\u7528\u8c37\u6b4c\u7ffb\u8b6f\u672c\u5730\u5316\u3002\u660e\u767d\u9019\u4e0d\u662f\u4e00\u500b\u5b8c\u7f8e\u7684\u672c\u5730\u5316\uff0c\u4f46\u5982\u679c\u82f1\u8a9e\u4e0d\u662f\u4f60\u7684\u6bcd\u8a9e\uff0c\u4f60\u53ef\u80fd\u6703\u66f4\u597d\u7684\u7ffb\u8b6f\u3002"));
			Rows.Add( new LocalizationRow("Enable the option to export a worksheet as a GameObject based database.  ",
