														"\u0412\u0438\u0431\u0435\u0440\u0456\u0442\u044c \u0448\u043b\u044f\u0445 \u0440\u0435\u0441\u0443\u0440\u0441\u0438, \u044f\u043a\u0456 GoogleFu \u0431\u0443\u0434\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043f\u0440\u0438 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u0456 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u043b\u044c\u043d\u0438\u0446\u044c\u043a\u0438\u0445 \u0456\u043d\u0441\u043f\u0435\u043a\u0442\u043e\u0440\u0456\u0432 \u0434\u043b\u044f \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445 GameObject.",
														"\u05d0\u05d5\u05d9\u05e1\u05e7\u05dc\u05d9\u05d9\u05b7\u05d1\u05df \u05d3\u05d9 \u05e8\u05e2\u05e1\u05d5\u05e8\u05e1\u05df \u05d3\u05e8\u05da \u05d0\u05b7\u05d6 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05e0\u05d5\u05e6\u05df \u05d5\u05d5\u05e2\u05df \u05d3\u05d6\u05e9\u05e2\u05e0\u05e2\u05e8\u05d9\u05d9\u05d8\u05d9\u05e0\u05d2 \u05de\u05e0\u05d4\u05d2 \u05d9\u05e0\u05e1\u05e4\u05bc\u05e2\u05e7\u05d8\u05e2\u05e8\u05d6 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d3\u05d9 \u05d2\u05d0\u05b7\u05de\u05e2\u05d0\u05b8\u05d1\u05d3\u05d6\u05e9\u05e2\u05e7\u05d8 \u05d3\u05d0\u05b7\u05d8\u05d0\u05b7\u05d1\u05d0\u05b7\u05e1\u05e2.",
														"\u9078\u64c7\u751f\u6210\u81ea\u5b9a\u7fa9\u6aa2\u67e5\u54e1\u7684\u904a\u6232\u5c0d\u8c61\u6578\u64da\u5eab\u6642GoogleFu\u5c07\u4f7f\u7528\u7684\u8cc7\u6e90\u8def\u5f91\u3002"));
			Rows.Add( new LocalizationRow("Automatically generate paths for all of the export types.  This will override any existing paths that have already been set!",
														"G\u00e9n\u00e9rer automatiquement des chemins pour tous les types d'exportation. Ceci remplacera tous les chemins existants qui ont d\u00e9j\u00e0 \u00e9t\u00e9 fix\u00e9s!",
														"Generazione automatica di percorsi per tutti i tipi di esportazione. Questo avr\u00e0 la precedenza su eventuali percorsi esistenti che sono gi\u00e0 stati impostati!",
														"Pfade generiert automatisch f\u00fcr alle Exporttypen. Dadurch werden alle vorhandenen Wege, die bereits eingestellt wurden \u00fcberschreiben!",
														"Generaci\u00f3n autom\u00e1tica de rutas para todos los tipos de exportaci\u00f3n. Esto anular\u00e1 cualquier caminos existentes que ya se han creado!",
														"\u062a\u0648\u0644\u062f \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0645\u0633\u0627\u0631\u0627\u062a \u0644\u0643\u0627\u0641\u0629 \u0623\u0646\u0648\u0627\u0639 \u0627\u0644\u062a\u0635\u062f\u064a\u0631. \u0648\u0647\u0630\u0627 \u062a\u062c\u0627\u0648\u0632 \u0623\u064a \u0645\u0633\u0627\u0631\u0627\u062a \u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u0627\u0644\u062a\u064a \u062a\u0645 \u062a\u0639\u064a\u064a\u0646\u0647\u0627 \u0628\u0627\u0644\u0641\u0639\u0644!",
														"\uc790\ub3d9\uc73c\ub85c \uc218\ucd9c \ubaa8\ub4e0 \uc720\ud615\uc758 \uacbd\ub85c\ub97c \uc0dd\uc131\ud569\ub2c8\ub2e4. \uc774\uac83\uc740 \uc774\ubbf8 \uc124\uc815\ub418\uc5b4\uc788\ub294 \uae30\uc874\uc758 \uacbd\ub85c\ub97c \ubb34\uc2dc\ud569\ub2c8\ub2e4!",
														"\u81ea\u52a8\u751f\u6210\u8def\u5f84\u7684\u6240\u6709\u51fa\u53e3\u7c7b\u578b\u3002\u8fd9\u5c06\u8986\u76d6\u5df2\u8bbe\u7f6e\u7684\u4efb\u4f55\u73b0\u6709\u7684\u8def\u5f84\uff01",
														"\u81ea\u52d5\u7684\u306b\u8f38\u51fa\u578b\u306e\u3059\u3079\u3066\u306e\u30d1\u30b9\u3092\u751f\u6210\u3057\u307e\u3059\u3002\u3053\u308c\u306f\u65e2\u306b\u8a2d\u5b9a\u3055\u308c\u3066\u3044\u308b\u4efb\u610f\u306e\u65e2\u5b58\u306e\u30d1\u30b9\u3092\u4e0a\u66f8\u304d\u3057\u307e\u3059\uff01",
														"\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u043f\u0443\u0442\u0435\u0439 \u0434\u043b\u044f \u0432\u0441\u0435\u0445 \u0442\u0438\u043f\u043e\u0432 \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430. \u042d\u0442\u043e \u0437\u0430\u043c\u0435\u043d\u0438\u0442 \u0432\u0441\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0435 \u043f\u0443\u0442\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0443\u0436\u0435 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u0435!",
														"T\u1ef1 \u0111\u1ed9ng t\u1ea1o ra \u0111\u01b0\u1eddng d\u1eabn cho t\u1ea5t c\u1ea3 c\u00e1c lo\u1ea1i xu\u1ea5t kh\u1ea9u. \u0110i\u1ec1u n\u00e0y s\u1ebd ghi \u0111\u00e8 l\u00ean b\u1ea5t k\u1ef3 \u0111\u01b0\u1eddng d\u1eabn hi\u1ec7n t\u1ea1i m\u00e0 \u0111\u00e3 \u0111\u01b0\u1ee3c thi\u1ebft l\u1eadp!",
														"Paden automatisch genereren voor alle soorten uitvoer. Dit zal alle bestaande paden die al zijn ingesteld overschrijven!",
														"Outomaties genereer paaie vir al die uitvoer tipes. Dit sal ignoreer enige bestaande paaie wat reeds gestel!",
														"\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u043d\u0435 \u043d\u0430 \u043f\u044a\u0442\u0435\u043a\u0438 \u0437\u0430 \u0432\u0441\u0438\u0447\u043a\u0438 \u0432\u0438\u0434\u043e\u0432\u0435 \u0438\u0437\u043d\u043e\u0441. \u0422\u043e\u0432\u0430 \u0449\u0435 \u0437\u0430\u043c\u0435\u043d\u0438 \u0432\u0441\u0438\u0447\u043a\u0438 \u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0443\u0432\u0430\u0449\u0438 \u043f\u044a\u0442\u0438\u0449\u0430, \u043a\u043e\u0438\u0442\u043e \u0432\u0435\u0447\u0435 \u0441\u0430 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438!",
														"\u0410\u045e\u0442\u0430\u043c\u0430\u0442\u044b\u0447\u043d\u0430\u0435 \u0441\u0442\u0432\u0430\u0440\u044d\u043d\u043d\u0435 \u0448\u043b\u044f\u0445\u043e\u045e \u0434\u043b\u044f \u045e\u0441\u0456\u0445 \u0442\u044b\u043f\u0430\u045e \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443. \u0413\u044d\u0442\u0430 \u0437\u0430\u043c\u0435\u043d\u0456\u0446\u044c \u0443\u0441\u0435 \u0456\u0441\u043d\u0443\u044e\u0447\u044b\u044f \u0448\u043b\u044f\u0445\u0443, \u044f\u043a\u0456\u044f \u045e\u0436\u043e \u0443\u0441\u0442\u0430\u043d\u043e\u045e\u043b\u0435\u043d\u044b\u044f!",
														"Generaci\u00f3 autom\u00e0tica de rutes per a tots els tipus d'exportaci\u00f3. Aix\u00f2 anul \u00b7 lar\u00e0 qualsevol camins existents que ja s'han creat!",
														"Automatick\u00e9 generov\u00e1n\u00ed trasy pro v\u0161echny typy v\u00fdvozu. To p\u0159ep\u00ed\u0161e v\u0161echny existuj\u00edc\u00ed cesty, kter\u00e9 ji\u017e byly nastaveny!",
														"Awtomatig yn cynhyrchu llwybrau ar gyfer pob un o'r mathau allforio. Bydd hyn yn bwysicach nag unrhyw llwybrau presennol sydd eisoes wedi cael eu gosod!",
														"Automaatselt genereerida teed k\u00f5igile ekspordi liigid. See t\u00fchistab k\u00f5ik olemasolevad teed, mis on juba loodud!",
														"\u0628\u0647 \u0635\u0648\u0631\u062a \u062e\u0648\u062f\u06a9\u0627\u0631 \u0645\u0633\u06cc\u0631 \u0628\u0631\u0627\u06cc \u0647\u0645\u0647 \u0646\u0648\u0639 \u0635\u0627\u062f\u0631\u0627\u062a. \u0627\u06cc\u0646 \u0647\u06cc\u0686 \u0645\u0633\u06cc\u0631 \u0645\u0648\u062c\u0648\u062f \u06a9\u0647 \u062f\u0631 \u062d\u0627\u0644 \u062d\u0627\u0636\u0631 \u0645\u062c\u0645\u0648\u0639\u0647 \u0627\u06cc \u0627\u0633\u062a \u0627\u0632 \u0646\u0627\u062f\u06cc\u062f\u0647 \u06af\u0631\u0641\u062a\u0646!",
														"Automaattisesti polkuja kaikille vienti tyyppej\u00e4. T\u00e4m\u00e4 ohittaa olemassa olevat polut, jotka on jo asetettu!",
														"Huathoibr\u00edoch ghini\u00faint cos\u00e1in do gach ceann de na cine\u00e1lacha onnmhairi\u00fa. Beidh s\u00e9 seo gceal\u00f3fa\u00ed leis aon cos\u00e1in at\u00e1 ann cheana f\u00e9in at\u00e1 leagtha s\u00edos cheana f\u00e9in!",
														"Xerar automaticamente os cami\u00f1os para todo tipo de exportaci\u00f3n. Isto substituir\u00e1 todos os cami\u00f1os existentes que xa foron definidos!",
														"\u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0930\u0942\u092a \u0938\u0947 \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u092a\u094d\u0930\u0915\u093e\u0930 \u0915\u0947 \u0938\u092d\u0940 \u0915\u0947 \u0932\u093f\u090f \u092a\u0925 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902. \u092f\u0939 \u092a\u0939\u0932\u0947 \u0938\u0947 \u0939\u0940 \u0924\u092f \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948 \u0915\u093f \u0915\u093f\u0938\u0940 \u092d\u0940 \u092e\u094c\u091c\u0942\u0926\u093e \u0930\u093e\u0938\u094d\u0924\u094b\u0902 \u0915\u094b \u092a\u093e\u0930 \u0915\u0930 \u091c\u093e\u090f\u0917\u0940!",
														"Automatski generirati staze za sve vrste izvoznih. To \u0107e nadja\u010dati sve postoje\u0107e staze koje su ve\u0107 postavljene!",
														"Otomatikman jenere chemen pou tout moun nan ki kalite eksp\u00f2tasyon. Sa a ap pase sou desizyon nenp\u00f2t ki chemen ki egziste deja ki te deja te mete!",
														"Secara otomatis menghasilkan jalur untuk semua jenis ekspor. Ini akan menimpa path yang ada yang telah ditetapkan!",
														"Sj\u00e1lfkrafa b\u00faa lei\u00f0ir fyrir alla \u00fatflutnings ger\u00f0um. \u00deetta hefur forgang allir n\u00faverandi lei\u00f0ir sem \u00feegar hafa veri\u00f0 settar!",
														"\u05dc\u05d9\u05e6\u05d5\u05e8 \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9 \u05e0\u05ea\u05d9\u05d1\u05d9\u05dd \u05dc\u05db\u05dc \u05e1\u05d5\u05d2\u05d9 \u05d4\u05d9\u05e6\u05d5\u05d0. \u05d6\u05d5 \u05ea\u05d1\u05d8\u05dc \u05d0\u05ea \u05db\u05dc \u05e0\u05ea\u05d9\u05d1\u05d9\u05dd \u05e7\u05d9\u05d9\u05de\u05d9\u05dd \u05e9\u05db\u05d1\u05e8 \u05e0\u05e7\u05d1\u05e2\u05d5!",
														"Automati\u0161kai generuoti kelius visiems eksporto r\u016b\u0161i\u0173. Tai perra\u0161ys visus esamus kelius, kurie jau buvo nustatyti!",
														"Autom\u0101tiski \u0123ener\u0113t ce\u013cus visiem eksporta veidiem. Tas ignor\u0113tu visus eso\u0161os ce\u013cus, kas jau ir noteikti!",
														"\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u0434\u0430 \u0441\u0435 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u0430\u0442 \u043f\u0430\u0442\u0435\u043a\u0438 \u0437\u0430 \u0441\u0438\u0442\u0435 \u043d\u0430 \u0438\u0437\u0432\u043e\u0437\u043e\u0442 \u0442\u0438\u043f\u043e\u0432\u0438. \u041e\u0432\u0430 \u045c\u0435 \u0458\u0430 \u0438\u0437\u0431\u0440\u0438\u0448\u0435\u0442\u0435 \u0441\u0435\u0442\u0430 \u043f\u043e\u0441\u0442\u043e\u0435\u0447\u043a\u0430 \u043f\u0430\u0442\u0435\u043a\u0438 \u043a\u043e\u0438 \u0441\u0435 \u0432\u0435\u045c\u0435 \u0432\u043e \u0441\u043e\u0431\u0430\u0442\u0430!",
														"Menjana laluan secara automatik untuk semua jenis eksport. Ini akan mengatasi sebarang laluan yang sedia ada yang telah ditetapkan!",
														"Awtomatikament ji\u0121\u0121eneraw mog\u0127dijiet g\u0127all kollha tat-tipi ta 'esportazzjoni. Dan se jwarrab kwalunkwe mog\u0127dijiet e\u017cistenti li di\u0121\u00e0 \u0121ew stabbiliti!",
														"Automatisk generering av banene for alle de eksport typer. Dette vil overstyre alle eksisterende baner som allerede er satt!",
														"Automatycznego generowania \u015bcie\u017cki dla wszystkich rodzaj\u00f3w eksportu. To zast\u0105pi\u0107 wszystkie istniej\u0105ce \u015bcie\u017cki, kt\u00f3re zosta\u0142y ju\u017c wymienione!",
														"Gerar automaticamente os caminhos para todos os tipos de exporta\u00e7\u00e3o. Isto ir\u00e1 substituir todos os caminhos existentes que j\u00e1 foram definidos!",
														"Genera \u00een mod automat c\u0103i pentru toate tipurile de export. Acest lucru va suprascrie orice c\u0103i existente, care au fost deja stabilite!",
														"Automatick\u00e9 generovanie trasy pre v\u0161etky typy v\u00fdvozu. To prep\u00ed\u0161e v\u0161etky existuj\u00face cesty, ktor\u00e9 u\u017e boli nastaven\u00e9!",
														"Samodejno ustvari poti za vse vrste izvoza. To bo razveljavila vse obstoje\u010de poti, ki so \u017ee dolo\u010dene!",
														"Automatikisht gjenerojn\u00eb shtigjet p\u00ebr t\u00eb gjitha llojet e eksportit. Kjo do t\u00eb shkel \u00e7do shtigje ekzistuese q\u00eb tashm\u00eb jan\u00eb t\u00eb vendosur!",
														"\u0410\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u0433\u0435\u043d\u0435\u0440\u0438\u0441\u0430\u0442\u0438 \u043f\u0443\u0442\u0430\u045a\u0435 \u0437\u0430 \u0441\u0432\u0435 \u0442\u0438\u043f\u043e\u0432\u0435 \u0438\u0437\u0432\u043e\u0437\u0430. \u041e\u0432\u043e \u045b\u0435 \u0437\u0430\u043c\u0435\u043d\u0438\u0442\u0438 \u043f\u043e\u0441\u0442\u043e\u0458\u0435\u045b\u0435 \u043f\u0443\u0442\u0435\u0432\u0435 \u043a\u043e\u0458\u0438 \u0441\u0443 \u0432\u0435\u045b \u043f\u043e\u0441\u0442\u0430\u0432\u0459\u0435\u043d\u0438!",
														"Automatiskt generera v\u00e4gar f\u00f6r alla de typer export. Detta kommer att skriva \u00f6ver befintliga v\u00e4gar som redan har fastst\u00e4llts!",
														"Moja kwa moja kuzalisha njia kwa ajili ya wote wa aina nje ya nchi. Hii kupuuza njia yoyote zilizopo ambayo tayari kuweka!",
														"\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e40\u0e2a\u0e49\u0e19\u0e17\u0e32\u0e07\u0e42\u0e14\u0e22\u0e2d\u0e31\u0e15\u0e42\u0e19\u0e21\u0e31\u0e15\u0e34\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e17\u0e38\u0e01\u0e1b\u0e23\u0e30\u0e40\u0e20\u0e17\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01 \u0e19\u0e35\u0e49\u0e08\u0e30\u0e41\u0e17\u0e19\u0e17\u0e35\u0e48\u0e40\u0e2a\u0e49\u0e19\u0e17\u0e32\u0e07\u0e17\u0e35\u0e48\u0e21\u0e35\u0e2d\u0e22\u0e39\u0e48\u0e17\u0e35\u0e48\u0e44\u0e14\u0e49\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e15\u0e31\u0e49\u0e07\u0e04\u0e48\u0e32\u0e44\u0e27\u0e49\u0e41\u0e25\u0e49\u0e27",
