														"Kuwawezesha fursa ya kuzalisha vitendo mchezaji wakati nje database GameObject msingi.",
														"\u0e40\u0e1b\u0e34\u0e14\u0e43\u0e0a\u0e49\u0e15\u0e31\u0e27\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e43\u0e19\u0e01\u0e32\u0e23\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e01\u0e32\u0e23\u0e01\u0e23\u0e30\u0e17\u0e33 Playmaker \u0e40\u0e21\u0e37\u0e48\u0e2d\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25 GameObject \u0e15\u0e32\u0e21",
														"Paganahin ang pagpipiliang ito upang bumuo Playmaker mga pagkilos kapag ine-export ng GameObject batay database.",
														"Bir GameObject tabanl\u0131 veritaban\u0131 ihracat yaparken Oyun kurucu eylemleri olu\u015fturmak i\u00e7in se\u00e7ene\u011fini etkinle\u015ftirin.",
														"\u0423\u0432\u0456\u043c\u043a\u043d\u0456\u0442\u044c \u043e\u043f\u0446\u0456\u044e \u0434\u043b\u044f \u0433\u0435\u043d\u0435\u0440\u0430\u0446\u0456\u0457 \u0434\u0456\u0457 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u043f\u0440\u0438 \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0456 \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445 \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0456 GameObject.",
														"\u05d2\u05e2\u05d1\u05df \u05d3\u05d9 \u05d0\u05b8\u05e4\u05bc\u05e6\u05d9\u05e2 \u05e6\u05d5 \u05d3\u05d6\u05e9\u05e2\u05e0\u05e2\u05e8\u05d9\u05d9\u05d8 \u05e4\u05bc\u05dc\u05d9\u05d9\u05b7\u05de\u05d0\u05b7\u05e7\u05e2\u05e8 \u05d0\u05b7\u05e7\u05e9\u05d0\u05b7\u05e0\u05d6 \u05d5\u05d5\u05e2\u05df \u05e2\u05e7\u05e1\u05e4\u05bc\u05d0\u05b8\u05e8\u05d8\u05d9\u05e0\u05d2 \u05d0\u05b7 \u05d2\u05d0\u05b7\u05de\u05e2\u05d0\u05b8\u05d1\u05d3\u05d6\u05e9\u05e2\u05e7\u05d8 \u05d1\u05d0\u05d6\u05d9\u05e8\u05d8 \u05d3\u05d0\u05b7\u05d8\u05d0\u05b7\u05d1\u05d0\u05b7\u05e1\u05e2.",
														"\u555f\u7528\u8a72\u9078\u9805\u5c0e\u51fa\u4e00\u500b\u904a\u6232\u7269\u9ad4\u57fa\u65bc\u6578\u64da\u5eab\u6642\u7522\u751f\u7b56\u52d5\u9032\u653b\u884c\u52d5\u3002"));
			Rows.Add( new LocalizationRow("Select the path that GoogleFu will use when generating the Playmaker actions. (Typically the root Playmaker Actions directory, subdirectories will be automatically generated for GoogleFu databases)",
														"S\u00e9lectionnez le chemin que GoogleFu utilisera lors de la g\u00e9n\u00e9ration des actions de Playmaker. (G\u00e9n\u00e9ralement, le r\u00e9pertoire racine de Playmaker Actions, sous-r\u00e9pertoires seront g\u00e9n\u00e9r\u00e9es automatiquement pour les bases de donn\u00e9es GoogleFu)",
														"Selezionare il percorso che GoogleFu user\u00e0 quando genera le azioni di Playmaker. (In genere la directory principale di Playmaker azioni, le sottodirectory saranno generati automaticamente per i database GoogleFu)",
														"W\u00e4hlen Sie den Pfad, der GoogleFu wird bei der Generierung der Spielmacher Aktionen verwenden. (In der Regel die Wurzel Spielmacher Aktionen Verzeichnis, Unterverzeichnisse werden automatisch f\u00fcr GoogleFu Datenbanken generiert werden)",
														"Seleccione la ruta que googleFU utilizar\u00e1 al generar las acciones Jug\u00f3n. (Normalmente, el directorio de acciones Jug\u00f3n ra\u00edz, subdirectorios se generar\u00e1n autom\u00e1ticamente las bases de datos googleFU)",
														"\u062d\u062f\u062f \u0627\u0644\u0645\u0633\u0627\u0631 \u0627\u0644\u0630\u064a GoogleFu \u0633\u0648\u0641 \u062a\u0633\u062a\u062e\u062f\u0645 \u0639\u0646\u062f \u0625\u0646\u0634\u0627\u0621 \u0627\u0644\u0625\u062c\u0631\u0627\u0621\u0627\u062a \u0635\u0627\u0646\u0639 \u0627\u0644\u0627\u0644\u0639\u0627\u0628. (\u0639\u0627\u062f\u0629 \u0627\u0644\u062f\u0644\u064a\u0644 \u0627\u0644\u062c\u0630\u0631 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0635\u0627\u0646\u0639 \u0623\u0644\u0639\u0627\u0628\u060c \u0633\u064a\u062a\u0645 \u0625\u0646\u0634\u0627\u0621 \u0627\u0644\u062f\u0644\u0627\u0626\u0644 \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0644\u0642\u0648\u0627\u0639\u062f \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a GoogleFu)",
														"\ud50c\ub808\uc774 \uba54\uc774\ucee4 \uc791\uc5c5\uc744 \uc0dd\uc131 \ud560 \ub54c GoogleFu\uc774 \uc0ac\uc6a9\ud558\ub294 \uacbd\ub85c\ub97c \uc120\ud0dd\ud569\ub2c8\ub2e4. (\uc77c\ubc18\uc801\uc73c\ub85c \ub8e8\ud2b8 \ud50c\ub808\uc774 \uba54\uc774\ucee4\uc758 \uc791\uc5c5 \ub514\ub809\ud1a0\ub9ac, \ud558\uc704 \ub514\ub809\ud1a0\ub9ac\ub294 \uc790\ub3d9\uc73c\ub85c GoogleFu \ub370\uc774\ud130\ubca0\uc774\uc2a4 \uc0dd\uc131\ub429\ub2c8\ub2e4)",
														"\u9009\u62e9\u751f\u6210\u7b56\u52a8\u8fdb\u653b\u884c\u52a8\u65f6GoogleFu\u5c06\u4f7f\u7528\u7684\u8def\u5f84\u3002 \uff08\u901a\u5e38\u60c5\u51b5\u4e0b\uff0c\u6839\u4e2d\u573a\u64cd\u4f5c\u76ee\u5f55\uff0c\u5b50\u76ee\u5f55\u5c06\u81ea\u52a8\u4e3aGoogleFu\u6570\u636e\u5e93\u751f\u6210\uff09",
														"\u53f8\u4ee4\u5854\u306e\u30a2\u30af\u30b7\u30e7\u30f3\u3092\u751f\u6210\u3059\u308b\u3068\u304d\u306bGoogleFu\u304c\u4f7f\u7528\u3059\u308b\u30d1\u30b9\u3092\u9078\u629e\u3057\u307e\u3059\u3002 \uff08\u901a\u5e38\u306froot\u53f8\u4ee4\u5854\u30a2\u30af\u30b7\u30e7\u30f3\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u3001\u30b5\u30d6\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u304c\u81ea\u52d5\u7684\u306bGoogleFu\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u7528\u306b\u751f\u6210\u3055\u308c\u307e\u3059\uff09",
														"\u0412\u044b\u0431\u0435\u0440\u0438\u0442\u0435 \u043f\u0443\u0442\u044c, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 GoogleFu \u0431\u0443\u0434\u0435\u0442 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u043f\u0440\u0438 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f. (\u041a\u0430\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u043a\u043e\u0440\u043d\u0435\u0432\u043e\u0433\u043e \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0430 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0414\u0435\u0439\u0441\u0442\u0432\u0438\u044f, \u043f\u043e\u0434\u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0438 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0441\u043e\u0437\u0434\u0430\u0441\u0442 \u0434\u043b\u044f \u0431\u0430\u0437 \u0434\u0430\u043d\u043d\u044b\u0445 GoogleFu)",
														"Ch\u1ecdn con \u0111\u01b0\u1eddng m\u00e0 GoogleFu s\u1ebd s\u1eed d\u1ee5ng khi t\u1ea1o ra c\u00e1c h\u00e0nh \u0111\u1ed9ng Playmaker. (\u0110i\u1ec3n h\u00ecnh nh\u01b0 Ti\u1ec1n v\u1ec7 g\u1ed1c Actions th\u01b0 m\u1ee5c, th\u01b0 m\u1ee5c con s\u1ebd \u0111\u01b0\u1ee3c t\u1ef1 \u0111\u1ed9ng t\u1ea1o ra cho c\u01a1 s\u1edf d\u1eef li\u1ec7u GoogleFu)",
														"Selecteer het pad dat googleFU zal gebruiken bij het genereren van de spelmaker acties. (Typisch de hoofdmap spelmaker Acties directory, submappen worden automatisch gegenereerd voor googleFU databases)",
														"Kies die pad wat GoogleFu gebruik sal word wanneer die opwekking van die Play Maker aksies. (Gewoonlik die wortel Play Maker aksies gids, subgidse sal outomaties gegenereer word vir GoogleFu databasisse)",
														"\u0418\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u043f\u044a\u0442\u044f, \u043a\u043e\u0439\u0442\u043e GoogleFu \u0449\u0435 \u0438\u0437\u043f\u043e\u043b\u0437\u0432\u0430 \u043f\u0440\u0438 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u043d\u0435 \u043d\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u0442\u0430 \u043d\u0430 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440. (\u041e\u0431\u0438\u043a\u043d\u043e\u0432\u0435\u043d\u043e \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u044f \u043a\u043e\u0440\u0435\u043d \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440 \u0414\u0435\u0439\u0441\u0442\u0432\u0438\u044f, \u043f\u043e\u0434\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0438 \u0449\u0435 \u0431\u044a\u0434\u0430\u0442 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u043d\u0438 \u0437\u0430 GoogleFu \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u043d\u0438)",
														"\u0412\u044b\u0431\u0435\u0440\u044b\u0446\u0435 \u0448\u043b\u044f\u0445, \u044f\u043a\u0456 GoogleFu \u0431\u0443\u0434\u0437\u0435 \u0432\u044b\u043a\u0430\u0440\u044b\u0441\u0442\u043e\u045e\u0432\u0430\u0446\u044c \u043f\u0440\u044b \u0441\u0442\u0432\u0430\u0440\u044d\u043d\u043d\u0456 \u043f\u043b\u044d\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u0437\u0435\u044f\u043d\u043d\u0456. (\u042f\u043a \u043f\u0440\u0430\u0432\u0456\u043b\u0430, \u043a\u0430\u0440\u0430\u043d\u0451\u0432\u0430\u0433\u0430 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0430 \u043f\u043b\u044d\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0414\u0437\u0435\u044f\u043d\u043d\u0456, \u043f\u0430\u0434\u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456 \u0430\u045e\u0442\u0430\u043c\u0430\u0442\u044b\u0447\u043d\u0430 \u0441\u0442\u0432\u043e\u0440\u044b\u0446\u044c \u0434\u043b\u044f \u0431\u0430\u0437 \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445 GoogleFu)",
														"Seleccioneu la ruta que googleFU utilitzar\u00e0 en generar les accions jug\u00f3n. (Normalment, el directori d'accions Jugon arrel, subdirectoris es generaran autom\u00e0ticament les bases de dades googleFU)",
														"Vyberte cestu, kter\u00e1 GoogleFu pou\u017eije p\u0159i generov\u00e1n\u00ed Playmaker akce. (Obvykle ko\u0159enov\u00fd adres\u00e1\u0159 Tv\u016frce hry Akce, podadres\u00e1\u0159e budou automaticky generov\u00e1ny datab\u00e1z\u00ed GoogleFu)",
														"Dewiswch y llwybr y bydd GoogleFu defnyddio wrth gynhyrchu y camau playmaker. (Fel arfer, mae'r cyfeiriadur gwraidd playmaker Camau Gweithredu, bydd subdirectories cael eu cynhyrchu yn awtomatig ar gyfer cronfeydd data GoogleFu)",
														"Vali rada, mis GoogleFu kasutab kui teeniva Playmaker meetmeid. (Tavaliselt root Playmaker Actions kataloogi alamkatalooge automaatselt genereeritakse GoogleFu andmebaasid)",
														"\u0631\u0627\u0647\u06cc \u06a9\u0647 GoogleFu \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u06a9\u0647 \u062a\u0648\u0644\u06cc\u062f \u0627\u0642\u062f\u0627\u0645\u0627\u062a \u0628\u0627\u0632\u06cc\u0633\u0627\u0632 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u062f. (\u0628\u0647 \u0637\u0648\u0631 \u0645\u0639\u0645\u0648\u0644 \u062f\u0631 \u062f\u0627\u06cc\u0631\u06a9\u062a\u0648\u0631\u06cc \u0639\u0645\u0644\u06cc\u0627\u062a \u0628\u0627\u0632\u06cc\u0633\u0627\u0632 \u0631\u06cc\u0634\u0647\u060c \u0632\u06cc\u0631\u0634\u0627\u062e\u0647 \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0628\u0647 \u0635\u0648\u0631\u062a \u062e\u0648\u062f\u06a9\u0627\u0631 \u0628\u0631\u0627\u06cc \u067e\u0627\u06cc\u06af\u0627\u0647 \u062f\u0627\u062f\u0647 GoogleFu \u062a\u0648\u0644\u06cc\u062f)",
														"Valitse polku, joka GoogleFu k\u00e4ytt\u00e4\u00e4 luodessaan Playmaker toimia. (Tyypillisesti root Playmaker Toiminnot hakemistoon, alihakemistot luodaan automaattisesti varten GoogleFu tietokannat)",
														"Roghnaigh an cos\u00e1n go mbeidh GoogleFu a \u00fas\u00e1id nuair a ghini\u00faint na gn\u00edomhartha playmaker. (De ghn\u00e1th, an eolaire fhr\u00e9amh Gn\u00edomhartha playmaker, beidh fochomhadlann a ghintear go huathoibr\u00edoch do bunachair GoogleFu)",
														"Seleccione o cami\u00f1o que GoogleFu vai utilizar ao xerar as acci\u00f3ns organizador de xogo. (Normalmente, o directorio Acci\u00f3ns Playmaker ra\u00edz, os subdirectorios ser\u00e1n xerados automaticamente a base de datos GoogleFu)",
														"\u092a\u094d\u0932\u0947\u092e\u0947\u0915\u0930 \u0915\u093e\u0930\u094d\u0930\u0935\u093e\u0908 \u092a\u0948\u0926\u093e \u091c\u092c GoogleFu \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0947\u0917\u093e \u0915\u093f \u092a\u0925 \u0915\u093e \u091a\u092f\u0928 \u0915\u0930\u0947\u0902. (\u0906\u092e\u0924\u094c\u0930 \u092a\u0930 \u091c\u0921\u093c \u092a\u094d\u0932\u0947\u092e\u0947\u0915\u0930 \u0915\u094d\u0930\u093f\u092f\u093e \u0928\u093f\u0930\u094d\u0926\u0947\u0936\u093f\u0915\u093e, \u0909\u092a\u0928\u093f\u0930\u094d\u0926\u0947\u0936\u093f\u0915\u093e \u0938\u094d\u0935\u0924\u0903 GoogleFu \u0921\u0947\u091f\u093e\u092c\u0947\u0938 \u0915\u0947 \u0932\u093f\u090f \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0939\u094b \u091c\u093e\u090f\u0917\u093e)",
														"Odaberite stazu koja \u0107e GoogleFu koristiti pri stvaranju je razigrava\u010d akcije. (Obi\u010dno korijen razigrava\u010d Akcije imenik, poddirektoriji \u0107e se automatski izraditi GoogleFu baza podataka)",
														"Chwazi chemen an ki GoogleFu pral s\u00e8vi ak l\u00e8 g\u00e9n\u00e9ration aksyon sa yo Playmaker. (N\u00f2malman any\u00e8 a Aksyon Playmaker rasin, subdirectories yo pral otomatikman pwodwi pou baz done GoogleFu)",
														"Pilih jalan yang GoogleFu akan menggunakan saat membuat tindakan Playmaker. (Biasanya direktori root Playmaker Actions, subdirektori akan secara otomatis dihasilkan untuk database GoogleFu)",
														"Veldu lei\u00f0 sem GoogleFu mun nota \u00feegar kynsl\u00f3\u00f0 snillinginn a\u00f0ger\u00f0ir. (Venjulega r\u00f3t snillinginn Actions skr\u00e1, undirm\u00f6ppum ver\u00f0ur sj\u00e1lfkrafa b\u00fain til fyrir GoogleFu gagnagrunna)",
														"\u05d1\u05d7\u05e8 \u05d0\u05ea \u05d4\u05e0\u05ea\u05d9\u05d1 \u05e9GoogleFu \u05d9\u05e9\u05ea\u05de\u05e9 \u05d1\u05e2\u05ea \u05d9\u05e6\u05d9\u05e8\u05ea \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e8\u05db\u05d6\u05ea. (\u05d1\u05d3\u05e8\u05da \u05db\u05dc\u05dc \u05d1\u05e1\u05e4\u05e8\u05d9\u05d9\u05ea \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e8\u05db\u05d6\u05ea \u05e9\u05d5\u05e8\u05e9, \u05ea\u05d9\u05e7\u05d9\u05d5\u05ea \u05d4\u05de\u05e9\u05e0\u05d4 \u05d9\u05d5\u05e4\u05e7\u05d5 \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9 \u05dc\u05de\u05d0\u05d2\u05e8 \u05e0\u05ea\u05d5\u05e0\u05d9 GoogleFu)",
														"Pasirinkite keli\u0105, kad GoogleFu bus panaudoti generuojant playmakeris veiksmus. (Paprastai \u0161aknis playmakeris Veiksmai katalogas, pakatalog\u012f bus sugeneruotas automati\u0161kai GoogleFu duomen\u0173 bazi\u0173)",
														"Izv\u0113lieties ce\u013cu, GoogleFu izmantos, \u0123ener\u0113jot playmaker darb\u012bbas. (Parasti saknes playmaker Darb\u012bbas katalogs, subdirectories tiks autom\u0101tiski \u0123ener\u0113ts GoogleFu datub\u0101z\u0113m)",
