														"A\u015fa\u011f\u0131daki \u00e7al\u0131\u015fma kitaplar\u0131 an giri\u015f ve Aktif \u00e7al\u0131\u015fma kitab\u0131 olarak ayarlarsan\u0131z, ihracat i\u00e7in kullan\u0131labilir hesab\u0131n ile ili\u015fkilidir.",
														"\u041d\u0430\u0441\u0442\u0443\u043f\u043d\u0456 \u043a\u043d\u0438\u0433\u0438 \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0456 \u0437 \u043e\u0431\u043b\u0456\u043a\u043e\u0432\u043e\u0433\u043e \u0437\u0430\u043f\u0438\u0441\u0443, \u044f\u043a\u0430 \u0432 \u0434\u0430\u043d\u0438\u0439 \u043c\u043e\u043c\u0435\u043d\u0442 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u0432 \u0456 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0434\u043b\u044f \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443, \u044f\u043a\u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0432 \u044f\u043a\u043e\u0441\u0442\u0456 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438.",
														"\u05d3\u05d9 \u05e4\u05d0\u05dc\u05d2\u05e2\u05e0\u05d3\u05e2 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7\u05e1 \u05d6\u05e2\u05e0\u05e2\u05df \u05e4\u05d0\u05e8\u05d1\u05d5\u05e0\u05d3\u05df \u05de\u05d9\u05d8 \u05d3\u05e2\u05dd \u05d7\u05e9\u05d1\u05d5\u05df \u05d0\u05b7\u05d6 \u05d0\u05d9\u05d6 \u05d0\u05d9\u05e6\u05d8 \u05dc\u05d0\u05b8\u05d2\u05d3 \u05d0\u05d9\u05df \u05d0\u05d5\u05df \u05d6\u05e2\u05e0\u05e2\u05df \u05e4\u05d0\u05b7\u05e8\u05d0\u05b7\u05e0\u05e2\u05df \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df \u05d0\u05d5\u05d9\u05d1 \u05e9\u05d8\u05e2\u05dc\u05df \u05d5\u05d5\u05d9 \u05d3\u05d9 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d5\u05d5 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7.",
														"\u4e0b\u9762\u7684\u5de5\u4f5c\u7c3f\u8207\u7576\u524d\u767b\u9304\u7684\uff0c\u4e26\u4e14\u662f\u53ef\u7528\u65bc\u51fa\u53e3\uff0c\u5982\u679c\u8a2d\u7f6e\u70ba\u6d3b\u52d5\u5de5\u4f5c\u7c3f\u7684\u5e33\u6236\u76f8\u95dc\u806f\u3002"));
			Rows.Add( new LocalizationRow("The following workbooks have been manually entered and are available for export if set as the Active Workbook.  ",
														"Les classeurs suivants ont \u00e9t\u00e9 saisies manuellement et sont disponibles pour l'exportation si elle est d\u00e9finie comme le classeur actif.",
														"Le seguenti cartelle di lavoro sono stati inseriti manualmente e sono disponibili per l'esportazione, se impostato come cartella di lavoro attiva.",
														"Die folgenden Arbeitsmappen wurden manuell eingegeben und sind f\u00fcr den Export zur Verf\u00fcgung, wenn als aktive Arbeitsmappe eingestellt.",
														"Los siguientes libros se han introducido manualmente y est\u00e1n disponibles para la exportaci\u00f3n si se define como el libro activo.",
														"\u062a\u0645 \u0627\u0644\u0645\u0635\u0646\u0641\u0627\u062a \u0627\u0644\u062a\u0627\u0644\u064a\u0629 \u0625\u062f\u062e\u0627\u0644\u0647\u0627 \u064a\u062f\u0648\u064a\u0627 \u0648\u0645\u062a\u0648\u0641\u0631\u0629 \u0644\u0644\u062a\u0635\u062f\u064a\u0631 \u0625\u0630\u0627 \u062a\u0639\u064a\u064a\u0646\u0647 \u0627\u0644\u0645\u0635\u0646\u0641 \u0627\u0644\u0646\u0634\u0637.",
														"\ub2e4\uc74c \ud1b5\ud569 \ubb38\uc11c\ub294 \uc218\ub3d9\uc73c\ub85c \uc785\ub825\ud558\uace0, \ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c\ub85c \uc124\uc815\ud558\uba74 \uc218\ucd9c\uc744 \uc704\ud574 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4\ub418\uc5c8\uc2b5\ub2c8\ub2e4.",
														"\u4e0b\u9762\u7684\u5de5\u4f5c\u7c3f\u5df2\u624b\u52a8\u8f93\u5165\u53ef\u7528\u4e8e\u51fa\u53e3\u200b\u200b\uff0c\u5982\u679c\u8bbe\u7f6e\u4e3a\u6d3b\u52a8\u5de5\u4f5c\u7c3f\u3002",
														"\u6b21\u306e\u30d6\u30c3\u30af\u3092\u624b\u52d5\u3067\u5165\u529b\u3057\u3001\u30a2\u30af\u30c6\u30a3\u30d6\u306a\u30d6\u30c3\u30af\u306e\u3088\u3046\u306b\u8a2d\u5b9a\u3057\u305f\u5834\u5408\u3001\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u306e\u305f\u3081\u306b\u5229\u7528\u53ef\u80fd\u306a\u3055\u308c\u3066\u3044\u307e\u3059\u3002",
														"\u0421\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u043a\u043d\u0438\u0433\u0438 \u0431\u044b\u043b\u0438 \u0432\u0432\u0435\u0434\u0435\u043d\u044b \u0432\u0440\u0443\u0447\u043d\u0443\u044e \u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430, \u0435\u0441\u043b\u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438.",
														"C\u00e1c s\u00e1ch b\u00e0i t\u1eadp sau \u0111\u00e2y \u0111\u00e3 \u0111\u01b0\u1ee3c nh\u1eadp b\u1eb1ng tay v\u00e0 c\u00f3 s\u1eb5n \u0111\u1ec3 xu\u1ea5t kh\u1ea9u n\u1ebfu thi\u1ebft l\u1eadp nh\u01b0 l\u00e0 Workbook \u0111\u0103ng nh\u1eadp.",
														"De volgende werkboeken zijn handmatig ingevoerd en zijn beschikbaar voor de export, indien ingesteld als de actieve werkmap.",
														"Die volgende werkboeke hand is ingeskryf en is beskikbaar vir uitvoer as stel as die aktiewe Werkboek.",
														"\u0421\u043b\u0435\u0434\u0432\u0430\u0449\u0438\u0442\u0435 \u0440\u0430\u0431\u043e\u0442\u043d\u0438 \u043a\u043d\u0438\u0433\u0438 \u0441\u0430 \u0431\u0438\u043b\u0438 \u0432\u044a\u0432\u0435\u0434\u0435\u043d\u0438 \u0440\u044a\u0447\u043d\u043e \u0438 \u0441\u0430 \u043d\u0430 \u0440\u0430\u0437\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u0437\u0430 \u0438\u0437\u043d\u043e\u0441, \u0430\u043a\u043e \u043d\u0435 \u0435 \u0437\u0430\u0434\u0430\u0434\u0435\u043d\u043e \u043a\u0430\u0442\u043e \u0430\u043a\u0442\u0438\u0432\u043d\u0430\u0442\u0430 \u0440\u0430\u0431\u043e\u0442\u043d\u0430 \u043a\u043d\u0438\u0433\u0430.",
														"\u041d\u0430\u0441\u0442\u0443\u043f\u043d\u044b\u044f \u043a\u043d\u0456\u0433\u0456 \u0431\u044b\u043b\u0456 \u045e\u0432\u0435\u0434\u0437\u0435\u043d\u044b\u044f \u045e\u0440\u0443\u0447\u043d\u0443\u044e \u0456 \u0434\u0430\u0441\u0442\u0443\u043f\u043d\u044b\u044f \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443, \u043a\u0430\u043b\u0456 \u045e\u0441\u0442\u0430\u043b\u044f\u0432\u0430\u0446\u044c \u0443 \u044f\u043a\u0430\u0441\u0446\u0456 \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456.",
														"Els seg\u00fcents llibres s'han introdu\u00eft manualment i estan disponibles per a l'exportaci\u00f3 si es defineix com el llibre actiu.",
														"N\u00e1sleduj\u00edc\u00ed se\u0161ity byly zad\u00e1ny ru\u010dn\u011b a jsou k dispozici pro v\u00fdvoz, pokud nastav\u00edte jako aktivn\u00ed se\u0161it.",
														"Mae'r llyfrau gwaith canlynol wedi cael eu cofnodi \u00e2 llaw ac maent ar gael i'w allforio'r os wedi ei osod fel Gweithlyfr Active.",
														"J\u00e4rgmised t\u00f6\u00f6vihikud on k\u00e4sitsi sisestatud ja on v\u00f5imalik eksporti kui seatud aktiivne t\u00f6\u00f6vihik.",
														"\u06a9\u062a\u0627\u0628\u0647\u0627\u06cc \u0632\u06cc\u0631 \u062f\u0633\u062a\u06cc \u0648\u0627\u0631\u062f \u0634\u062f\u0647 \u0627\u0633\u062a \u0648 \u0627\u06af\u0631 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0646\u0638\u0627\u0645 \u0646\u0627\u0645\u0647 \u0647\u0627\u06cc \u0641\u0639\u0627\u0644 \u062f\u0631 \u062f\u0633\u062a\u0631\u0633 \u0647\u0633\u062a\u0646\u062f \u0628\u0631\u0627\u06cc \u0635\u0627\u062f\u0631\u0627\u062a.",
														"Seuraavat ty\u00f6kirjoja on manuaalisesti sy\u00f6tetty ja on k\u00e4ytett\u00e4viss\u00e4 vientiin, jos asetettu Active ty\u00f6kirja.",
														"Na leabhair oibre seo a leanas isteach de l\u00e1imh agus t\u00e1 siad ar f\u00e1il le haghaidh onnmhairi\u00fa m\u00e1 chrutha\u00edonn an Leabhar Oibre Gn\u00edomhacha.",
														"Os seguintes libros foron inseridos man e est\u00e1n dispo\u00f1ibles para a exportaci\u00f3n se axusta o cartafol de traballo activa.",
														"\u0928\u093f\u092e\u094d\u0928\u0932\u093f\u0916\u093f\u0924 \u0915\u093e\u0930\u094d\u092f\u092a\u0941\u0938\u094d\u0924\u093f\u0915\u093e\u0913\u0902 \u092e\u0948\u0928\u094d\u092f\u0941\u0905\u0932 \u0930\u0942\u092a \u0938\u0947 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u093f\u092f\u093e \u0939\u0948 \u0914\u0930 \u0938\u0915\u094d\u0930\u093f\u092f \u0915\u093e\u0930\u094d\u092f\u092a\u0941\u0938\u094d\u0924\u093f\u0915\u093e \u0915\u0947 \u0930\u0942\u092a \u092e\u0947\u0902 \u0938\u0947\u091f \u0905\u0917\u0930 \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u0915\u0947 \u0932\u093f\u090f \u0909\u092a\u0932\u092c\u094d\u0927 \u0939\u0948\u0902.",
														"Sljede\u0107i radne bilje\u017enice su ru\u010dno unesen i dostupni za izvoz ako je postavljen kao Active \u010ditanku.",
														"Manu\u00e8l sa yo yo te many\u00e8lman antre nan epi yo disponib pou eksp\u00f2tasyon si mete k\u00f2m kaye a aktif.",
														"The workbook berikut telah dimasukkan secara manual dan tersedia untuk ekspor jika ditetapkan sebagai Workbook aktif.",
														"Eftirfarandi Vinnub\u00e6kur hafa veri\u00f0 handvirkt inn og eru \u00ed bo\u00f0i fyrir \u00fatflutning ef sett sem virka vinnub\u00f3k.",
														"\u05d7\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4 \u05d4\u05d1\u05d0\u05d5\u05ea \u05db\u05d1\u05e8 \u05e0\u05db\u05e0\u05e1\u05d5 \u05d1\u05d0\u05d5\u05e4\u05df \u05d9\u05d3\u05e0\u05d9, \u05d5\u05d4\u05dd \u05d6\u05de\u05d9\u05e0\u05d9\u05dd \u05dc\u05d9\u05e6\u05d5\u05d0, \u05d0\u05dd \u05dc\u05d4\u05d2\u05d3\u05d9\u05e8 \u05db\u05d7\u05d5\u05d1\u05e8\u05ea \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4 \u05e4\u05e2\u05d9\u05dc\u05d4.",
														"\u0160ios darbaknyg\u0117s buvo \u012fvesti rankiniu b\u016bdu ir galima eksportuoti, jei nustatyta kaip aktyvaus Workbook.",
														"\u0160\u0101das darba burtn\u012bcas ir manu\u0101li ievad\u012bti un ir pieejams izve\u0161anai, ja uzst\u0101d\u012bts k\u0101 Active burtn\u012bca.",
														"\u0421\u043b\u0435\u0434\u043d\u0438\u0432\u0435 \u0440\u0430\u0431\u043e\u0442\u043d\u0438 \u043a\u043d\u0438\u0433\u0438 \u0431\u0438\u043b\u0435 \u0440\u0430\u0447\u043d\u043e \u0432\u043d\u0435\u0441\u0435\u043d\u0438 \u0438 \u0441\u0435 \u0434\u043e\u0441\u0442\u0430\u043f\u043d\u0438 \u0437\u0430 \u0438\u0437\u0432\u043e\u0437, \u0430\u043a\u043e \u0433\u043e \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0435 \u043a\u0430\u043a\u043e \u0430\u043a\u0442\u0438\u0432\u0435\u043d \u0414\u0435\u043b\u043e\u0432\u043d\u0438\u043a.",
														"Buku kerja berikut telah dimasukkan secara manual dan boleh didapati untuk eksport jika ditetapkan sebagai Buku Kerja Aktif.",
														"Il workbooks li \u0121ejjin \u0121ew imda\u0127\u0127la manwalment u huma disponibbli g\u0127all-esportazzjoni jekk issettjat b\u0127ala Workbook Attiva.",
														"F\u00f8lgende arbeidsb\u00f8ker har blitt lagt inn manuelt, og er tilgjengelig for eksport hvis satt som den aktive arbeidsboken.",
														"Nast\u0119puj\u0105ce skoroszyty zosta\u0142y wprowadzone r\u0119cznie i s\u0105 dost\u0119pne na eksport, je\u015bli ustawiona jako aktywnym skoroszycie.",
														"Os seguintes livros foram inseridos manualmente e est\u00e3o dispon\u00edveis para a exporta\u00e7\u00e3o se definido como a pasta de trabalho ativa.",
														"Urm\u0103toarele registrele de lucru au fost introduse manual \u0219i sunt disponibile pentru export, dac\u0103 este setat ca registrul de lucru activ.",
														"Nasleduj\u00face zo\u0161ity boli zadan\u00e9 ru\u010dne a s\u00fa k dispoz\u00edcii pre v\u00fdvoz, ak nastav\u00edte ako akt\u00edvny zo\u0161it.",
														"Naslednji delovni zvezki so vnesli ro\u010dno in so na voljo za izvoz, \u010de je nastavljena kot aktivnega delovnega zvezka.",
														"Librat e pun\u00ebs vijuese jan\u00eb futur me dor\u00eb dhe jan\u00eb n\u00eb dispozicion p\u00ebr eksport n\u00ebse konfigurohet si manual aktiv.",
														"\u0421\u043b\u0435\u0434\u0435\u045b\u0435 \u0440\u0430\u0434\u043d\u0435 \u0441\u0432\u0435\u0441\u043a\u0435 \u0441\u0443 \u0440\u0443\u0447\u043d\u043e \u0443\u043d\u0435\u043b\u0438 \u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438 \u0441\u0443 \u0437\u0430 \u0438\u0437\u0432\u043e\u0437, \u0430\u043a\u043e \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0435 \u043a\u0430\u043e \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0458 \u0440\u0430\u0434\u043d\u043e\u0458 \u0441\u0432\u0435\u0441\u0446\u0438.",
														"F\u00f6ljande arbetsb\u00f6cker har in manuellt och \u00e4r tillg\u00e4ngliga f\u00f6r export om den \u00e4r inst\u00e4lld som den aktiva arbetsboken.",
														"workbooks zifuatazo wamekuwa manually aliingia na ni inapatikana kwa mauzo kama kuweka kama Kitabu cha Active.",
														"\u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e14\u0e31\u0e07\u0e15\u0e48\u0e2d\u0e44\u0e1b\u0e19\u0e35\u0e49\u0e44\u0e14\u0e49\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e1b\u0e49\u0e2d\u0e19\u0e14\u0e49\u0e27\u0e22\u0e15\u0e19\u0e40\u0e2d\u0e07\u0e41\u0e25\u0e30\u0e1e\u0e23\u0e49\u0e2d\u0e21\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01\u0e16\u0e49\u0e32\u0e01\u0e33\u0e2b\u0e19\u0e14\u0e40\u0e1b\u0e47\u0e19\u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19\u0e25\u0e48\u0e32\u0e2a\u0e38\u0e14",
														"Ang mga sumusunod na workbooks manu-manong ipinasok at available para ma-export kung nakatakda bilang Aktibo Workbook.",
														"A\u015fa\u011f\u0131daki \u00e7al\u0131\u015fma kitaplar\u0131n\u0131 elle girilebilir ve Aktif \u00e7al\u0131\u015fma kitab\u0131 olarak ayarlarsan\u0131z, ihracat i\u00e7in kullan\u0131labilir olmu\u015ftur.",
														"\u041d\u0430\u0441\u0442\u0443\u043f\u043d\u0456 \u043a\u043d\u0438\u0433\u0438 \u0431\u0443\u043b\u0438 \u0432\u0432\u0435\u0434\u0435\u043d\u0456 \u0432\u0440\u0443\u0447\u043d\u0443 \u0456 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0434\u043b\u044f \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443, \u044f\u043a\u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0432 \u044f\u043a\u043e\u0441\u0442\u0456 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438.",
														"\u05d3\u05d9 \u05e4\u05d0\u05dc\u05d2\u05e2\u05e0\u05d3\u05e2 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7\u05e1 \u05d4\u05d0\u05b8\u05d1\u05df \u05e9\u05d5\u05d9\u05df \u05de\u05d0\u05b7\u05e0\u05d9\u05d5\u05d0\u05b7\u05dc\u05d9 \u05d0\u05e8\u05d9\u05d9\u05df \u05d0\u05d5\u05df \u05d6\u05e2\u05e0\u05e2\u05df \u05d1\u05e0\u05d9\u05de\u05e6\u05d0 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df \u05d0\u05d5\u05d9\u05d1 \u05e9\u05d8\u05e2\u05dc\u05df \u05d5\u05d5\u05d9 \u05d3\u05d9 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d5\u05d5 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7.",
														"\u4e0b\u9762\u7684\u5de5\u4f5c\u7c3f\u5df2\u624b\u52d5\u8f38\u5165\u53ef\u7528\u65bc\u51fa\u53e3\uff0c\u5982\u679c\u8a2d\u7f6e\u70ba\u6d3b\u52d5\u5de5\u4f5c\u7c3f\u3002"));
			Rows.Add( new LocalizationRow("Add a published workbook manually by copying the URL of the workbook and pasting it into the box below. The workbook will be checked for validity and made available to export if GoogleFu determines that it can access it.",
														"Ajouter un classeur publi\u00e9 manuellement en copiant l'URL du classeur et de le coller dans la case ci-dessous. Le classeur sera v\u00e9rifi\u00e9e la validit\u00e9 et la mise \u00e0 disposition d'exporter si GoogleFu d\u00e9termine qu'il ne peut y acc\u00e9der.",
														"Aggiungere una cartella di lavoro pubblicata manualmente copiando l'URL della cartella di lavoro e incollarlo nella casella qui sotto. La cartella di lavoro sar\u00e0 controllata per validit\u00e0 e reso disponibile per l'esportazione se GoogleFu determina che essa pu\u00f2 accedervi.",
														"In einer ver\u00f6ffentlichten Arbeitsmappe manuell durch Kopieren der URL der Arbeitsmappe und es in das Feld unten einf\u00fcgen. Die Arbeitsmappe wird auf G\u00fcltigkeit \u00fcberpr\u00fcft und zur Verf\u00fcgung zu exportieren, wenn GoogleFu bestimmt, dass es auf sie zugreifen werden.",
														"A\u00f1adir un libro publicado de forma manual copiando la direcci\u00f3n URL del libro y pegarlo en el cuadro de abajo. El libro de trabajo se comprobar\u00e1 la validez y la pondr\u00e1 a disposici\u00f3n de exportar si googleFU determina que puede acceder a \u00e9l.",
														"\u0625\u0636\u0627\u0641\u0629 \u0645\u0635\u0646\u0641 \u0646\u0634\u0631\u062a \u064a\u062f\u0648\u064a\u0627 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0646\u0633\u062e \u0639\u0646\u0648\u0627\u0646 URL \u0627\u0644\u0645\u0635\u0646\u0641 \u0648\u0644\u0635\u0642\u0647 \u0641\u064a \u0627\u0644\u0645\u0631\u0628\u0639 \u0623\u062f\u0646\u0627\u0647. \u0648\u0633\u064a\u062a\u0645 \u0641\u062d\u0635 \u0627\u0644\u0645\u0635\u0646\u0641 \u0644\u0644\u0635\u062d\u0629 \u0648\u0625\u062a\u0627\u062d\u062a\u0647\u0627 \u0644\u0644\u062a\u0635\u062f\u064a\u0631 \u0625\u0630\u0627 \u0642\u0631\u0631 GoogleFu \u0623\u0646\u0647 \u064a\u0645\u0643\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u064a\u0647.",
														"\ud1b5\ud569 \ubb38\uc11c\uc758 URL\uc744 \ubcf5\uc0ac\ud558\uc5ec \uc544\ub798 \uc0c1\uc790\uc5d0 \ubd99\uc5ec \ub123\uae30\ud558\uc5ec \uc218\ub3d9\uc73c\ub85c \uac8c\uc2dc \ub41c \ud1b5\ud569 \ubb38\uc11c\ub97c \ucd94\uac00\ud569\ub2c8\ub2e4. \ud1b5\ud569 \ubb38\uc11c\uc758 \uc720\ud6a8\uc131\uc744 \ud655\uc778\ud558\uace0 GoogleFu\uac00 \uadf8 \ud30c\uc77c\uc744 \uc561\uc138\uc2a4 \ud560 \uc218 \uc788\ub294\uc9c0 \uacb0\uc815\ud558\ub294 \uacbd\uc6b0 \uc218\ucd9c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
														"\u901a\u8fc7\u590d\u5236\u5de5\u4f5c\u7c3f\u7684URL\uff0c\u5e76\u5c06\u5176\u7c98\u8d34\u5230\u4e0b\u9762\u7684\u6846\u4e2d\u624b\u52a8\u6dfb\u52a0\u4e00\u4e2a\u53d1\u5e03\u7684\u5de5\u4f5c\u7c3f\u3002\u8be5\u5de5\u4f5c\u7c3f\u5c06\u88ab\u68c0\u67e5\u7684\u6709\u6548\u6027\uff0c\u5e76\u63d0\u4f9b\u51fa\u53e3\uff0c\u5982\u679cGoogleFu\u51b3\u5b9a\u4e86\u5b83\u53ef\u4ee5\u8bbf\u95ee\u5b83\u3002",
														"\u30ef\u30fc\u30af\u30d6\u30c3\u30af\u306eURL\u3092\u30b3\u30d4\u30fc\u3057\u3001\u4e0b\u306e\u30dc\u30c3\u30af\u30b9\u306b\u8cbc\u308a\u4ed8\u3051\u3066\u3001\u624b\u52d5\u3067\u516c\u8868\u30d6\u30c3\u30af\u3092\u8ffd\u52a0\u3057\u307e\u3059\u3002\u30d6\u30c3\u30af\u306b\u306f\u3001\u59a5\u5f53\u6027\u3092\u30c1\u30a7\u30c3\u30af\u3057\u3001GoogleFu\u306f\u305d\u308c\u306b\u30a2\u30af\u30bb\u30b9\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u308b\u3068\u5224\u65ad\u3057\u305f\u5834\u5408\u3001\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u304c\u5229\u7528\u53ef\u80fd\u306b\u306a\u308a\u307e\u3059\u3002",
														"\u0414\u043e\u0431\u0430\u0432\u0438\u0442\u044c \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u043a\u043d\u0438\u0433\u0443 \u0432\u0440\u0443\u0447\u043d\u0443\u044e, \u0441\u043a\u043e\u043f\u0438\u0440\u043e\u0432\u0430\u0432 URL \u0440\u0430\u0431\u043e\u0447\u0435\u0439 \u043a\u043d\u0438\u0433\u0438 \u0438 \u0432\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0435\u0433\u043e \u0432 \u043f\u043e\u043b\u0435 \u043d\u0438\u0436\u0435. \u0423\u0447\u0435\u0431\u043d\u043e\u0435 \u043f\u043e\u0441\u043e\u0431\u0438\u0435 \u0431\u0443\u0434\u0435\u0442 \u043f\u0440\u043e\u0432\u0435\u0440\u044f\u0442\u044c\u0441\u044f \u043d\u0430 \u0434\u043e\u0441\u0442\u043e\u0432\u0435\u0440\u043d\u043e\u0441\u0442\u044c \u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430, \u0435\u0441\u043b\u0438 GoogleFu \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442, \u0447\u0442\u043e \u043e\u043d \u043c\u043e\u0436\u0435\u0442 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u044c \u043a \u043d\u0435\u043c\u0443 \u0434\u043e\u0441\u0442\u0443\u043f.",
														"Th\u00eam m\u1ed9t b\u1ea3ng t\u00ednh \u0111\u01b0\u1ee3c xu\u1ea5t b\u1ea3n b\u1eb1ng tay b\u1eb1ng c\u00e1ch sao ch\u00e9p URL c\u1ee7a b\u1ea3ng t\u00ednh v\u00e0 d\u00e1n n\u00f3 v\u00e0o h\u1ed9p d\u01b0\u1edbi \u0111\u00e2y. B\u1ea3ng t\u00ednh s\u1ebd \u0111\u01b0\u1ee3c ki\u1ec3m tra t\u00ednh h\u1ee3p l\u1ec7 v\u00e0 s\u1eb5n s\u00e0ng cho xu\u1ea5t kh\u1ea9u n\u1ebfu GoogleFu x\u00e1c \u0111\u1ecbnh r\u1eb1ng n\u00f3 c\u00f3 th\u1ec3 truy c\u1eadp n\u00f3.",
														"Voeg een gepubliceerde werkmap handmatig door het kopi\u00ebren van de URL van de werkmap en het in het vak hieronder te plakken. De werkmap wordt gecontroleerd op geldigheid en beschikbaar om te exporteren als googleFU bepaalt dat er toegang toe heeft.",
														"Voeg 'n gepubliseerde werkboek met die hand deur die kopi\u00ebring van die URL van die werkboek en plak dit in die boks hieronder. Die werkboek sal nagegaan word vir geldigheid en beskikbaar te voer as GoogleFu bepaal dat hy dit kan toegang het.",
														"\u0414\u043e\u0431\u0430\u0432\u0438 \u043f\u0443\u0431\u043b\u0438\u043a\u0443\u0432\u0430\u043d\u0430 \u043a\u043d\u0438\u0433\u0430 \u0440\u044a\u0447\u043d\u043e, \u043a\u0430\u0442\u043e \u043a\u043e\u043f\u0438\u0440\u0430\u0442\u0435 URL \u0430\u0434\u0440\u0435\u0441\u0430 \u043d\u0430 \u0440\u0430\u0431\u043e\u0442\u043d\u0430\u0442\u0430 \u043a\u043d\u0438\u0433\u0430 \u0438 \u0434\u0430 \u0433\u043e \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0435 \u0432 \u043f\u043e\u043b\u0435\u0442\u043e \u043f\u043e-\u0434\u043e\u043b\u0443. \u0420\u0430\u0431\u043e\u0442\u043d\u0430\u0442\u0430 \u043a\u043d\u0438\u0433\u0430 \u0449\u0435 \u0431\u044a\u0434\u0435 \u043f\u0440\u043e\u0432\u0435\u0440\u0435\u043d \u0437\u0430 \u0432\u0430\u043b\u0438\u0434\u043d\u043e\u0441\u0442 \u0438 \u0441\u0430 \u0434\u043e\u0441\u0442\u044a\u043f\u043d\u0438 \u0437\u0430 \u0438\u0437\u043d\u043e\u0441, \u0430\u043a\u043e GoogleFu \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438, \u0447\u0435 \u043d\u0435 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0433\u043e \u043e\u0442\u0432\u043e\u0440\u0438\u0442\u0435.",
														"\u0414\u0430\u0434\u0430\u0446\u044c \u0430\u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0432\u0430\u043d\u0430\u0433\u0430 \u043a\u043d\u0456\u0433\u0443 \u045e\u0440\u0443\u0447\u043d\u0443\u044e, \u0441\u043a\u0430\u043f\u0456\u0440\u0430\u0432\u0430\u045e\u0448\u044b URL \u0440\u0430\u0431\u043e\u0447\u0430\u0439 \u043a\u043d\u0456\u0433\u0456 \u0456 \u045e\u0441\u0442\u0430\u0432\u0456\u0446\u044c \u044f\u0433\u043e \u045e \u043f\u043e\u043b\u0435 \u043d\u0456\u0436\u044d\u0439. \u041d\u0430\u0432\u0443\u0447\u0430\u043b\u044c\u043d\u044b \u0434\u0430\u043f\u0430\u043c\u043e\u0436\u043d\u0456\u043a \u0431\u0443\u0434\u0437\u0435 \u043f\u0440\u0430\u0432\u044f\u0440\u0430\u0446\u0446\u0430 \u043d\u0430 \u0434\u0430\u043a\u043b\u0430\u0434\u043d\u0430\u0441\u0446\u044c \u0456 \u0434\u0430\u0441\u0442\u0443\u043f\u043d\u044b\u044f \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443, \u043a\u0430\u043b\u0456 GoogleFu \u0432\u044b\u0437\u043d\u0430\u0447\u0430\u0435, \u0448\u0442\u043e \u0451\u043d \u043c\u043e\u0436\u0430 \u0430\u0442\u0440\u044b\u043c\u0430\u0446\u044c \u0434\u0430 \u044f\u0433\u043e \u0434\u043e\u0441\u0442\u0443\u043f.",
														"Afegir un llibre publicat de forma manual copiant l'adre\u00e7a URL del llibre i enganxar-lo al quadre de sota. El llibre de treball es comprovar\u00e0 la validesa i la posar\u00e0 a disposici\u00f3 d'exportar si googleFU determina que pot accedir-hi.",
														"P\u0159idat publikovan\u00e9ho se\u0161itu ru\u010dn\u011b zkop\u00edrov\u00e1n\u00edm adresy URL se\u0161itu a vlo\u017eit ji do pole n\u00ed\u017ee. Se\u0161it bude kontrolovat platnost a jsou k dispozici pro v\u00fdvoz, pokud GoogleFu zjist\u00ed, \u017ee k n\u00ed m\u00e1 p\u0159\u00edstup.",
														"Ychwanegwch llyfr gwaith a gyhoeddwyd llaw gan gop\u00efo URL y llyfr gwaith a gludo yn y blwch isod. Bydd y llyfr gwaith ei wirio ar gyfer dilysrwydd ac ar gael i allforio os GoogleFu yn penderfynu y gall gael gafael arno.",
														"Lisa avaldatud t\u00f6\u00f6vihikus k\u00e4sitsi kopeerides URL t\u00f6\u00f6vihiku ja kleepida see kasti. T\u00f6\u00f6vihik tuleb kontrollida kehtivust ja k\u00e4ttesaadavaks eksportida kui GoogleFu otsustab, et ta saab kasutada seda.",
														"\u0627\u0636\u0627\u0641\u0647 \u06a9\u0631\u062f\u0646 \u06a9\u0627\u0631\u0646\u0627\u0645\u0647 \u0686\u0627\u067e \u062f\u0633\u062a\u06cc \u0628\u0627 \u06a9\u067e\u06cc \u06a9\u0631\u062f\u0646 URL \u0627\u0632 \u06a9\u0627\u0631\u0646\u0627\u0645\u0647 \u0648 \u0686\u0633\u0628\u0627\u0646\u062f\u0646 \u0622\u0646 \u0631\u0627 \u062f\u0631 \u06a9\u0627\u062f\u0631 \u0632\u06cc\u0631 \u0648\u0627\u0631\u062f \u0646\u0645\u0627\u06cc\u06cc\u062f. \u0627\u06cc\u0646 \u06a9\u062a\u0627\u0628 \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0628\u0631\u0627\u06cc \u0627\u0639\u062a\u0628\u0627\u0631 \u0686\u06a9 \u0634\u062f\u0647 \u0648 \u062f\u0631 \u062f\u0633\u062a\u0631\u0633 \u0628\u0647 \u0635\u0627\u062f\u0631\u0627\u062a \u0627\u06af\u0631 GoogleFu \u062a\u0639\u06cc\u06cc\u0646 \u06a9\u0646\u0646\u062f\u0647 \u0627\u0633\u062a \u06a9\u0647 \u0622\u0646 \u0631\u0627 \u0645\u06cc \u062a\u0648\u0627\u0646\u06cc\u062f \u0628\u0647 \u0622\u0646 \u062f\u0633\u062a\u0631\u0633\u06cc \u062f\u0627\u0634\u062a\u0647.",
														"Lis\u00e4\u00e4 julkaissut ty\u00f6kirjan manuaalisesti kopioimalla URL ty\u00f6kirjan ja liitt\u00e4m\u00e4ll\u00e4 se alla olevaan kentt\u00e4\u00e4n. Ty\u00f6kirja tarkistetaan voimassaoloa ja saatetaan vied\u00e4, jos GoogleFu p\u00e4\u00e4tt\u00e4\u00e4, ett\u00e4 se voi k\u00e4ytt\u00e4\u00e4 sit\u00e4.",
														"Cuir workbook foilsithe de l\u00e1imh tr\u00ed ch\u00f3ipe\u00e1il an URL an leabhar oibre agus a ghream\u00fa isteach sa bhosca th\u00edos. Beidh an leabhar oibre a sheice\u00e1il le haghaidh bhail\u00edocht agus ar f\u00e1il chun onnmhairi\u00fa m\u00e1 chinneann GoogleFu gur f\u00e9idir \u00e9 a rochtain a fh\u00e1il air.",
														"Engadir un libro publicado manualmente copiando a URL do cartafol de traballo e pegalo na caixa de abaixo. O cartafol de traballo verificarase a validez e facilitados para exportar se GoogleFu determina que poida acceder a ela.",
