														"\u041e\u0432\u043e \u0458\u0435 \u0413\u043e\u043e\u0433\u043b\u0435 \u0440\u0430\u0434\u043d\u0430 \u0441\u0432\u0435\u0441\u043a\u0430 \u043a\u043e\u0458\u0430 \u0458\u0435 \u0442\u0440\u0435\u043d\u0443\u0442\u043d\u043e \u0430\u043a\u0442\u0438\u0432\u043d\u0430. \u0412\u0438 \u045b\u0435\u0442\u0435 \u0431\u0438\u0442\u0438 \u0443 \u043c\u043e\u0433\u0443\u045b\u043d\u043e\u0441\u0442\u0438 \u0434\u0430 \u0438\u0437\u0432\u043e\u0437\u0435 \u043f\u043e\u0434\u0430\u0442\u043a\u0435 \u0438\u0437 \u0440\u0430\u0434\u043d\u0438\u043c \u043b\u0438\u0441\u0442\u043e\u0432\u0438\u043c\u0430 \u043a\u043e\u0458\u0438 \u0441\u0435 \u043d\u0430\u043b\u0430\u0437\u0435 \u0443 \u045a\u043e\u0458.",
