														"\u0426\u0435 \u043a\u043d\u0438\u0433\u0430 Google, \u0449\u043e \u0432 \u0434\u0430\u043d\u0438\u0439 \u0447\u0430\u0441 \u0430\u043a\u0442\u0438\u0432\u043d\u043e. \u0412\u0438 \u0437\u043c\u043e\u0436\u0435\u0442\u0435 \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443\u0432\u0430\u0442\u0438 \u0434\u0430\u043d\u0456 \u0437 \u043b\u0438\u0441\u0442\u0438, \u0449\u043e \u043c\u0456\u0441\u0442\u044f\u0442\u044c\u0441\u044f \u0432 \u043d\u044c\u043e\u043c\u0443.",
														"\u05d3\u05e2\u05dd \u05d0\u05d9\u05d6 \u05d3\u05e2\u05e8 Google \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7 \u05d0\u05b7\u05d6 \u05d0\u05d9\u05d6 \u05d0\u05d9\u05e6\u05d8 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d5\u05d5. \u05d0\u05d9\u05e8 \u05d5\u05d5\u05e2\u05d8 \u05e7\u05e2\u05e0\u05e2\u05df \u05e6\u05d5 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df \u05d3\u05d0\u05b7\u05d8\u05e2 \u05e4\u05d5\u05df \u200b\u200b\u05d3\u05d9 \u05d5\u05d5\u05e2\u05e8\u05e7\u05e9\u05d9\u05e5 \u05e7\u05d0\u05b7\u05e0\u05d8\u05d9\u05d9\u05e0\u05d3 \u05d9\u05df \u05e2\u05e1.",
														"\u9019\u662f\u8c37\u6b4c\u7684\u5de5\u4f5c\u7c3f\u7576\u524d\u8655\u65bc\u6d3b\u52d5\u72c0\u614b\u3002\u60a8\u5c07\u80fd\u5920\u51fa\u53e3\u5305\u542b\u5728\u5b83\u5f9e\u5de5\u4f5c\u8868\u6578\u64da\u3002"));
			Rows.Add( new LocalizationRow("This option will automatically escape all Unicode characters to a UTF-8 format. ",
														"Cette option sera automatiquement \u00e9chapper tous les caract\u00e8res Unicode dans un format UTF-8.",
														"Questa opzione fuggire automaticamente tutti i caratteri Unicode in un formato UTF-8.",
														"Diese Option wird automatisch alle Unicode-Zeichen zu entkommen, um eine UTF-8-Format.",
														"Esta opci\u00f3n se escapar\u00e1 autom\u00e1ticamente todos los caracteres Unicode en un formato UTF-8.",
														"\u0648\u0647\u0630\u0627 \u0627\u0644\u062e\u064a\u0627\u0631 \u0627\u0644\u0647\u0631\u0648\u0628 \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0643\u0644 \u0623\u062d\u0631\u0641 Unicode \u0625\u0644\u0649 \u062a\u0646\u0633\u064a\u0642 UTF-8.",
														"\uc774 \uc635\uc158\uc740 \uc790\ub3d9\uc73c\ub85c UTF-8 \ud615\uc2dd\uc73c\ub85c \ubaa8\ub4e0 \uc720\ub2c8 \ucf54\ub4dc \ubb38\uc790\ub97c \uc774\uc2a4\ucf00\uc774\ud504\ud569\ub2c8\ub2e4.",
