														"\u3053\u306e\u30aa\u30d7\u30b7\u30e7\u30f3\u306f\u3001\u81ea\u52d5\u7684\u306bUTF-8\u5f62\u5f0f\u306b\u3059\u3079\u3066\u306eUnicode\u6587\u5b57\u3092\u30a8\u30b9\u30b1\u30fc\u30d7\u3057\u307e\u3059\u3002",
														"\u042d\u0442\u0430 \u043e\u043f\u0446\u0438\u044f \u0431\u0443\u0434\u0435\u0442 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0438\u0437\u0431\u0435\u0436\u0430\u0442\u044c \u0432\u0441\u0435\u0445 \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u0432 Unicode \u0432 \u0444\u043e\u0440\u043c\u0430\u0442 UTF-8.",
														"T\u00f9y ch\u1ecdn n\u00e0y s\u1ebd t\u1ef1 \u0111\u1ed9ng tho\u00e1t kh\u1ecfi t\u1ea5t c\u1ea3 c\u00e1c k\u00fd t\u1ef1 Unicode sang m\u1ed9t \u0111\u1ecbnh d\u1ea1ng UTF-8.",
														"Deze optie zal automatisch alle Unicode-tekens ontsnappen naar een UTF-8-indeling.",
														"Hierdie opsie sal outomaties ontsnap al Unicode-karakters na 'n UTF-8 formaat.",
														"\u0422\u0430\u0437\u0438 \u043e\u043f\u0446\u0438\u044f \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0449\u0435 \u0438\u0437\u0431\u044f\u0433\u0430\u0442 \u0432\u0441\u0438\u0447\u043a\u0438 Unicode \u0441\u0438\u043c\u0432\u043e\u043b\u0438, \u0437\u0430 \u0434\u0430 \u0444\u043e\u0440\u043c\u0430\u0442 UTF-8.",
														"\u0413\u044d\u0442\u0430\u044f \u043e\u043f\u0446\u044b\u044f \u0431\u0443\u0434\u0437\u0435 \u0430\u045e\u0442\u0430\u043c\u0430\u0442\u044b\u0447\u043d\u0430 \u043f\u0430\u0437\u0431\u0435\u0433\u043d\u0443\u0446\u044c \u045e\u0441\u0456\u0445 \u0437\u043d\u0430\u043a\u0430\u045e Unicode \u045e \u0444\u0430\u0440\u043c\u0430\u0442 UTF-8.",
