														"\u0627\u06cc\u0646 \u06af\u0632\u06cc\u0646\u0647 \u0628\u0647 \u0637\u0648\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631 \u062a\u0645\u0627\u0645 \u06a9\u0627\u0631\u0627\u06a9\u062a\u0631\u0647\u0627\u06cc \u06cc\u0648\u0646\u06cc\u06a9\u062f \u062e\u0648\u0627\u0647\u062f \u0641\u0631\u0627\u0631 \u0628\u0647 \u0641\u0631\u0645\u062a UTF-8.",
														"T\u00e4m\u00e4 vaihtoehto automaattisesti v\u00e4lttynyt Unicode merkkej\u00e4 UTF-8-muodossa.",
														"Beidh an rogha seo \u00e9al\u00fa go huathoibr\u00edoch gach carachtar Unicode le UTF-8 form\u00e1id.",
														"Esta opci\u00f3n vai escapar automaticamente todos os caracteres Unicode a formato UTF-8.",
														"\u0907\u0938 \u0935\u093f\u0915\u0932\u094d\u092a \u0915\u094b \u0938\u094d\u0935\u0924\u0903 \u090f\u0915 UTF-8 \u092a\u094d\u0930\u093e\u0930\u0942\u092a \u0915\u0947 \u0932\u093f\u090f \u0938\u092d\u0940 \u092f\u0942\u0928\u093f\u0915\u094b\u0921 \u0935\u0930\u094d\u0923 \u0938\u0947 \u092c\u091a \u091c\u093e\u090f\u0917\u093e.",
