														"Opsi ini akan otomatis lolos semua karakter Unicode ke format UTF-8.",
														"\u00deessi m\u00f6guleiki mun sj\u00e1lfkrafa komast alla Unicode-stafi \u00ed UTF-8 sni\u00f0i.",
														"\u05d0\u05e4\u05e9\u05e8\u05d5\u05ea \u05d6\u05d5 \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9 \u05dc\u05d1\u05e8\u05d5\u05d7 \u05db\u05dc \u05ea\u05d5\u05d5\u05d9 Unicode \u05dc\u05e4\u05d5\u05e8\u05de\u05d8 UTF-8.",
														"\u0160i galimyb\u0117 bus automati\u0161kai pab\u0117gti visas Unicode simboli\u0173 UTF-8 formatu.",
														"\u0160\u012b opcija autom\u0101tiski izvair\u012bties no visiem Unicode rakstz\u012bmes uz UTF-8 form\u0101t\u0101.",
														"\u041e\u0432\u0430\u0430 \u043e\u043f\u0446\u0438\u0458\u0430 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u045c\u0435 \u0438\u0437\u0431\u0435\u0433\u0430\u0430\u0442 \u0441\u0438\u0442\u0435 Unicode \u0437\u043d\u0430\u0446\u0438 \u043d\u0430 UTF-8 \u0444\u043e\u0440\u043c\u0430\u0442.",
