														"\u041e\u0432\u0430 \u043e\u043f\u0446\u0438\u0458\u0430 \u045b\u0435 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u043f\u043e\u0431\u0435\u0433\u043d\u0435 \u0441\u0432\u0435 \u0423\u043d\u0438\u0446\u043e\u0434\u0435 \u043a\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0435 \u0443 \u0423\u0422\u0424-8 \u0444\u043e\u0440\u043c\u0430\u0442\u0443.",
