			Rows.Add( new LocalizationRow("Each character in the Array Delimiters will be used to split single cell values into arrays. The Comma and Space \", \" are the default delimiters\n\nExample of an Int Array:\n1, 2, 3, 4, 5  ",
														"Chaque personnage dans les s\u00e9parateurs de tableau sera utilis\u00e9 pour diviser les valeurs de cellules uniques dans des tableaux. Espace et la virgule \",\" sont les d\u00e9limiteurs par d\u00e9faut\n\nExemple d'un tableau Int:\n1, 2, 3, 4, 5",
														"Ogni personaggio in Delimiters Array sar\u00e0 utilizzato per dividere i valori delle celle singole in array. La virgola e spazio \",\" sono i delimitatori di default\n\nEsempio di un array Int:\n1, 2, 3, 4, 5",
														"Jeder Charakter in den Array-Trennzeichen verwendet werden, um einzelne Zelle Werte in Arrays aufgeteilt werden. Die Comma-und Raumfahrt \",\" sind die Standard-Trennzeichen\n\nBeispiel f\u00fcr ein Int-Array:\n1, 2, 3, 4, 5",
														"Cada personaje de los delimitadores de matriz se utiliza para dividir los valores de celdas individuales en las matrices. La coma y el espacio \",\" son los delimitadores por default\n\nEjemplo de una matriz INT:\n1, 2, 3, 4, 5",
														"\u0648\u0633\u0648\u0641 \u062a\u0633\u062a\u062e\u062f\u0645 \u0643\u0644 \u062d\u0631\u0641 \u0641\u064a \u0635\u0641\u064a\u0641 \u0627\u0644\u0645\u062d\u062f\u062f\u0627\u062a \u0644\u062a\u0642\u0633\u064a\u0645 \u0627\u0644\u0642\u064a\u0645 \u062e\u0644\u064a\u0629 \u0648\u0627\u062d\u062f\u0629 \u0641\u064a \u0635\u0641\u0627\u0626\u0641. \u0648\u0641\u0627\u0635\u0644\u0629 \u0648\u0627\u0644\u0641\u0636\u0627\u0621 \"\u060c\" \u0647\u064a \u0627\u0644\u0645\u062d\u062f\u062f\u0627\u062a \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629\n\n\u0645\u062b\u0627\u0644 \u0635\u0641\u064a\u0641 \u0627\u0644\u0628\u0627\u062d\u062b:\n1\u060c 2\u060c 3\u060c 4\u060c 5",
