														"\u0412\u0441\u0435\u043a\u0438 \u0433\u0435\u0440\u043e\u0439 \u0432 \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b\u0438 Array \u0449\u0435 \u0441\u0435 \u0438\u0437\u043f\u043e\u043b\u0437\u0432\u0430 \u0437\u0430 \u0440\u0430\u0437\u0434\u0435\u043b\u044f\u043d\u0435 \u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u0438 \u0435\u0434\u0438\u043d\u0438\u0447\u043d\u0438 \u043a\u043b\u0435\u0442\u043a\u0438 \u0432 \u043c\u0430\u0441\u0438\u0432\u0438. \u0417\u0430\u043f\u0435\u0442\u0430\u044f\u0442\u0430 \u0438 \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e \",\" \u0441\u0430 \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b\u0438\u0442\u0435 \u043f\u043e \u043f\u043e\u0434\u0440\u0430\u0437\u0431\u0438\u0440\u0430\u043d\u0435\n\n\u041f\u0440\u0438\u043c\u0435\u0440 \u0437\u0430 Int Array:\n1, 2, 3, 4, 5",
