			Rows.Add( new LocalizationRow("String Arrays are a special type where commas do not always make sense as delimiters. The Pipe is the default delimiter.\n\nExample of a String Array:\nHello|Hola|Bonjour  ",
														"Les tableaux de cha\u00eenes de caract\u00e8res sont un type particulier o\u00f9 virgules ne font pas toujours sens comme des s\u00e9parateurs. Le tuyau est le d\u00e9limiteur par d\u00e9faut.\n\nExemple d'un tableau de cha\u00eenes:\nBonjour | Hola | Bonjour",
														"Gli array di stringhe sono un tipo speciale dove le virgole non sempre hanno senso come delimitatori. Il tubo \u00e8 il delimitatore di default.\n\nEsempio di un array di stringhe:\nCiao | Hola | Bonjour",
														"String Arrays sind eine spezielle Art, wo Kommas nicht immer Sinn machen als Trennzeichen. Die Pipe ist das Standardtrennzeichen.\n\nBeispiel f\u00fcr einen String Array:\nHallo | Hola | Bonjour",
														"Las matrices de cadena son un tipo especial donde las comas no siempre tienen sentido como delimitadores. La pipa es el delimitador predeterminado.\n\nEjemplo de una matriz de cadena:\nHola | hola | Bonjour",
														"\u0635\u0641\u0627\u0626\u0641 \u0627\u0644\u0633\u0644\u0633\u0644\u0629 \u0647\u064a \u0646\u0648\u0639 \u062e\u0627\u0635 \u062d\u064a\u062b \u0627\u0644\u0641\u0648\u0627\u0635\u0644 \u0644\u0627 \u062a\u062c\u0639\u0644 \u0627\u0644\u0634\u0639\u0648\u0631 \u062f\u0627\u0626\u0645\u0627 \u0643\u0645\u062d\u062f\u062f\u0627\u062a. \u0627\u0644\u0623\u0646\u0627\u0628\u064a\u0628 \u063a\u064a\u0631 \u0645\u062d\u062f\u062f \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a.\n\n\u0645\u062b\u0627\u0644 \u0639\u0644\u0649 \u0635\u0641\u064a\u0641 \u0633\u0644\u0633\u0644\u0629:\n\u0645\u0631\u062d\u0628\u0627 | \u062d\u0648\u0644\u0627 | \u0635\u0628\u0627\u062d \u0627\u0644\u062e\u064a\u0631",
