														"\u0421\u0442\u0440\u0443\u043d\u043d\u044b\u0435 \u043c\u0430\u0441\u0441\u0438\u0432\u044b \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0442 \u0441\u043e\u0431\u043e\u0439 \u043e\u0441\u043e\u0431\u044b\u0439 \u0442\u0438\u043f, \u0433\u0434\u0435 \u0437\u0430\u043f\u044f\u0442\u044b\u0435 \u043d\u0435 \u0432\u0441\u0435\u0433\u0434\u0430 \u0438\u043c\u0435\u0435\u0442 \u0441\u043c\u044b\u0441\u043b \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b\u0435\u0439. \u0422\u0440\u0443\u0431\u0430 \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b\u044c \u043f\u043e \u0443\u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044e.\n\n\u041f\u0440\u0438\u043c\u0435\u0440 \u043c\u0430\u0441\u0441\u0438\u0432 \u0441\u0442\u0440\u043e\u043a:\n\u0417\u0434\u0440\u0430\u0432\u0441\u0442\u0432\u0443\u0439\u0442\u0435 | Hola | Bonjour",
														"M\u1ea3ng chu\u1ed7i l\u00e0 m\u1ed9t lo\u1ea1i \u0111\u1eb7c bi\u1ec7t, d\u1ea5u ph\u1ea9y kh\u00f4ng lu\u00f4n lu\u00f4n c\u00f3 \u00fd ngh\u0129a nh\u01b0 d\u1ea5u ph\u00e2n c\u00e1ch. Pipe l\u00e0 d\u1ea5u ph\u00e2n c\u00e1ch m\u1eb7c \u0111\u1ecbnh.\n\nV\u00ed d\u1ee5 v\u1ec1 m\u1ed9t m\u1ea3ng String:\nXin ch\u00e0o | Hola | Bonjour",
