														"String Skikkings is 'n spesiale tipe waar kommas nie altyd sin maak nie as skeikarakters. Die pyp is die standaard delimiter.\n\nVoorbeeld van 'n string skikking:\nHallo | Hola | Bonjour",
														"String \u041c\u0430\u0441\u0438\u0432\u0438\u0442\u0435 \u0441\u0430 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0435\u043d \u0432\u0438\u0434, \u043a\u044a\u0434\u0435\u0442\u043e \u0437\u0430\u043f\u0435\u0442\u0430\u0438 \u043d\u0435 \u0432\u0438\u043d\u0430\u0433\u0438 \u0438\u043c\u0430\u0442 \u0441\u043c\u0438\u0441\u044a\u043b \u043a\u0430\u0442\u043e \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b\u0438. \u0422\u0440\u044a\u0431\u0430\u0442\u0430 \u0435 \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b \u043f\u043e \u043f\u043e\u0434\u0440\u0430\u0437\u0431\u0438\u0440\u0430\u043d\u0435.\n\n\u041f\u0440\u0438\u043c\u0435\u0440 \u0437\u0430 String Array:\nHello | Hola | Bonjour",
														"\u0421\u0442\u0440\u0443\u043d\u043d\u044b\u044f \u043c\u0430\u0441\u0456\u0432\u044b \u045e\u044f\u045e\u043b\u044f\u044e\u0446\u044c \u0441\u0430\u0431\u043e\u0439 \u0430\u0441\u0430\u0431\u043b\u0456\u0432\u044b \u0442\u044b\u043f, \u0434\u0437\u0435 \u043a\u043e\u0441\u043a\u0456 \u043d\u0435 \u0437\u0430\u045e\u0441\u0451\u0434\u044b \u043c\u0430\u0435 \u0441\u044d\u043d\u0441 \u0443 \u044f\u043a\u0430\u0441\u0446\u0456 \u043f\u0430\u0434\u0437\u0435\u043b\u044c\u043d\u0456\u043a\u0430\u045e. \u0422\u0440\u0443\u0431\u0430 \u043f\u0430\u0434\u0437\u0435\u043b\u044c\u043d\u0456\u043a \u043f\u0430 \u0437\u043c\u0430\u045e\u0447\u0430\u043d\u043d\u0456.\n\n\u041f\u0440\u044b\u043a\u043b\u0430\u0434 \u043c\u0430\u0441\u0456\u045e \u0440\u0430\u0434\u043a\u043e\u045e:\n\u0414\u043e\u0431\u0440\u044b \u0434\u0437\u0435\u043d\u044c | Hola | Bonjour",
														"Les matrius de cadena s\u00f3n un tipus especial on les comes no sempre tenen sentit com delimitadors. La pipa \u00e9s el delimitador per defecte.\n\nExemple d'una matriu de cadena:\nHola | hola | Bonjour",
