														"Araeau Llinynnol yn fath arbennig lle nad coma bob amser yn gwneud synnwyr fel amffinyddion. Mae'r Pipe yw'r amffinydd diofyn.\n\nEnghraifft o Array Llinyn:\nHelo | Hola | Bonjour",
														"String massiivid on erit\u00fc\u00fcpi kus komad ei ole alati m\u00f5tet kui piirajaid. Toru on vaikimisi eraldaja.\n\nN\u00e4ide String Array:\nTere | Hola | Bonjour",
														"\u0622\u0631\u0627\u06cc\u0647 \u0631\u0634\u062a\u0647 \u0627\u06cc \u06cc\u06a9 \u0646\u0648\u0639 \u0648\u06cc\u0698\u0647 \u0627\u0633\u062a \u06a9\u0647 \u062f\u0631 \u0622\u0646 \u06a9\u0627\u0645\u0627 \u0647\u0645\u06cc\u0634\u0647 \u062d\u0633 \u0631\u0627 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u062d\u0627\u0626\u0644. \u0644\u0648\u0644\u0647 \u062d\u0627\u0626\u0644 \u0628\u0647 \u0637\u0648\u0631 \u067e\u06cc\u0634 \u0641\u0631\u0636 \u0627\u0633\u062a.\n\n\u06cc\u06a9 \u0645\u062b\u0627\u0644 \u0627\u0632 \u06cc\u06a9 \u0622\u0631\u0627\u06cc\u0647 \u0631\u0634\u062a\u0647 \u0627\u06cc:\n\u062e\u0648\u0634 \u0622\u0645\u062f\u06cc\u062f | \u0633\u0644\u0627\u0645 | \u062a\u06cc\u0645 Bonjour",
														"String paneelit ovat erityinen jossa pilkkuja ei aina j\u00e4rke\u00e4 rajoittimina. Pipe on oletuksena erotin.\n\nEsimerkki String Array:\nHei | Hola | Bonjour",
														"T\u00e1 arrays Teaghr\u00e1n chine\u00e1l speisialta i gc\u00e1s nach cam\u00f3ga a dh\u00e9anamh i gc\u00f3na\u00ed ciall mar carachtair, n\u00f3 r\u00e9ims\u00ed. Is \u00e9 an P\u00edob an teormharc\u00f3ir r\u00e9amhshocraithe.\n\nSampla de Eagar Teaghr\u00e1n:\nDia duit | hola | Bonjour",
														"Matrices de corda son un tipo especial onde comas non sempre te\u00f1en sentido como delimitadores. O Pipe \u00e9 o delimitador est\u00e1ndar.\n\nExemplo dunha matriz de cadea:\nOla | Hola | Bonjour",
														"\u0938\u094d\u091f\u094d\u0930\u093f\u0902\u0917 \u0938\u0930\u0923\u0940 \u0915\u0947 \u0932\u093f\u090f \u0905\u0932\u094d\u092a\u0935\u093f\u0930\u093e\u092e \u0939\u092e\u0947\u0936\u093e \u0938\u0940\u092e\u093e\u0902\u0915\u0915 \u0915\u0947 \u0930\u0942\u092a \u092e\u0947\u0902 \u092e\u0924\u0932\u092c \u0928\u0939\u0940\u0902 \u0939\u0948, \u091c\u0939\u093e\u0902 \u090f\u0915 \u0935\u093f\u0936\u0947\u0937 \u092a\u094d\u0930\u0915\u093e\u0930 \u0915\u0947 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902. \u092a\u093e\u0907\u092a \u0921\u093f\u092b\u093c\u0949\u0932\u094d\u091f \u0938\u0940\u092e\u093e\u0902\u0915\u0915 \u0939\u0948.\n\n\u090f\u0915 \u0938\u094d\u091f\u094d\u0930\u093f\u0902\u0917 \u0938\u0930\u0923\u0940 \u0915\u093e \u0909\u0926\u093e\u0939\u0930\u0923:\n\u0928\u092e\u0938\u094d\u0915\u093e\u0930 | \u0939\u094b\u0932\u093e | \u0938\u0941\u092a\u094d\u0930\u092d\u093e\u0924",
														"Guda\u010dki Nizovi su posebna vrsta kojoj zarezi ne uvijek ima smisla kao Delimiters. Pipe je zadana grani\u010dnik.\n\nPrimjer Guda\u010dki Array:\nPozdrav | Hola | Bonjour",
														"Matris ch\u00e8n se yon kalite espesyal ki kote vigil pa toujou f\u00e8 sans k\u00f2m separateur. Tiyo a se delimiteur an default.\n\nEgzanp nan yon etalaj ch\u00e8n:\nBonjou | Hola | Bonjour",
														"String Array adalah jenis khusus di mana koma tidak selalu masuk akal sebagai pembatas. The Pipe adalah pembatas default.\n\nContoh String Array:\nHello | Hola | Bonjour",
														"String Fylki eru s\u00e9rst\u00f6k tegund \u00fear kommum ekki alltaf skynsamleg og delimiters. The Pipe er sj\u00e1lfgefin m\u00e1nu\u00f0ur.\n\nD\u00e6mi um String Array:\nHall\u00f3 | Hola | Bonjour",
														"\u05de\u05e2\u05e8\u05db\u05d9 \u05de\u05d7\u05e8\u05d5\u05d6\u05ea \u05d4\u05dd \u05e1\u05d5\u05d2 \u05de\u05d9\u05d5\u05d7\u05d3 \u05e9\u05d1\u05d5 \u05e4\u05e1\u05d9\u05e7\u05d9\u05dd \u05dc\u05d0 \u05ea\u05de\u05d9\u05d3 \u05d4\u05d2\u05d9\u05d5\u05e0\u05d9\u05d9\u05dd \u05db\u05de\u05e4\u05e8\u05d9\u05d3\u05d9\u05dd. \u05e6\u05e0\u05e8\u05ea \u05d4\u05d9\u05d0 \u05de\u05e4\u05e8\u05d9\u05d3 \u05d1\u05e8\u05d9\u05e8\u05ea \u05d4\u05de\u05d7\u05d3\u05dc.\n\n\u05d3\u05d5\u05d2\u05de\u05d0 \u05dc\u05de\u05e2\u05e8\u05da \u05de\u05d7\u05e8\u05d5\u05d6\u05ea:\n\u05e9\u05dc\u05d5\u05dd | Hola | Bonjour",
