														"St\u012bgu Mas\u012bvi ir \u012bpa\u0161s veids, kad komatus ne vienm\u0113r j\u0113gas k\u0101 atdal\u012bt\u0101jus. Pipe ir noklus\u0113juma atdal\u012bt\u0101js.\n\nPiem\u0113rs String Array:\nLabdien | Hola | Bonjour",
														"\u041d\u0438\u0437\u0430 \u041d\u0438\u0437\u0438 \u0441\u0435 \u043f\u043e\u0441\u0435\u0431\u0435\u043d \u0432\u0438\u0434 \u043a\u0430\u0434\u0435 \u0437\u0430\u043f\u0438\u0440\u043a\u0438 \u043d\u0435 \u0441\u0435\u043a\u043e\u0433\u0430\u0448 \u0438\u043c\u0430 \u0441\u043c\u0438\u0441\u043b\u0430, \u043a\u0430\u043a\u043e \u0420\u0430\u0437\u0434\u0435\u043b\u0438. \u0426\u0435\u0432\u043a\u0430\u0442\u0430 \u0435 \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0434\u043d\u043e \u0440\u0430\u0437\u0434\u0432\u043e\u0458\u0443\u0432\u0430\u0447\u043e\u0442.\n\n\u041f\u0440\u0438\u043c\u0435\u0440 \u043d\u0430 \u0441\u0442\u0440\u0438\u043d\u0433 \u043d\u0438\u0437\u0430:\n\u0417\u0434\u0440\u0430\u0432\u043e | Hola | Bonjour",
