														"Matryce String s\u0105 szczeg\u00f3lnym rodzajem gdzie przecinki nie zawsze ma sens jako ograniczniki. Rura jest domy\u015blny separator.\n\nPrzyk\u0142ad tablicy ci\u0105g\u00f3w:\nWitaj | Hola | Bonjour",
