														"String Polia s\u00fa \u0161peci\u00e1lny typ, kde \u010diarky nie v\u017edy zmysel ako odde\u013eova\u010de. Trubka je predvolen\u00fd odde\u013eova\u010d.\n\nPr\u00edklad String Array:\nDobr\u00fd de\u0148, | Hola | Bonjour",
