														"\u0413\u0443\u0434\u0430\u0447\u043a\u0438 \u041d\u0438\u0437\u043e\u0432\u0438 \u0441\u0443 \u043f\u043e\u0441\u0435\u0431\u043d\u0430 \u0432\u0440\u0441\u0442\u0430 \u0433\u0434\u0435 \u0437\u0430\u0440\u0435\u0437\u0438 \u043d\u0435 \u0443\u0432\u0435\u043a \u0441\u043c\u0438\u0441\u043b\u0430 \u0440\u0430\u0437\u0434\u0432\u0430\u0458\u0430\u0442\u0438 \u043d\u0430\u0432\u043e\u0434\u043d\u0438\u0446\u0438\u043c\u0430. \u0426\u0435\u0432\u0438 \u0458\u0435 \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0434\u043d\u0430 \u0433\u0440\u0430\u043d\u0438\u0447\u043d\u0438\u043a.\n\n\u041f\u0440\u0438\u043c\u0435\u0440 \u0421\u0442\u0440\u0438\u043d\u0433 \u0410\u0440\u0440\u0430\u0438:\n\u0417\u0434\u0440\u0430\u0432\u043e | \u0417\u0434\u0440\u0430\u0432\u043e | \u0411\u043e\u045a\u043e\u0443\u0440",
