														"\u0421\u0442\u0440\u0443\u043d\u043d\u0456 \u043c\u0430\u0441\u0438\u0432\u0438 \u044f\u0432\u043b\u044f\u044e\u0442\u044c \u0441\u043e\u0431\u043e\u044e \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u0438\u0439 \u0442\u0438\u043f, \u0434\u0435 \u043a\u043e\u043c\u0438 \u043d\u0435 \u0437\u0430\u0432\u0436\u0434\u0438 \u043c\u0430\u0454 \u0441\u0435\u043d\u0441 \u044f\u043a \u0440\u043e\u0437\u0434\u0456\u043b\u044c\u043d\u0438\u043a\u0438. \u0422\u0440\u0443\u0431\u0430 \u0440\u043e\u0437\u0434\u0456\u043b\u044c\u043d\u0438\u043a \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c.\n\n\u041f\u0440\u0438\u043a\u043b\u0430\u0434 \u043c\u0430\u0441\u0438\u0432 \u0440\u044f\u0434\u043a\u0456\u0432:\n\u0417\u0434\u0440\u0430\u0432\u0441\u0442\u0432\u0443\u0439\u0442\u0435 | Hola | Bonjour",
